var book = {
	"name": "နံၫဟမဲအၫ",
	"numChapters": 13,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စဟၭခလဲအၫအဖိၪခွၫစနံၫဟမဲအၫအဆၧချဲၩ့လ ဖၪလီၫ. တၭလၧနံၪ့ထၪ့အၥၫ့ နံၫဆံၫအဖၧၩ့နီၪ, လၩ ခံၭစလုၫအဖၧၩ့, ဆၧမၩအၥၭလၧယအီၪလၧနီးရှုၡၫ့",
			"2": "<sup>2</sup> အဖၧၩ့နီၪ,- ယထၧၫ့ဖုဝဲလဂၩစဟၫနနဲၫ, ဂဲၫး အဝ့ၫဒၪ ဒဲၦယုဒၫဖိၪလနၩ့တၭ, ယအၪ့စၪ့အဝ့ၫၥံၪလၧဆၧဘၪ ဆဲၫ့ၦယုဒၫဖိၪဖီၩ့ဖျ့ၭဝ့ၫလဖၪ, လၧအအီၪလၩ့ထးထီး ၦဘၪဆၧဆိၬခွံၬဝ့ၫနီၪ, ဒဲယရုစလံၫ့အဂဲးအကၠီၪ့နီၪ",
			"3": "<sup>3</sup> ဆ့လီၫ.- တၭအဝ့ၫၥံၪစံၭယၧၩ, ထီးၦဘၪဆၧဆိၬခွံၬ ဝ့ၫနီၪ,ၦလနၩ့လၧအအီၪလၩ့ထးဒံၭလၧခးဖၧၩ့, အီၪ လၧဆၧၡၪ့ဆၧနၭ ဒဲဆၧဒုၪဒွ့ၪဝ့ၫဖၭဒိၪ အဖၧၩ့တၭး ယရုစလံၫ့နီၪ အခိၪဒၧၩ့လၩ့ဎီးခွံၬဆ့ယူၭ, ဒဲအတရၫ့ ၥံၪမ့ၪအၪ့ခွံၬယူၭလီၫ.",
			"4": "<sup>4</sup> ထီးယနါဂၧၫ့ဆၧချဲၩ့လဖၪနီၪ ဆၧမၩအၥၭလၧယ ဆၧၫ့နၩ့ဂၪ့ဝ့ၫတၭ, ယၥုၪ့အုၭၥၭအုၭမုနံၩလဖၪ, ဒဲဒုၪ ဆၧအၪ့ဆၧအီၩ, ဒဲဘၩဆိၪဖၪလၧမူၭခိၪအယွၩအမ့ၬ",
			"5": "<sup>5</sup> ယၫတၭ,စံၭဝ့ၫ,- ယဟိဝၩမူၭခိၪအယွၩဧ့, ယအၪ့ ကံၩ့အၪ့ယၩနၧၩ, ယွၩဖၭဒိၪနီၪဆၧဘၪၥၭမဲၪဝ့ၫ, လၧ အထီးန့ဆၧအုၩ့လၩ့ဒဲဆၧယၫ့ၥၭ လၧၦလၧအအဲၪဝ့ၫ",
			"6": "<sup>6</sup> ဒဲထီးန့အဆၧမၪလူၬလဖၪအဂး,- တၭဘိၩ့နဲၪ့ယီၩ, ဒိၭနနါဒဲစၪ့ထၪ့နမ့ၬၥၪၥံၪ, ဘဲၫၥိၭနမိခိၭနၪနခ့ၫနၡၩ အဆၧဘၩဆိၪဖၪ, လၧယအၪ့ကံၩ့အၪ့ယၫနၧၩဘိၩ့နဲၪ့ ယီၩ,မုဆၫဆၫမုနၩနၩ, လၧနခ့ၫနၡၩ အံၫစရ့လၭဖိၪ ၥံၪအဂး,ဒဲလီၩလၩ့အံၫစရ့လၭဖိၪၥံၪ အဆၧၥူၭဆၧမၪ လဖၪ,လၧပမၩမၪဆၧထၫ့ဒုၪဒၩနၧၩနီၪး ယဝ့ၫဒၪဒဲယ",
			"7": "<sup>7</sup> ဖါအဂံၪ့ဖိၪၥံၪမၪဘၪယူၭနံၫခီၫလူၬလီၫ.- ပမၩအၧၩ့ ဆၧဖၭဒိၪထၫ့ဒုၪဒၩနၧၩ, ဒဲလထီးန့ဘၪနဆၧမၪလူၬ လဖၪမွဲဂ့ၩ, ဆၧၥနိၫလဖၪမွဲဂ့ၩ, ဆၧစ့ၩရၫ့လဖၪမွဲဂ့ၩ,",
			"8": "<sup>8</sup> လၧနမၪလူၬနခ့ၫနၡၩစမိစ့ၭနီၪလီၫ.- ယအၪ့ကံၩ့အၪ့ ယၫနၧၩ,နၪ့ထၪ့ထဲၩ့ဆၧချဲၩ့လၧနမၪလူၬ နခ့ၫနၡၩစမိ စ့ၭ,စံၭဝ့ၫ, နၥံၪအ့ၪမၩမၪဘၪဆၧတၭ, ယမိမၩလၩ့",
			"9": "<sup>9</sup> ပြံၩလၩ့ပၩနၥံၪလၧ ၦဆၨၩလဖၪအကျၩတၭး- အ့ၪမွဲ နၥံၪအ့ၪကၠၪထဲၩ့နၥံၪအၥၭလၧယအီၪ, ဒဲထီးန့ယဆၧ မၪလူၬလဖၪ, ဒဲမၩအဝ့ၫၥံၪဆ့း မွဲၦဘၪဆဲၫ့လၧနၥံၪဘၪ ဆၧနၫ့ထၪ့ခွံၬဝ့ၫလၧမူၭထံၭအထုၬလခီၫလါနၫ့နီၪ, ယ မိအၪ့ထုၫ့ကီၪ့ထဲၩ့ဒီၭအဝ့ၫၥံၪ လၧအလးနီၪတၭ, ယမိ ဂဲၫထဲၩ့ဆိၬအဝ့ၫၥံၪ ထီၩ့လၧအလးလၧယရွံန့ဘဲၫၥိၭ",
			"10": "<sup>10</sup> ယမိအီၪက့ၪလၩ့ယမံၩ့ထီးနီၪလီၫ.- ဘိၩ့နဲၪ့ယီၩၦ လဖၪယီၩမွဲနခ့ၫနၡၩဒဲနၡၩခမျၧးၥံၪ, လၧနဎွ့ၩန့ထဲၩ့",
			"11": "<sup>11</sup> ဝ့ၫ,လၧနစီၩ့ဒိၪနမၩ့ဒိၪ, ဒဲလၧနစူၪဆီၪ့နီၪလီၫ.- ယဟိ ဝၩဧ့, ယအၪ့ကံၩ့အၪ့ယၫနၧၩ, ဒိၭနနါဘိၩ့နဲၪ့ယီၩ, လၧနခ့ၫနၡၩလဂၩ အဆၧဘၩဆိၪဖၪ, ဒဲလၧနခ့ၫနၡၩ လဖၪ,ၦလၧအဆိၫ့ၥၭမဲၪ နမံၩ့အဆၧဘၩဆိၪဖၪဆံၭ. ယအၪ့ကံၩ့နၧၩ မၩဘီၪထၪ့ယီၫထၪ့လါနခ့ၫနၡၩ လၧ မုလနံၩယီၩ, ဒဲဖ့ၪလၫ့လါဆၧယၫ့ၥၭလၧၦလဂၩယီၩ အမ့ၬယၫဆံၭ. အဂဲးဘဲၫယီၩ ယမွဲၦလၧအဆိၬလိၫ့ လၧစဎွၩအဂးနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> လၧစဎွၩအၭတဇၧၫစံၫ အနံၪ့ဘၪလၧနံၫဆံၫအနံၪ့ နီၪ,လၩနဲစၫ့အဖၧၩ့, ဆၧမၩအၥၭလၧစဘံၭထံၫအီၪ လၧအမ့ၬယၫတၭ, ယမၩန့စဘံၭထံၫနီၪ ဖ့ၪလၫ့စဎွၩ လီၫ. လၧအၥၫ့နီၪယမ့ၬလၩ့ၡါ လၧအမ့ၬယၫနးဖၧၫ့",
			"2": "<sup>2</sup> အ့ၬ.- အခိးမွဲစဎွၩစံၭယၧၩ, နလဘၪစူၭဘၪဆၫတၭ, နမ့ၬလၩ့ၡါမွဲဘၪလဲၪး အယီၩမွဲဆၧနးမံၩ့အ့ၬ, မွဲန့ၫ",
			"3": "<sup>3</sup> ဆၧၥုၪ့အုၭၥၭအုၭနီၪလီၫ.- ထီးနီၪလဖၧၫ့ ယၥၭမဲၪထၪ့ ဖၭဒိၪတၭ, ယစံၭစဎွၩနီၪ, မွဲစဎွၩမၧၫ့အဆိၩအကၠၪ နီၪဘီၪ. ထီးဒိၩ့လၧယဖါၥံၪအၥွၪခိၪအလးနီၪ ဘၪ ဆၧဂၭဂီၩ့ဝ့ၫဒဲအတရၫ့လဖၪနီၪ မ့ၪအၪ့ခွံၬလူၬဝ့ၫတၭ, ယမ့ၬလလၩ့ၡါဘၪနီၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့စဎွၩစံၭယၧၩ, မွဲနမိအၪ့ကံၩ့ဆၧနီၪလ",
			"5": "<sup>5</sup> မံၩ့လဲၪ. အခိးမွဲအၪ့ကံၩ့မူၭခိၪအယွၩလီၫ.- တၭ ယစံၭစဎွၩနီၪ, အ့ၪဘၪစဎွၩအၥၭတၭ, နခ့ၫနၡၩအ့ၪ ဘၪခိးဘၪတၩ လၧနမ့ၬယၫ, ယဆိၫ့လၧနမိအၪ့မၧၫ့ ယၧၩလ့ၩလၧယုဒၫ ထီၩ့လၧယဖါၥံၪအၥွၪခိၪလဖၪ အဒိၩ့နီၪ, ဘဲၫၥိၭယမိမၩထၪ့ဝ့ၫဒၪနီၪလီၫ.",
			"6": "<sup>6</sup> တၭစဎွၩနီၪစံၭယၧၩ, (နးဎွၩမုၪဆၧၫ့နၩ့လၧအနဲၩ့ ထံၭဆ့) နလ့ၩဆၧနီၪ မိယံၬဆံၭယံၬလဲၪး ဒဲဆံၭယံၬ လၧနမိဂဲၫထဲၩ့လဲၪ. အခိးမွဲဘၪစဎွၩအၥၭ လၧအမိ",
			"7": "<sup>7</sup> အၪ့မၧၫ့ယၧၩတၭး ယဖၭနံၩဖၭၥၫ့လီၫ.- လၧနီၪအမ့ၬ ယၫယစံၭစဎွၩနီၪ, အ့ၪဘၪစဎွၩအၥၭတၭ, မွဲအဖ့ၪ လၫ့လံၬလၧၦဒိၪဖၭဒိၪၥံၪ လၧထံၫမိၡါဝါအနီၪလခီၫ, ဘဲၫၥိၭအဝ့ၫၥံၪမိၥိၫ့ယၧၩ ထီးယထီၩ့လၧယုဒၫအဖၧၩ့",
			"8": "<sup>8</sup> နီၪ,- ဒဲလံၬလၧၦပၧၩ့စဎွၩအဂံၪ့လဖၪ, စအၫစဖၭလ ဂၩနီၪ, ဘဲၫၥိၭအဝ့ၫဒၪ မိဖ့ၪလၫ့ယၧၩ လၧၥံၪ့နီၪလၧ ယမိမၩနီးအတရၫ့အထုၪ့ၥံၪ, ချီၩ့ၥံၪဘၪဆဲၫ့လၧဂံၪ့, ဒဲလၧဒိၩ့ခိၪဒၧၩ့အဂး, ဒဲလၧဂံၪ့လၧယမိနုၬလၧအဖၧၩ့ အဂးနီၪဆ့လီၫ. တၭစဎွၩဖ့ၪလၫ့ယၧၩ, ဘဲၫယယွၩ အစူၪဂ့ၩအီၪလၧယဂးအၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ ယဂဲၫထီၩ့လၧၦဒိၪဖၭဒိၪၥံၪလၧထံၫ မိၡါဝါအနီၪလခီၫအအီၪတၭ, ယဖ့ၪလၫ့အဝ့ၫၥံၪလၧ စဎွၩအလံၬနီၪလီၫ. တၭစဎွၩအၪ့မၧၫ့ၦၥုၭအခိၪၥံၪ ဘၪဆဲၫ့လၧၥုၭမုနီၪ, ဒဲၦၥ့ၪၥုၭလဖၪလနၩ့လ့ၩၥိၫ့ယၧၩ",
			"10": "<sup>10</sup> လီၫ.- ထီးၦဟီရၫဖိၪစစၫ့ဘၪလၭ, ဒဲဆၧအခ့ၫအၡၩ ၦအၫမၧၫ့ဖိၪ, စတိၫဘဲအၫၥံၪ နါဂၧၫ့ဝ့ၫတၭ, မွဲလၧၦ လဂၩဂဲၫမၩဘိၭမၩဆၧၩ့ ၦအံၫစရ့လၭဖိၪ လဖၪနီၪ အကၠီၩ့,အဝ့ၫၥံၪ အၥုၪ့အုၭအၥၭအုၭ ဒိၪဒိၪလ့ၬဆ့ လီၫ.",
			"11": "<sup>11</sup> အခိးမွဲယထီၩ့လၧယရုစလံၫ့နီၪတၭ, ယအီၪထီး",
			"12": "<sup>12</sup> နီၪၥၧၫ့ၥၫ့လီၫ.- ယဂဲထုၪ့မုနၩလခီၫတၭ, ယဝ့ၫဒၪဒဲၦ ၡၩလၧယၥိၭၡၩခိၬဂၩဆ့း တၭဆၧလၧယယွၩဒုၭအီၪ ထၪ့လၧယၥၭခံဖၧၩ့, လၧယဘၪမၩလၧယရုစလံၫ့နီၪ, ယလီၩဘၪၦနးဂၩအ့ၬး အ့ၪလမွဲဘၪ ဆၧဖိၪဆၧဎါ လၧယထူၬလဒုၩနီၪ, ဆၧဖိၪဆၧဎါအီၪလၧယစူၪဖၧၩ့",
			"13": "<sup>13</sup> နးဒုၩအ့ၬ- တၭလၧမုနၩလခီၫနီၪ ယစဲၪ့ထၪ့လ့ၩလၧ ခိၪလီၩ့ဆူၭဘၪလၧတရၫ့ လၧၡီၩ့အထံၫဖၧၩ့ အမ့ၬ ယၫဒၪလ့ၬ, ဒဲထီၩ့လၧတရၫ့ ဆၧအ့ၪတၭ, ယယိယရု စလံၫ့အခိၪဒၧၩ့လဖၪ, လၧအဘၪဆၧမၩလၩ့ဎီးခွံၬ,",
			"14": "<sup>14</sup> ဒဲတရၫ့ၥံၪလၧမ့ၪအၪ့ခွံၬဝ့ၫဒၪနီၪလီၫ.- ထီးနီၪလဖၧၫ့ ယလ့ၩဒံၭဖိးလၧထံၫထၪ့ဖျိၭအတရၫ့နီၪ, ဒဲထီၩ့လၧ စဎွၩအကမၫတၭး အ့ၪမွဲဆၧဖိၪဆၧဎါလၧယထူၬနီၪ",
			"15": "<sup>15</sup> လ့ၩဝ့ၫအလးဖိးနးစီၪ့အ့ၬ.- ထီးနီၪလဖၧၫ့လၧမုနၩလ ခီၫယလ့ၩထၪ့လၧထံၫဖိၪချိၬအနဲၩ့တၭ, ယယိအခိၪ ဒၧၩ့နီၪ,ကၠၪထဲၩ့တၭ, ယလ့ၩနုၬလၧခိၪလီၩ့ဆူၭအတ ရၫ့တၭ, ထဲၩ့ထီၩ့ဝ့ၫဘဲၫနီၪအၥိၭလီၫ.",
			"16": "<sup>16</sup> တၭယလ့ၩဆၧနီၪ ဒဲယမၩနီၫလဲၪနီၫလဲၪနီၪ, ၦပၧၩ့ ဆၧလဖၪ ၥ့ၪယၫဝ့ၫနးမံၩ့အ့ၬး တၭလၧၦယုဒၫဖိၪမွဲ ဂ့ၩ,ၦလုဆၧလဖၪမွဲဂ့ၩ, ၦဒိၪဖၭဒိၪလဖၪမွဲဂ့ၩ, ၦပၧၩ့ ဆၧမွဲဂ့ၩ, ၦဂူၫဂၩၥံၪလၧအမၩဆၧနီၪ, ယလီၩဘၪဝ့ၫ",
			"17": "<sup>17</sup> နးဂၩဒံၭအ့ၬ.- ထီးနီၪလဖၧၫ့ယစံၭအဝ့ၫၥံၪ, နၥံၪဒၪ ဘၪဆၧခိဆၧဝီၩ လၧအဘၪပၧၩတၭ, ယရုစလံၫ့ဘၪ ဆၧလၩ့ဎီးခွံၬအဂဲးအကၠီၪ့, ဒဲအတရၫ့ၥံၪမ့ၪအၪ့ခွံၬဝ့ၫ ဒၪတၭး ဂဲၫဘီၪ, မွဲပမိမၩထၪ့ထဲၩ့ယရုစလံၫ့အခိၪဒၧၩ့",
			"18": "<sup>18</sup> နီၪ,ဘဲၫၥိၭပထီးကဲၪလၧၩ့ဆၧဒုၪဒွ့ၪလဂ့ၩ.- ထီးနီၪ လဖၧၫ့ယလီၩဘၪအဝ့ၫၥံၪ လၧယယွၩအစူၪဂ့ၩအီၪ လၧယဂးအဂဲးအကၠီၪ့တၭ, စဎွၩနီၪ, ဒဲအဆၧချဲၩ့လ ဖၪလၧအလီၩဘၪယၧၩနီၪလီၫ. တၭအဝ့ၫၥံၪစံၭ, မွဲ ပမိဂဲထုၪ့မၩထၪ့ၡီၩ့ဆၧနီၪဘီၪ. အခိးမွဲအဝ့ၫၥံၪမၩ ဆီၪ့အစူၪၥံၪလၧဆၧမၩဂ့ၩလမံၩ့ယီၩအဂးလီၫ.",
			"19": "<sup>19</sup> မွဲလါနၫ့တၭထီးၦဟီရၫဖိၪ စစၫ့ဘၪလၭလဂၩ,ဒဲ ဆၧအခ့ၫအၡၩၦအၫမၧၫ့ဖိၪ, စတိၫဘဲအၫနီၪ,ဒဲၦအရ့ ဘၠၫဖိၪစဂံၡံၫ့ၥံၪ, နါဂၧၫ့ဝ့ၫတၭ,မွဲအနံဘၪဒုၪဒွ့ၪပၧၩ,ဒဲ မၩကြၩ့ထမးပၧၩတၭ, စံၭဝ့ၫဒၪ, နၥံၪမၩဆၧလမံၩ့ ယီၩမွဲဆၧနီၪလမံၩ့လဲၪး မွဲနၥံၪမိပိၩ့ထၪ့စဎွၩနီၪဆ့",
			"20": "<sup>20</sup> ဧၪ.- ထီးနီၪလဖၧၫ့ယချဲၩ့ဆၧၫ့အဝ့ၫၥံၪတၭ, စံၭအဝ့ၫ ၥံၪ,မူၭခိၪအယွၩနီၪ မိမၩဘီၪထၪ့ယီၫထၪ့ပၧၩး မၩ အၥၭဘဲၫနီၪတၭ, ပဝ့ၫဒၪအခ့ၫအၡၩ ပမိဂဲထုၪ့မၩထၪ့ ဆၧနီၪး အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪအဂးမွဲဂ့ၩ,နၥံၪပၧၩ့ ဘၪမွဲဂ့ၩ, ဆၧဒုၭနၪ့ထၪ့ထဲၩ့နီၪမွဲဂ့ၩ, အီၪလၧယရု စလံၫ့အဖၧၩ့နးမံၩ့အ့ၬ."
		},
		"3": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦလုဆၧအခိၪ စအံၫလဲအၡံၫ့ဂဲထုၪ့ လၧအထၧၫ့ဖုဝဲၥံၪ ၦလုဆၧလဖၪအၥိၭတၭ, အဝ့ၫၥံၪ မၩထၪ့ၥိၪအတရၫ့နီၪ, မွဲအမၩဆံၫ့ဎံၪဝ့ၫ, ဒဲဘိၭထၪ့အ တရၫ့ၥံၪး ထီးလၧဟၫမံအၫအထိၬထၪ့ထီၫနီၪဒၪလ့ၬ, မၩဆံၫ့ဝ့ၫထီၩ့လၧစဟၫနၫအ့လၭ အထိၬထၪ့ထီၫနီၪ",
			"2": "<sup>2</sup> လီၫ.- လၧအဘူၭထံးအဝ့ၫၥံၪ ၦယ့ၫရခိၫဖိၪၥံၪမၩထၪ့ ဆၧတၭး လၧအဘူၭထံးအဝ့ၫၥံၪ, စအံမရဲၫအဖိၪခွၫ စဇၭကၧၭမၩထၪ့ဆၧနီၪလီၫ.",
			"3": "<sup>3</sup> အ့ၪမွဲတရၫ့ယၪနီၪစဟၭစနၫအၫ အဖိၪခွၫလဖၪမၩ ထၪ့ဝ့ၫဒၪတၭ, အဝ့ၫဒၪအီၪက့ၪထၪ့ချီၩ့ၥံၪ, ဒဲဘိၭထၪ့",
			"4": "<sup>4</sup> အတရၫ့ၥံၪ,ၥီၭၥံၪ, ဒဲအနိၪဘီၩ့ၥံၪနီၪလီၫ.- လၧအဘူၭ ထံးအဝ့ၫၥံၪ, စကိဇၫအဖိၪခွၫ, စယုၫရဲယၫအဖိၪခွၫ စမ့ၫရမီၭမၩဂ့ၩထၪ့ဆၧလီၫ. လၧအဘူၭထံးအဝ့ၫၥံၪ, စမၡ့ၭဇဘံၫအ့လၭ အဖိၪခွၫ, စဘံၫရခဲအၫအဖိၪခွၫ",
			"5": "<sup>5</sup> စမၡၧလၫ့မၩဂ့ၩထၪ့ဆၧလီၫ.- လၧအဘူၭထံးအဝ့ၫ ၥံၪ, စဘၫအနၫအဖိၪခွၫ စဇၫဒီၭ မၩဂ့ၩထၪ့ဆၧလီၫ. လၧအဘူၭထံးအဝ့ၫၥံၪ, ၦတကိဖိၪၥံၪမၩဂ့ၩထၪ့ဆၧး အ့ၪမွဲအဝ့ၫၥံၪအၦဒိၪလဖၪ အီၪက့ၪလၩ့အခိၬလၧအ ဝ့ၫၥံၪအကဆါအဆၧမၩအဂးအ့ၬ.",
			"6": "<sup>6</sup> လၧနီၪအမ့ၬယၫ စပစံအၫအဖိၪခွၫ စယဟီအဒၪ, ဒဲစဘ့ၭစဒဲအၫအဖိၪခွၫ, စမၡၧလၫ့ၥံၪမၩဂ့ၩထၪ့တရၫ့ လးလံၩနီၪး ဒဲအဝ့ၫၥံၪအီၪက့ၪထၪ့ချီၩ့ၥံၪ, ဒဲဘိၭထၪ့",
			"7": "<sup>7</sup> အတရၫ့ၥံၪ,ဒဲၥီၭၥံၪ, ဒဲနိၪဘီၩ့ၥံၪလီၫ.- လၧအဘူၭထံး အဝ့ၫၥံၪ,ၦဂံဘအၧၫ့ဖိၪစမ့လတဲအၫ, ဒဲၦမ့ရၫ့ဖိၪစယၫ ဒၧၫ့,ၦၡၩလၧဂံဘအၧၫ့, ဒဲလၧမံဇပၫၥံၪမၩဂ့ၩထၪ့ဆၧ ထီၩ့လၧၦဒိၪဖၭဒိၪ အလးဆီၩ့ဆီ လၧထံၫမိၡါဝါအ",
			"8": "<sup>8</sup> ယီၩလခီၫနီၪလီၫ.- လၧအဘူၭထံးအဝ့ၫဒၪ, စဟၫဟ အဲအၫအဖိၪခွၫစအၧၭဇဲၫအ့လၭ, လၧၦထမၬထီၫ့ၥံၪ အကျၩ,မၩဂ့ၩထၪ့ဆၧလီၫ. လၧအဘူၭထံးအဝ့ၫဆ့, စဟၫ့အနဲအၫဘၪဆဲၫ့လၧ ၦလဲၩဎုၬၥံၪလဂၩအဖိၪခွၫ မၩဂ့ၩထၪ့ဆၧတၭ, အဝ့ၫၥံၪမၩထၪ့ယရုစလံၫ့အထိၬ",
			"9": "<sup>9</sup> ၥံၪထီၩ့လၧခိၪဒၧၩ့ဖၭလဲလစီၪ့နီၪလီၫ.- လၧအဘူၭထံး အဝ့ၫၥံၪနီၪ, စဟၧအဖိၪခွၫစရံၫဖဲအၫလၧအပၧၩ့ယရု",
			"10": "<sup>10</sup> စလံၫ့ဖိၭဖၫ့နီၪမၩဂ့ၩထၪ့ဆၧလီၫ.- လၧအဘူၭထံးအ ဝ့ၫၥံၪနီၪ, စဟရုမၭအဖိၪခွၫစယ့ၫဒဲအၫမၩဂ့ၩထၪ့ဆၧ ဆဲၫဎၩ့လၧအဂံၪ့နီၪလီၫ. လၧအဘူၭထံးအဝ့ၫဒၪနီၪ စဟၭၡၭဘနၫအဖိၪခွၫ စဟၭတၧၭ မၩဂ့ၩထၪ့ဆၧ",
			"11": "<sup>11</sup> လီၫ.- စဟၫရံၫ့အဖိၪခွၫစမၫလခဲယၫ, ဒဲစပၫဟၭမိအၭ အဖိၪခွၫစဟၭၡၧၭၥံၪမၩဂ့ၩထၪ့ အလးဂူၫဂၩလစီၪ့,",
			"12": "<sup>12</sup> ဒဲဖံၫ့ချၪၥံၪအထိၬထၪ့ထီၫနီၪလီၫ.- လၧအဘူၭထံးအ ဝ့ၫဒၪနီၪ, စဟၫလိအ့ၭအဖိၪခွၫ စၡၫလၧၫ့လၧအပၧၩ့ ယရုစလံၫ့ဖိၭဖၫ့နီၪအဝ့ၫဒၪ, ဒဲအဖိၪမုၪၥံၪမၩဂ့ၩထၪ့ ဆၧလီၫ.",
			"13": "<sup>13</sup> စဟၫနၧၫ့, ဒဲၦဇၫနိအၫဖိၪလဖၪ မၩဂ့ၩထၪ့ခိၪလီၩ့ ဆူၭတရၫ့နီၪး အဝ့ၫၥံၪမၩထၪ့ဝ့ၫ, ဒဲဘိၭထၪ့အတရၫ့ ၥံၪ,ၥီၭၥံၪ, ဒဲအနိၪဘီၩ့ၥံၪ, ဒဲခိၪဒၧၩ့နီၪအဖျါလထီၫ့ၥံၪ",
			"14": "<sup>14</sup> ထီၩ့လၧတရၫ့ဆၧအ့ၪနီၪလီၫ.- အ့ၪမွဲတရၫ့ဆၧအ့ၪ နီၪစရံခၭအဖိၪခွၫစမၫလခဲအၫ, လၧအပၧၩ့ဘ့ၭၥဟၭ စရံၫ့လကဲၩ့နီၪ, မၩဂ့ၩထၪ့ဝ့ၫဒၪတၭး အဝ့ၫဒၪမၩထၪ့ ဝ့ၫနီၪ,ဒဲဘိၭထၪ့တရၫ့ၥံၪ, ၥီၭၥံၪ, ဒဲအနိၪဘီၩ့ၥံၪနီၪ",
			"15": "<sup>15</sup> လီၫ.- အ့ၪမွဲထံၫထၪ့ဖျိၭအတရၫ့နီၪ စကိၫလဟိဇ့ၫအ ဖိၪခွၫစၡၫလၧၫ့လၧအပၧၩ့ မံဇပၫလကဲၩ့မၩဂ့ၩထၪ့ ဝ့ၫဒၪးအဝ့ၫဒၪမၩထၪ့ဝ့ၫ, ဒဲၥိၭထၪ့ဝ့ၫအခိၪ, ဒဲဘိၭထၪ့ ဝ့ၫအတရၫ့ၥံၪ,ၥီၭၥံၪ, ဒဲအနိၪဘီၩ့ၥံၪ, ဒဲစံၫလိၫအၫ့အ ကမၫအခိၪဒၧၩ့လၧစဎွၩ အကျိၭအနဲၩ့ထံၭ,ဒဲထီၩ့လၧ ဎၫ့ၥံၪလၧအလ့ၩလၩ့ခွံၬ လၧစဒၫဝံၭအဒိၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> လၧအဝ့ၫအလးခဲၫ့နီၪ စအၭဇဘၧၭအဖိၪခွၫစနံၫ ဟမဲအၫ, လၧအပၧၩ့ဘ့ၫၥဇၧၫလကဲၩ့နီၪ, မၩဂ့ၩထၪ့ ဆၧဆဲၫဎၩ့လိၬအၥၭ လၧစဒၫဝံၭအၥွၪခိၪၥံၪ, ဒဲလၧက မၫလၧၦခုၪ့ဝ့ၫထီၩ့လၧၦအဆီၪ့အဂံၪ့နီၪလီၫ.",
			"17": "<sup>17</sup> လၧအဝ့ၫဒၪအလးခဲၫ့နီၪ စဘၫနဲၫအဖိၪခွၫ စရ့ဟၧၫ့, ၦလံဝဲၫဖိၪၥံၪမၩဂ့ၩထၪ့ဆၧလီၫ. လၧအဘူၭထံးအဝ့ၫ ဒၪနီၪ စဟၭၡဘဲအၫ, လၧအပၧၩ့ကဲလၫဖိၭဖၫ့မၩဂ့ၩထၪ့ဆၧ",
			"18": "<sup>18</sup> လၧအလးနီၪလီၫ.- လၧအဝ့ၫဒၪအလးခဲၫ့နီၪအဝ့ၫၥံၪ အထၧၫ့ဖုဝဲၥံၪစဟံၫ့အဒၭအဖိၪခွၫ စဘ့ၫဝဲၫလၧအပၧၩ့",
			"19": "<sup>19</sup> ကဲလၫဖိၭဖၫ့နီၪ မၩဂ့ၩထၪ့ဆၧလီၫ.- လၧအဘူၭထံး အဝ့ၫဒၪ, စယ့ၭရှုၫအၫအဖိၪခွၫ, စအံဇၧၫ, လၧအပၧၩ့ မံဇပၫနီၪ, မၩဂ့ၩထၪ့အလးဂူၫဂၩ လကုၭလၧအဆဲၫ ဎၩ့လၧဆၧလ့ၩထၪ့လၧစူၪဝဲၩလဖၪ အလးလၧဆၧနိၪ့",
			"20": "<sup>20</sup> နီၪလီၫ.- လၧအဝ့ၫဒၪအလးခဲၫ့နီၪ စဇၭဘအဲၫအဖိၪခွၫ စဘၫရၧၭမၩဂ့ၩထၪ့အလးဂူၫဂၩ လကုၭလၧအၥၭဆီၪ့, အခၪ့ထံၭဘၪလၧနိၪ့နီၪ, ထီၩ့လၧၦလုဆၧအခိၪစအံၫ",
			"21": "<sup>21</sup> လဲအၡံၭအဂံၪ့အတရၫ့ထံၭနီၪလီၫ.- လၧအဝ့ၫဒၪအ လးခဲၫ့စကိဇၫအဖိၪခွၫ, စယုၫရဲယၫအဖိၪခွၫစမ့ၫရ မီၭမၩဂ့ၩထၪ့အဂူၫဂၩလကုၭ အခၪ့ထံၭဘၪလၧစအံၫ လဲအၡံၭအဂံၪ့အတရၫ့ထံၭနီၪ ထီၩ့လၧစအံၫလဲအၡံၭ အဂံၪ့အထုၬလခီၫနီၪလီၫ.",
			"22": "<sup>22</sup> လၧအဝ့ၫဒၪအလးခဲၫ့, ၦလုဆၧၥံၪ, ၦအီၪ လၧဆၧပျၩ့ဖၧၩ့, မၩဂ့ၩထၪ့ဆၧလီၫ.- လၧအဝ့ၫ",
			"23": "<sup>23</sup> ဒၪအလးခဲၫ့နီၪ စဘံၪ့ယမံၫ့ဒဲစဟၭၡၧၭမၩဂ့ၩထၪ့ ဆၧဆဲၫဎၩ့လၧ အဝ့ၫၥံၪအဂံၪ့နီၪလီၫ. လၧအဝ့ၫဒၪ အလးခဲၫ့စအၫ့အနဲအၫ အဖိၪခွၫစမ့ၫအစဲအၫအ",
			"24": "<sup>24</sup> ဖိၪခွၫစအၭဇရဲအၫမၩဂ့ၩထၪ့ဆၧလီၫ.- လၧအဝ့ၫဒၪ အလးခဲၫ့နီၪ စဟံၫ့နဒၪအဖိၪခွၫ စဘံၫ့ယုၫအဲၫ မၩဂ့ၩ ထၪ့အဂူၫဂၩလကုၭအခၪ့ထံၭ လၧစအၭဇရဲအၫအဂံၪ့ နီၪထီၩ့လၧအကၠၪထဲၩ့ဝ့ၫ, ထီၩ့ဒၪလ့ၬလၧနိၪ့နီၪလီၫ.",
			"25": "<sup>25</sup> စအၧၭဇဲၫအဖိၪခွၫစပၫလၫနီၪ, လၧအဆဲၫဎၩ့ဆၧကၠၪ ထဲၩ့ဝ့ၫအလးနီၪ, ဒဲထိၬလၧအအီၪဘူၭလၧစဎွၩအဂံၪ့ ထၪ့ထီၫနီၪ, လၧအအီၪဘူၭလၧထီၫ့အဝၩ့ဖၧၩ့နီၪလီၫ. လၧအဝ့ၫအလးခဲၫ့နီၪ စပၫရီၭအဖိၪခွၫ စပဒဲအၫနီၪ လီၫ.",
			"26": "<sup>26</sup> တၭၦန့ၭၥနံဖိၪၥံၪလၧအအီၪလၧ အိၫဖ့လၭအဖၧၩ့ မၩဂ့ၩထၪ့ဆၧထီၩ့လၧ တရၫ့ထံၫလၧမုထၪ့လခီၫ,ဒဲ လၧထိၬထၪ့ထီၫအီၪလၧခီၫ့နီၪလီၫ.",
			"27": "<sup>27</sup> လၧအဝ့ၫၥံၪအ လးခဲၫ့ၦထံၫကိၫဖိၪ မၩဂ့ၩထၪ့ အဂူၫဂၩလကုၭ, လၧအဆဲၫဎၩ့ထိၬထၪ့ထီၫဖၭဒိၪလၧ ခီၫ့နီၪ, ထီၩ့လၧအိၫ ဖ့လၭအခိၪဒၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> လၧတရၫ့ကၥ့ၪလၧထၭလခီၫနီၪ, ၦလုဆၧၥံၪမၩ ဂ့ၩထၪ့ဝ့ၫ,လဂၩဒဲလဂၩ ဆဲၫဎၩ့လၧအဂံၪ့ဒၪဝ့ၫဆုၬဆုၬ",
			"29": "<sup>29</sup> နီၪလီၫ.- လၧအဝ့ၫၥံၪအလးခဲၫ့နီၪ စအံမၧၫအဖိၪခွၫ စဇၫဒီၭမၩဂ့ၩထၪ့ဆၧလၧ အဆဲၫဎၩ့ အဂံၪ့ဒၪဝ့ၫနီၪ လီၫ. လၧအဝ့ၫဒၪအလးခဲၫ့ စၡ့ၭခနဲအၫအဖိၪခွၫစၡံၫ မအဲအၫလၧအခိၭတရၫ့မုထၪ့နီၪ မၩဂ့ၩထၪ့ဆၧဆ့",
			"30": "<sup>30</sup> လီၫ.- လၧအဝ့ၫဒၪအလးခဲၫ့နီၪ စၡ့ၫလမဲအၫအဖိၪခွၫ စဟၫ့အနဲအၫ ဒဲစဟၫနၧၫ့လၧအမွဲစဇၫလပၫအဖိၪခွၫ ဎူၫဂၩလဂၩနီၪ, မၩဂ့ၩထၪ့အဂူၫဂၩ လကုၭနီၪလီၫ. လၧအဝ့ၫဒၪအလးခဲၫ့နီၪ စဘ့ၫရခဲအၫအဖိၪခွၫစမၡၧ လၫ့မၩဂ့ၩထၪ့ဆၧဆဲၫဎၩ့ လၧအဒူၭထၪ့ထီၫလစီၪ့နီၪ",
			"31": "<sup>31</sup> လီၫ.- လၧအဝ့ၫဒၪအလးခဲၫ့ ၦထမၬထီၫ့အဖိၪခွၫစမၫ လခဲအၫမၩဂ့ၩထၪ့ဆၧထီၩ့လၧ ၦန့ၭၥနံဖိၪအလး,ဒဲ လၧၦဖနံၬဖိၪၥံၪ, ဆဲၫဎၩ့လၧမံၭဖကၭအတရၫ့နီၪ, ဒဲ",
			"32": "<sup>32</sup> လၧဆၧလ့ၩထၪ့ဝ့ၫလၧဆၧအနိၪ့နီၪလီၫ.- တၭလၧဆၧ လ့ၩထၪ့ဝ့ၫလၧဆၧအနိၪ့ထီၩ့လၧ ၥိၪတရၫ့နီၪအဘိၩ့ ဆၧၩ့,ၦထမၬထီၫ့ၥံၪ ဒဲၦဖနံၬဖိၪၥံၪ မၩဂ့ၩထၪ့ဝ့ၫဒၪ လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> မွဲလါနၫ့တၭဆၧမၩအၥၭ, ထီးစစၫ့ဘၪလၭနါဂၧၫ့ လၧပမၩထၪ့ခိၪဒၧၩ့နီၪ, အဝ့ၫဒၪၥၭထၪ့ဝ့ၫတၭ, အၥၭ ခိထၪ့နၭနၭလ့ၬ, ဒဲမၩကြၩ့ထမးၦယုဒၫဖိၪလဖၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪချဲၩ့ဆၧလၧအထၧၫ့ဖုဝဲၥံၪ အမ့ၬယၫဒဲလၧစမ့ ရအၫအၡၩၥုၭမုခမျၧးအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,ၦလၧ အဂဲးဆါၦယုဒၫဖိၪလဖၪယီၩ မၩဆၧနီၪလမံၩ့လဲၪ. အဝ့ၫၥံၪမိမၩထိၬထၬ အနၫ့ဆါလဖၪနီၪဆ့ဧၪ. မွဲအမိ လုထၪ့ဆၧဆ့ဧၪ. မွဲအမိမၩထီးအဂီၩ့ လနံၩဎးဒၪဆ့ ဧၪ. မွဲအမိမၩမၧၫ့ထၪ့လိးလဖၪ လၧဆၧအပိၩ့လၧမ့ၪ",
			"3": "<sup>3</sup> အၪ့ခွံၬဆၧနီၪဆ့ဧၪ.- တၭၦအၫမၧၫ့ဖိၪစတိၫဘဲအၫလ ဂၩနီၪအီၪလၧအနဲၩ့ထံၭတၭ, အဝ့ၫဒၪစံၭဝ့ၫ, ဆၧလၧ အဝ့ၫၥံၪမၩထၪ့ဝ့ၫနီၪ, ထွံၪမံၩ့ဒၪလ့ၬအ့ၪထၪ့တၭ, မိ မၩလၩ့ဎီးခွံၬအဝ့ၫၥံၪ အခိၪဒၧၩ့လိးနီၪတၡါလီၫ.",
			"4": "<sup>4</sup> ပယွၩဧ့, ခိၭနၪဘီၪး အဂဲးဘဲၫယီၩ ဆၧမၩကြၩ့ထ မးပၧၩလီၫ. တၭအဝ့ၫၥံၪအဆၧဒုၪဒွ့ၪနီၪ ကၠၪကဒၩ ထဲၩ့လၧအဝ့ၫၥံၪအခိၪဎွံၪဒၪဝ့ၫ အလီၩ့နီၪဆံၭး တၭ ဖ့ၪလၫ့အဝ့ၫၥံၪလၧဆၧအၪ့ဂူၬဆီၪ့ဝ့ၫအဂး, လၧထံၫ",
			"5": "<sup>5</sup> ၥံၪခးၥံၪအဆၧဆိၬခွံၬဆီၪ့အလးနီၪဆံၭ.- ထီးမၩ လၩ့ဘံၭခွံၬအဝ့ၫၥံၪအဆၧအၧၩ့နီၪလဂ့ၩး တၭအဝ့ၫ ၥံၪအဆၧဒဲၩဘၭနီၪ, မွဲအထီးဘၪဆၧထူၭခွံၬဝ့ၫလၧန မ့ၬယၫလဂ့ၩ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪထိၪဂဲၩနဆၧၥၭ ထၪ့လၧၦမၩထၪ့ဆၧလဖၪအမ့ၬယၫနီၪလီၫ.",
			"6": "<sup>6</sup> အခိးမွဲပမၩထၪ့ဆၧအခိၪဒၧၩ့နီၪး တၭဆၧအခိၪ ဒၧၩ့နီၪထၫ့ထိၪဘုၭလိၬအၥၭ ထီးအလူၬထၪ့ဘၭလၧ ဆၧဖိၭဖၫ့နီၪး အဂဲးဘဲၫယီၩ ၦၡၩခမျၧးၥံၪအၥၭအီၪ လၧအမိမၩဆၧလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့ဘိၩဆၧမၩအၥၭထီးစစၫ့ဘၪလၭ, ဒဲစ တိၫဘဲအၫ,ဒဲၦအရ့ဘၠၫဖိၪၥံၪ, ဒဲၦအၫမၧၫ့ဖိၪၥံၪ,ဒဲၦ အၭစဒီၭဖိၪၥံၪ, နါဂၧၫ့လၧဆၧမၩထၪ့ယရုစလံၫ့အခိၪ ဒၧၩ့လဖၪနီၪ, ဒဲအဆၧဖိးလဖၪဘၪဆၧမၩဘံၭထၬဝ့ၫ",
			"8": "<sup>8</sup> တၭ,- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪၥၭထၪ့ဝ့ၫနၭနၭလ့ၬ, ဒဲ ကိၪ့ထၪ့လိၬအၥၭကိၭဂၩဒ့ၭ လၧအမိဂဲၫထၪ့ဒုၭဆၧ",
			"9": "<sup>9</sup> ထၫ့ဒုၪဒၩယရုစလံၫ့, ဒဲပဒၩ့ဆၧနီၪဆ့လီၫ.- မွဲလါနၫ့ ဘဲၫနီၪတၭ ပဝ့ၫဒၪပအၪ့ကံၩ့ဘၩဆိၪဖၪ လၧပယွၩ နီၪ,ဒဲလၧအဝ့ၫၥံၪအကၠီၩ့ဆ့, ပအီၪက့ၪၦၡၩခိၭဆၧ",
			"10": "<sup>10</sup> ထၫ့ဒၩအဝ့ၫၥံၪမုဆၫဆၫမုနၩနၩနီၪလီၫ.- တၭစယုဒၫ စံၭဝ့ၫ,ၦယိၭဆၧဎၧၫ့လဖၪနီၪ အဂဲးအဘၭလၩ့ဆါ ထဲၩ့ယူၭ,ဒဲဆၧဘံၪၥိၭပိၩ့ၥံၪ အီၪအၪအၪလ့ၬတၭး အ",
			"11": "<sup>11</sup> ခိးမွဲပမၩထၪ့ခိၪဒၧၩ့နီၪနၧၩ့ဝါအ့ၬ.- တၭပဒုၪပဒၩၥံၪ စံၭဝ့ၫ,ပလချႃၭထီၩ့ဒံၭဘၪလၧအဝ့ၫၥံၪအကျၩ, ဒဲမၩ ၥံၫခွံၬဝ့ၫ,ဒဲမၩဂၭဂီၩ့ခွံၬဆၧဖံၭဆၧမၩနီၪ, အဝ့ၫၥံၪမိ ၥ့ၪယၫ,ဒဲဒၪဘၪနးစီၪ့အ့ၬ.",
			"12": "<sup>12</sup> ထီးၦယုဒၫဖိၪ လၧအဘူၭအဝ့ၫၥံၪနီၪဂဲၫထီၩ့တၭ, ဆၧမၩအၥၭလၧအလီၩဘၪပၧၩဆံၫဘျၩ့, လၧကယဲ အလးလၧနၥံၪမိဂဲၫထဲၩ့ လၧပအီၪလစီၪ့ လါလါနီၪ",
			"13": "<sup>13</sup> လီၫ.- အခိးမွဲဘဲၫနီၪတၭ, ယအီၪက့ၪလၧအလးဖၨၪ လၧခိၪဒၧၩ့ချိၫ့နီၪ, ဒဲလၧအလးထၪ့ထီၫဆ့, ယအီၪက့ၪ ၦၡၩဘဲၫဂံၪ့ဒီၪ့ဖိၪလဖၪအၥိၭ အီၪလၧအဖၩ့ၥံၪနၭၥံၪ,",
			"14": "<sup>14</sup> ဒဲအချံၪလဖၪနီၪလီၫ.- တၭယယိဆၧ, ဒဲဂဲထုၪ့တၭ,ယ စံၭၦအီၪလၧဆၧလၩဖၩ့ၥံၪ, ဒဲၦပၧၩ့ဆၧၥံၪ, ဒဲၦခမျၧး ဂူၫဂၩၥံၪ, ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩး နၪ့ထၪ့ထဲၩ့လၧ ယဟိဝၩနီၪ, မွဲဆၧဖၭဒိၪဒဲၥၭမဲၪဆၧအလးတၭး ဒုၭ ဆၧလၧနၥံၪအထၧၫ့ဖုဝဲၥံၪအဂး, နၥံၪအဖိၪခွၫၥံၪအ ဂး,ဒဲနၥံၪအဖိၪမုၪၥံၪအဂး, နၥံၪအမၫၥံၪအဂး,ဒဲနၥံၪ အဂံၪ့ၥံၪဎၫ့ၥံၪအဂးနီၪဆံၭ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭထီးပဒုၪပဒၩၥံၪနါဂၧၫ့ လၧပၥ့ၪယၫ ဆၧအဂဲးအကၠီၪ့နီၪ, ဒဲယွၩမၩဂၭဂီၩ့ အဝ့ၫၥံၪအဆၧ ကိၪ့ထၪ့နီၪတၭ ပထဲၩ့ထဲၩ့ပဝ့ၫလၧဆၧခိၪဒၧၩ့နီၪကိၭ ဂၩဒ့ၭ,လဂၩလၧအဆၧမၩဒၪဝ့ၫ လဂၩလၧအဆၧမၩ",
			"16": "<sup>16</sup> ဒၪဝ့ၫဆုၬဆုၬလီၫ.- တၭဆၧမၩအၥၭလၧအဆၧၫ့အ ထီနီၪ,ဒဲအလးခဲၫ့ဆ့, ယခ့ၫယၡၩဖိၭဖၫ့လဖၪမၩဆၧ လမံၩ့နီၪ,ဒဲဂူၫဂၩၥံၪဖိၭဖၫ့နီၪ ဖီၪ့ထၪ့ဖၩ့ၥံၪနၭၥံၪ,ထၩ့ ဖံၭၥံၪ,ဒဲချံၪၥံၪ, ဒဲၥၭနၫပဒၩ့ၥံၪး တၭၦပၧၩ့ဆၧလဖၪ နီၪအီၪလၧယုဒၫ အဂံၪ့ဖိၪထီးအလူၬ အချိၫ့လခီၫဆ့",
			"17": "<sup>17</sup> လီၫ.- ၦလဖၪမၩဆၧလၧခိၪဒၧၩ့အလီၩ့မွဲဂ့ၩ, ၦလၧ အယိၭဆၧဎၧၫ့လဖၪမွဲဂ့ၩ, ဒဲၦလၧအတဲၩ့ဝဲၩဆၧလ ဖၪကိၭဂၩဒ့ၭနီၪမၩဆၧလၧအစူၪလခီၫ, ဒဲလၧအဝ့ၫဒၪ",
			"18": "<sup>18</sup> လခီၫဖီၪ့အစူၪဝဲၩနီၪလီၫ.- အဂဲးဘဲၫယီၩၦမၩဆၧလ ဖၪနီၪ,အီၪလၧအနၭလၧခၧၩ့ယးဖၧၩ့ လၩ့ဆဲၩလၧအ နဲၩ့ဖၩကိၭဂၩဒ့ၭဆုၬဆုၬတၭ, မၩဆၧဘဲၫနီၪလီၫ. ၦ လၧအအူၪထၪ့ခွ့ၩလဂၩနီၪ အီၪလၧယနဲၩ့ထံၭလီၫ.",
			"19": "<sup>19</sup> တၭယစံၭၦအီၪလၧလၩဖၩ့, ဒဲၦပၧၩ့ဆၧၥံၪ,ဒဲၦခမျၧး ဂူၫဂၩၥံၪ,ဆၧမၩလမံၩ့ယီၩ မွဲအဒိၪဒဲအလဲဝ့ၫတၭ,ပ လၩ့ဖၭလိၬပၥၭလၧခိၪဒၧၩ့အလီၩ့ လဂၩဒဲလဂၩယဲၩ့",
			"20": "<sup>20</sup> လိၬအၥၭလီၫ.- အခိးမွဲထီးဒၪအလး လၧနၥံၪနါဂၧၫ့ ခွ့ၩအၥီၫနီၪ, ဂဲၫအီၪကီၪ့နၥံၪဝ့ၫလၧပအီၪထီးနီၪဘီၪး ပယွၩမိဒုၭဆၧလၧပဂးလီၫ.",
			"21": "<sup>21</sup> ပမၩဆၧမၩဘဲၫနီၪၥိၭလီၫ. အဝ့ၫၥံၪၦၡၩဖိၭဖၫ့ဖီၪ့ ဖၩ့ၥံၪနၭၥံၪမုဆဲၪ့ထၪ့လၧဂီၩ ထီးၡၪၥံၪဖျီၪထၪ့ဝ့ၫဒၪ",
			"22": "<sup>22</sup> လီၫ.- ဘဲၫနီၪၥိၭလၧအဆၧၫ့အထီနီၪ, ယစံၭၦခမျၧး ၥံၪ,မွဲၦလဂၩလၧအခ့ၫအၡၩ, လဂၩလၧအခ့ၫအၡၩ မံၫလၧယရုစလံၫ့အဖၧၩ့ ကိၭဂၩဒ့ၭဆံၭ, မွဲဘဲၫၥိၭလၧ မုနၩလခီၫနီၪ မိကဲၪထၪ့ၦၡၩခိၭပၧၩ, ဒဲမၩဆၧလၧမု",
			"23": "<sup>23</sup> ဆၫလခီၫနီၪဆ့လီၫ.- တၭယနၫ့ဆါဒၪယဝ့ၫမွဲဂ့ၩ, ယ ထၧၫ့ဖုဝဲၥံၪမွဲဂ့ၩ, ယခ့ၫယၡၩၥံၪမွဲဂ့ၩ, ၦခိၭဆၧလၧ အဖိၬယခဲၫ့မွဲဂ့ၩ, ပဘဲၪ့လၩ့ခွံၬပကီၩ့ပၥိၭနးဂၩအ့ၬး ၦလ့ၩအၪ့ဒုၪ့ထံၫနီၪ ဆိၬအစူၪဝဲၩကိၭဂၩဒ့ၭဆုၬဆုၬ လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> တၭၦခမျၧးၥံၪ ဒဲအဝ့ၫၥံၪအမၫလဖၪကိၭထၪ့နၭနၭ",
			"2": "<sup>2</sup> လ့ၬထၫ့ဒၩအထၧၫ့ဖုဝဲလဖၪ ၦယုဒၫဖိၪၥံၪနီၪလီၫ.-အ ဂဲးဘဲၫယီၩ ၦလနၩ့အီၪဝ့ၫ, လၧအစံၭ,ပဝ့ၫဒၪယီၩပ ဖိၪခွၫလဖၪ, ဒဲပဖိၪမုၪလဖၪအီၪအၪအၪလ့ၬယီၩ, အ ခိးမွဲပဘၪမၩန့ဘုၪၥံၪဂူၫၥံၪ ဘဲၫၥိၭပမိအၪ့ဆၧ, ဒဲမၧၫ့",
			"3": "<sup>3</sup> ဝ့ၫဒၪဆ့ဘီၪ.- တၭၦလနၩ့နၩ့အီၪဝ့ၫ, လၧအစံၭဝ့ၫဆ့, ပဝ့ၫဒၪယီၩပဂၪ့ခိၪအဝၩ့ၥံၪ, ပစဘံၭမုအလးၥံၪ,ပ ဂံၪ့ၥံၪဎၫ့ၥံၪနီၪ, ပပီၩ့လၩ့ယူၭဘဲၫၥိၭပမိဎွ့ၩန့ဘုၪၥံၪ",
			"4": "<sup>4</sup> ဂူၫၥံၪ,လၧဆၧၥၭဝံလၩ့ဒိၩအကၠီၩ့နီၪလီၫ.- ၦလနၩ့နၩ့ ဆ့လၧအစံၭဝ့ၫ, ပဝ့ၫဒၪယီၩ ပပီၩ့လၩ့ပဂၪ့ခိၪအဝၩ့ ၥံၪ,ဒဲစဘံၭမုအလးၥံၪ, ပအၪ့လီးစ့ၩလၧစဎွၩအခီၫ့",
			"5": "<sup>5</sup> အဂးနီၪလီၫ.- မွဲလါနၫ့တၭပယၪယီၩ မွဲဘဲၫပထၧၫ့ဖု ဝဲၥံၪအယၪအၥိၭ, ပဖိၪပလံၩၥံၪဘဲၫအဝ့ၫၥံၪအဖိၪအ လံၩအၥိၭး တၭ, ယိခွါ, ပဒုၭကဲၪဎီးပဖိၪခွၫၥံၪဒဲပဖိၪ မုၪၥံၪ,လၧအမိကဲၪၦအခ့ၫအၡၩၥံၪတၭ, ပဖိၪမုၪၥံၪ လနၩ့ကဲၪယူၭဆၧအဎီးယူၭလီၫ. တၭပဎွ့ၩန့ထဲၩ့ၥ့ၪ အ့ၬး အဂဲးဘဲၫယီၩ ၦၡၩဂူၫဂၩၥံၪအီၪလၧပဂၪ့ခိၪအ ဝၩ့လဖၪ, ဒဲလၧစဘံၭမုအလးလဖၪနီၪဆ့လီၫ.",
			"6": "<sup>6</sup> ထီးယနါဂၧၫ့အဝ့ၫၥံၪအဆၧကိၭထၪ့နီၪ, ဒဲအဆၧ",
			"7": "<sup>7</sup> ချဲၩ့လဖၪတၭ, ယၥၭခိထၪ့နၭနၭလ့ၬဆ့လီၫ.- ထီးနီၪ လဖၧၫ့ယကိၪ့ထၪ့လၧယၥၭဒၪယဝ့ၫတၭ, ယအၪ့ၥီၪ့ၦ အီၪလၧအလၩအဖၩ့ၥံၪ, ဒဲၦပၧၩ့ဆၧၥံၪတၭ, ယစံၭအ ဝ့ၫၥံၪ, နၥံၪအၪ့ဂူၬန့စ့ၩအအ့ၪ, လဂၩလၧအထၧၫ့ဖုဝဲ, လဂၩလၧအထၧၫ့ဖုဝဲဆုၬဆုၬလီၫ. တၭယအီၪက့ၪ",
			"8": "<sup>8</sup> ဆၧအီၪကီၪ့ဖၭဒိၪထၫ့ဒၩအဝ့ၫၥံၪလီၫ.- တၭယစံၭ အဝ့ၫၥံၪ,ပဝ့ၫဒၪယီၩ ဘဲၫပမၩၥ့ၪအၥိၭနီၪပဎွ့ၩန့ထဲၩ့ ယူၭၦယုဒၫဖိၪ, ပထၧၫ့ဖုဝဲၥံၪလၧအဘၪ ဆၧအၪ့ဆၫ ခွံၬဝ့ၫလၧၦဆၨၩလဖၪတၭး မွဲနၥံၪမိအၪ့ဆၫခွံၬနၥံၪ အထၧၫ့ဖုဝဲလဖၪဒၪလ့ၬဆ့ဧၪ. အ့ၪလမွဲဘၪနီၪ,အဝ့ၫ ၥံၪမိဘၪဆၧအၪ့ဆၫခွံၬလၧပစူၪဖၧၩ့ဆ့ဧၪ. ထီးနီၪလ ဖၧၫ့အဝ့ၫၥံၪအီၪလၩ့မါပံၭ, ဒၪန့ဆၧလၧအမိချဲၩ့ဆၧၫ့",
			"9": "<sup>9</sup> ဝ့ၫနးမံၩ့အ့ၬ.- ယစံၭဆ့, ဆၧလၧနၥံၪမၩနီၪဂ့ၩအ့ၬ. လၧပဒုၪပဒၩၥံၪ ၦဆၨၩၥံၪဒုၪဒွ့ၪဆၧအကၠီၩ့တၭ, ကြၨၭနၥံၪလ့ၩလၧဆၧၥၭမဲၪပယွၩအဖၧၩ့ မွဲအ့ၬဧၪ.",
			"10": "<sup>10</sup> ယဝ့ၫဒၪဆ့, ဒဲယထၧၫ့ဖုဝဲလဖၪ, ဒဲယခ့ၫယၡၩၥံၪ အၪ့ဂူၬန့စ့ၩ ဒဲဘုၪၥံၪဂူၫၥံၪနီၪအလးအီၪဝ့ၫလီၫ. မွဲပ",
			"11": "<sup>11</sup> ထီးမၩလၧၩ့ဆၧအအ့ၪယီၩလဂ့ၩ, ဧီၪ.- ယအၪ့ကံၩ့ အၪ့ယၫနၥံၪ, မုဆၫလနံၩယီၩဖ့ၪလၫ့ထဲၩ့နၥံၪဝ့ၫ, လၧ အဝ့ၫၥံၪဂၪ့ခိၪအဝၩ့လဖၪ, အစဘံၭမုအလးလဖၪ,အ လဲအိၫ့အကျိၭလဖၪ, ဒဲအဝ့ၫၥံၪအဂံၪ့ၥံၪဎၫ့ၥံၪ, ဒဲစ့ၩ အပိၩ့လယၩလပိၩ့, ဒဲဘုၪၥံၪဂူၫၥံၪ, စဘံၭထံၫ,ဒဲၥိၪ, လၧနၥံၪအၪ့ဂူၬန့လၧအဝ့ၫၥံၪလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪစံၭ, မွဲယူၭပမိဖ့ၪလၫ့ထဲၩ့ တၭ,ပအၪ့ကံၩ့လၧၩ့ဆၧလၧ အဝ့ၫၥံၪနးမံၩ့အ့ၬး အခိး မွဲပမိမၩဘဲၫနစံၭ အၥိၭနီၪဆ့လီၫ. ထီးနီၪလဖၧၫ့ယ ကိၭန့ၦလုဆၧလဖၪတၭ, အၪ့မၧၫ့အဝ့ၫၥံၪဆိၪလၩ့အ",
			"13": "<sup>13</sup> ၥၭလၧအမိမၩဘဲၫအစံၭဝ့ၫအၥိၭနီၪလီၫ.- တၭယတ ရူၩယကီၩ့ယၥိၭတၭ, စံၭ, ကယဲၦလဂၩလါလါလၧ အလမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဘၪ အဆၧချဲၩ့လမံၩ့ယီၩ, မွဲယွၩတရူၩလၩ့ခွံၬအဝ့ၫဒၪလဂၩ လၧအဂံၪ့အဎၫ့,ဒဲ လၧအဆၧမၩဘဲၫနီၪအၥိၭ, မွဲအမိဘၪဆၧတရူၩလၩ့ ခွံၬဝ့ၫ, ဒဲအီၪပျီၩဘဲၫနီၪအၥိၭဆံၭ. တၭဆၧအီၪကီၪ့ ထီးအလူၬနီၪစံၭ,အၩမံၩ့, ဒဲစံၭထၪ့အၪ့အူၭယဟိဝၩ လီၫ. တၭၦခမျၧးၥံၪ မၩဝ့ၫဘဲၫအဆၧချဲၩ့လမံၩ့နီၪ အီၪဝ့ၫအၥိၭလီၫ.",
			"14": "<sup>14</sup> လၧနီၪအမ့ၬယၫလၧအဆၧၫ့အထီ လၧဆၧအီၪက့ၪ ထၪ့ယၧၩဘဲၫအဝ့ၫၥံၪ အၦဒိၪဖၭဒိၪလၧခးယုဒၫအ ဖၧၩ့နီၪ,လၧစဎွၩအၫတဇၧၭစံၫအနံၪ့နံၫဆံၫ, ထီးၥၧၫ့ ဆံၫနံၫနံၪ့လနံၪ့နီၪ, ဘဲၫၦစံၭဆၧအၥိၭ လဆံၫနံၫနံၪ့အ ထးဖၧၩ့နီၪ, ယဝ့ၫဒၪဒဲယထၧၫ့ဖုဝဲၥံၪ ပအၪ့ဘၪၦဒိၪ",
			"15": "<sup>15</sup> ဖၭဒိၪအကိၪအ့ၬ.- အ့ၪမွဲၦဒိၪဖၭဒိၪၥံၪလၧအအီၪဝဲၩ ဝ့ၫလၧယလချႃၭအီၪဒံၭဘၪနီၪ ဎၧၫ့ဝ့ၫလၧၦခမျၧးၥံၪ အဖၫ့ခိၪတၭ, အၪ့မၩန့ လၧအဝ့ၫၥံၪအကိၪဒဲစဘံၭ ထံၫ,လၧနီၪအမ့ၬယၫစ့ၩ, ၡက့လၭလံဆံၫလီၫ. မွဲက ဒၪယူၭ, အဝ့ၫၥံၪအခ့ၫအၡၩဒၪလ့ၬ ပၧၩ့ဆၧလၧၦခ မျၧးၥံၪအဖၫ့ခိၪလီၫ. အ့ၪမွဲယဝ့ၫဒၪ, လၧဆၧၥၭမဲၪ",
			"16": "<sup>16</sup> ယွၩအကၠီၩ့, ယမၩဘဲၫနီၪၥိၭအ့ၬ.- မွဲကဒၪယူၭ,ယ မၩထၪ့ခိၪဒၧၩ့နီၪဆ့း တၭပဎွ့ၩဂၪ့ခိၪနးစီၪ့အ့ၬး တၭ ကယဲယခ့ၫယၡၩၥံၪအီၪကီၪ့ထီးနီၪ လၧဆၧမၩနီၪအ",
			"17": "<sup>17</sup> ဂးဆ့လီၫ.- လၧနီၪအမ့ၬယၫၦယုဒၫဖိၪၥံၪ ဒဲၦပၧၩ့ဆၧ လဖၪလယၩယဲဆံၫအီၪလၧ ယစပွဲထံၭတၭ, အီၪဒံၭ ၦလၧအဂဲၫလၧၦဆၨၩၥံၪ အီၪဝၬဖီၩ့ပၧၩအကျၩနီၪဆ့",
			"18": "<sup>18</sup> လီၫ.- တၭဆၧလၧအဘၪဆၧတဲၩ့ဝဲၩဝ့ၫ လၧလနံၩအ ဂးလနံၩအဂးနီၪ, မွဲချီဖၫလဒုၩ, ၥိၪၥံၪလၧၦရွံန့ဝ့ၫဎူၫ ဒုၩး ဆၧတဲၩ့ဝဲၩဆၫ့လဖၪဆ့လၧယဂး ဒဲဆံၫနံၩလ ဖၧၫ့နီၪ, ကယဲစဘံၭထံၫကိၭအမံၩ့ဒ့ၭ မွဲလါနၫ့ဘိၩလၧ ဆၧနီၪလဖၪ ထီးအလူၬအဂး ယအၪ့ဘၪၦဒိၪဖၭဒိၪ အကိၪအ့ၬး မွဲလၧဆၧဎၧၫ့ဖၭဒိၪအီၪဝ့ၫလၧၦခမျးၥံၪ အလီၩ့အကၠီၩ့နီၪလီၫ.",
			"19": "<sup>19</sup> ယယွၩဧ့, နၪ့ထၪ့ထဲၩ့ယၧၩလၧဆၧဂ့ၩအဂး, ဘဲၫ လၧကယဲဆၧလၧယမၩ လၧၦခမျၧးယီၩအဂးအၥိၭ နီၪဆံၭ."
		},
		"6": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭထီးစစၫ့ဘၪလၭ, ဒဲစတိၫဘဲအၫ, ဒဲၦအရ့ဘၠၫဖိၪစဂံၡံၫ့, ဒဲပဒုၪပဒၩဂူၫဂၩလဖၪနီၪ, နါ ဂၧၫ့လၧယမၩထၪ့ခိၪဒၧၩ့နီၪ, ဒဲလၧဆၧဘုၪ့ဖိးအီၪဝ့ၫ နးစီၪ့အ့ၬ, (မွဲလါနၫ့လၧအဆၧၫ့အထီနီၪ, ယဘိၭထၪ့ တရၫ့လဖၪဒံၭအ့ၬ,) တၭစစၫ့ဘၪလၭဒဲစဂံၡံၫ့ၥံၪအၪ့",
			"2": "<sup>2</sup> မၧၫ့ဆၧလၧယအီၪတၭ,- စံၭဝ့ၫ,ဂဲၫဘီၪ, မွဲပလ့ၩထၪ့ ၡီၩ့လၧအိနိၫအဆၧပျၩ့ဖၧၩ့ အတဝၫ့လစီၪ့စီၪ့အဖၧၩ့ နီၪဘီၪ. အ့ၪမွဲအဝ့ၫၥံၪဆီၫ့မီၪ့လၧ အမိမၩအၧၩ့ယၧၩ",
			"3": "<sup>3</sup> နီၪလီၫ.- တၭယအၪ့မၧၫ့အၥီၫ့ၥံၪလ့ၩလၧ အဝ့ၫၥံၪအ အီၪ,စံၭဝ့ၫ, ယဝ့ၫဒၪယီၩယမၩဆၧဖၭဒိၪလမံၩ့တၭ, ယလ့ၩလၩ့ချႃၭအ့ၬး ယခွံၬၡိၭဆၧမၩယီၩဒဲလ့ၩလၩ့ လၧနၥံၪအအီၪတၭ, ဆၧမၩအီၪထီဝ့ၫဘဲၫနီၪ မွဲအဂဲး",
			"4": "<sup>4</sup> ဘဲၫၥ့ၪလဲၪ.- မွဲလါနၫ့တၭ, အဝ့ၫၥံၪအၪ့မၧၫ့ဆၧဘဲၫနီၪ ၥိၭလံဘျၩ့တၭး ယစံၭဆၧၫ့အဝ့ၫၥံၪမီၪ့ဎီၩ့ဆ့လီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့စစၫ့ဘၪလၭအၪ့မၧၫ့ အခ့ၫအၡၩဘဲၫ နီၪၥိၭယဲဘျၩ့လဘျၩ့, လၧအအီၪလၧလံၬလဘံၪ့အီၪ",
			"6": "<sup>6</sup> ဝဲထၪ့အၥၭလၧပစူၪဖၧၩ့တၭ,- လၧအဖၧၩ့နီၪဆၧကွ့ၭ အၥၭ,ဆၧဂၧၫ့ထၪ့ၥၩလၩ့လၧ ၦဆၨၩၥံၪအကျၩတၭ, စဂၭၡမုၫလီၩဘၪဝ့ၫနီၪ, နဝ့ၫဒၪဒဲၦယုဒၫဖိၪၥံၪဆီၫ့မီၪ့ လၧအမိပိၩ့ထၪ့ဆၧတၭး လၧဆၧနီၪလမံၩ့အကၠီၩ့, နမၩထၪ့ခိၪဒၧၩ့နီၪ, ဘဲၫနမိကဲၪအဝ့ၫၥံၪအစဎွၩအၥိၭ,",
			"7": "<sup>7</sup> မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဆၧချဲၩ့လဖၪယီၩလီၫ.- ဒဲလၧန အီၪက့ၪလၩ့မီၪၥံၪလၧယရုစလံၫ့အဖၧၩ့ ဘဲၫၥိၭအဝ့ၫ ၥံၪမိလီၩလၩ့ဆၧလၧနဂဲးနကၠီၪ့တၭ, စံၭဝ့ၫ, စဎွၩအီၪ လၧယုဒၫအဖၧၩ့နီၪး တၭဘိၩ့နဲၪ့ယီၩ ဆၧဘၪဒုၭၥ့ၪ ယၫစဎွၩဘဲၫဆၧချဲၩ့လဖၪယီၩ အၥိၭလီၫ. အခိးမွဲ ဘိၩ့နဲၪ့ယီၩ, ဂဲၫဘီၪ, မွဲပကိၪ့ထၪ့ၡီၩ့ဆၧဘီၪ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့ ပအၪ့မၧၫ့ဆၧလၧအအီၪစံၭဝ့ၫ, ဆၧ မၩဘဲၫနစံၭအၥိၭနီၪ နးမံၩ့အ့ၬ. အ့ၪမွဲနနၫ့ဆါဒၪနဝ့ၫ",
			"9": "<sup>9</sup> နကိၪ့န့ပျီၩပျီၩလၧနၥၭဒၪနဝ့ၫအဖၧၩ့လီၫ.- အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪကိၭဂၩဒ့ၭ မိမၩၥၭမဲၪပၧၩတၭ, စံၭဝ့ၫ,အ ဝ့ၫၥံၪအစူၪမိလၩ့ဆါလၧ အဆၧမၩဖၧၩ့နီၪ, ဘဲၫၥိၭအ ဆၧထီးကဲၪထၪ့လဂ့ၩး အခိးမွဲ ယွၩဧ့, မၩဆီၪ့ထၪ့ ယစူၪဆံၭ.",
			"10": "<sup>10</sup> လၧခဲၫ့ထဲၩ့ယဂဲၫထီၩ့လၧ စမဟ့ၫတဘ့လၭအဖိၪ ခွၫစဒ့ၫလအဲအၫအဖိၪခွၫ, စၡ့ၫမအဲအၫၦလၧအဘၪ ဆၧဒူၭထၬဝ့ၫအဂံၪ့နီၪတၭး အဝ့ၫဒၪစံၭ, မွဲပလ့ၩၡီၩ့ လၧယွၩအဂံၪ့ဖၧၩ့, ထီၩ့လၧဆၧလုဂံၪ့အဖၧၩ့တၭ, မွဲ ပမိကၭဘံၭထၬဆၧလုဂံၪ့ အတရၫ့လဖၪနီၪဘီၪး အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪမိဂဲၫကျီၪ့ၥံၫနၧၩတၭး မွဲယူၭ, လၧမု",
			"11": "<sup>11</sup> နၩလခီၫနီၪအဝ့ၫၥံၪမိဂဲၫကျီၪ့ၥံၫနၧၩလီၫ.- တၭယစံၭ, ၦၡၩဘဲၫယၧၩအၥိၭ ကြၨၭစဲၪ့ဖျိၭဆ့ဧၪ. တၭၦဘဲၫ ယၧၩအၥိၭ, ဘဲၫၥိၭအမိမၩဖီၩ့မၩဖျ့ၭအၥၭမၧၫ့တၭ, မိနုၬလၧဆၧလုဂံၪ့ဖၧၩ့နီၪ, မွဲၦလဂၩလဲၪ. ယလ့ၩ",
			"12": "<sup>12</sup> နုၬယဝ့ၫအ့ၬ.- တၭယိခွါ, ယၥ့ၪယၫလၧယွၩအၪ့မၧၫ့ လၩ့အဝ့ၫအ့ၬး အ့ၪမွဲအလီၩဘၪဆၧနီၪ လၧမီၪအချိၬ ထၫ့ဒၩယၧၩလီၫ. အဂဲးဘဲၫယီၩ စတိၫဘဲအၫ ဒဲစစၫ့",
			"13": "<sup>13</sup> ဘၪလၭအၪ့လံၩ့န့အဝ့ၫဒၪလီၫ.- ဆၧမၩအၥၭလၧဆၧ အၪ့လံၩ့အဝ့ၫဒၪ, ဘဲၫၥိၭယမိၥၭမဲၪဆၧတၭ, မၩဘဲၫ နီၪၥိၭဆ့,ဒဲမၪဘၪဆၧတၭ, ဘဲၫၥိၭအဝ့ၫၥံၪမိဒုၭဂၧၫ့ ထၪ့ၥၩလၩ့ဆၧအၧၩ့နီၪ အလးမိအီၪဝ့ၫတၭ, ဘဲၫၥိၭ အဝ့ၫၥံၪမိဒုၪဒွ့ၪယၧၩဆ့လီၫ.",
			"14": "<sup>14</sup> ယယွၩဧ့, နၪ့ထၪ့ထဲၩ့စတိၫဘဲအၫ ဒဲစစၫ့ဘၪလၭ ၥံၪ,ဘဲၫအဆၧမၩလဖၪယီၩအီၪဝ့ၫအၥိၭ, ဒဲလၧမီၪမုၪ နးနိၫအဒဲအၫ, ဒဲမီၪဂူၫဂၩၥံၪ လၧအမိဒုၭၥၭမဲၪယၧၩ နီၪနၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪဆံၭ.",
			"15": "<sup>15</sup> ဘဲၫနီၪၥိၭဆၧမၩဂီၩ့ခိၪဒၧၩ့နီၪ လၧလၩအံၫလုလၭ ထၪ့နံၫဆံၫယဲနံၩလနံၩနီၪ, မွဲလၧယဲဆံၫနံၫနံၩအထး",
			"16": "<sup>16</sup> ဖၧၩ့နီၪလီၫ.- တၭဆၧမၩအၥၭလၧပဒုၪပဒၩထီးအလူၬ ၥံၪနါဂၧၫ့, ဒဲၦဆၨၩၥံၪအီၪဝၬဖီၩ့ပၧၩဆ့, ဒၪဘၪဆၧ လဖၪယီၩတၭ, အဝ့ၫၥံၪအၥၭလၩ့ဆါလၧအမ့ၬၥၪဒၪ ဝ့ၫအဖၧၩ့, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪၥ့ၪယၫလၧဆၧမၩ ယီၩ,မွဲပယွၩဒုၭကဲၪထၪ့ဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> လၧနီၪအမ့ၬယၫလၧမုနံၩလဖၪနီၪ ယုဒၫအၡၩလၩ ဖၩ့လဖၪနီၪဖ့ၪယူလံၬအၪဘံၪ့လၧ စတိၫဘဲအၫအအီၪ တၭ,စတိၫဘဲအၫ အလံၬၥံၪဂဲၫထီၩ့ လၧအဝ့ၫၥံၪအ",
			"18": "<sup>18</sup> အီၪဆ့လီၫ.- အဂဲးဘဲၫယီၩ လၧယုဒၫအဖၧၩ့နီၪၦအၪ ဂၩဆိၪလၩ့အၥၭ လၧအဝ့ၫဒၪအၥိၭ, အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမွဲစအၫရၫအဖိၪခွၫ စၡ့ၫခနဲအၫအမၬနီၪး ဒဲအ ဖိၪခွၫစယိၫဟၫနၫ့နီၪ န့ယူၭအမၫလၧစဘံၫရခဲအၫအ",
			"19": "<sup>19</sup> ဖိၪခွၫစမၡၧလၫ့အဖိၪမုၪနီၪလီၫ.- တၭအဝ့ၫၥံၪလီၩ ဘၪယၧၩလၧအဝ့ၫဒၪအဆၧမၩ ဂ့ၩလဖၪတၭ,ယဆၧ ချဲၩ့လဖၪမွဲအလီၩဘၪ အဝ့ၫဒၪဆ့လီၫ. စတိၫဘဲအၫ ဖ့ၪယူလံၬၥံၪဘဲၫၥိၭ အမိဒုၭၥၭမဲၪယၧၩလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭထီးခိၪဒၧၩ့နီၪကဲၪထၪ့ယူၭ, ဒဲယ ဘိၭထၪ့ယူၭတရၫ့လဖၪနီၪ, ဒဲအီၪက့ၪၦပၧၩ့တရၫ့ၥံၪ ဒဲၦၥံၫကျံၩဆၧ ဒဲၦလံဝဲၫဖိၪၥံၪလၧအလးလဖၪတၭ,",
			"2": "<sup>2</sup> ယထၧၫ့ဖုဝဲစဟၫနၫနဲၫ, ဒဲၦပၧၩ့နီးစဟၪ့နနဲအၫၥံၪယ ဒုၭအီၪလၧယရုစလံၫ့အဖၫ့ခိၪလီၫ. အဂဲးဘဲၫယီၩအ ဝ့ၫဒၪမွဲၦလၧအလူတီၩ ဒဲအၥၭမဲၪယွၩအၪနဲၪ့ၦအၪဂၩ",
			"3": "<sup>3</sup> နီၪဆ့လီၫ.- တၭယစံၭအဝ့ၫၥံၪ, ထီးမုလချႃၭခိဒံၭဘၪ တၭ,ယရုစလံၫ့အတရၫ့လဖၪနီၪ, မွဲၦထီးဝဲထၪ့လဂ့ၩး တၭလၧၦအီၪလၧအနဲၩ့ထံၭအဘိၩ့ဘၭနီၪ, မွဲၦကၭ ဘံၭတရၫ့ၥံၪ, ဒဲမၩထၬနိၪဘီၩ့ၥံၪဘီၪ. တၭလၧၦဘၪ ဆဲၫ့လၧယရုစလံၫ့ဖိၪၥံၪ, အီၪက့ၪၦခိၭဆၧလဖၪ, ၦ လဂၩဒဲလဂၩလၧအဆၧၫ့အထီဒၪဝ့ၫကိၭဂၩဒ့ၭ, ဒဲလ ဂၩလၧအဆဲၫဎၩ့အဂံၪ့ဒၪဝ့ၫ, လဂၩလၧအဂံၪ့ဒၪဝ့ၫ ဆုၬဆုၬဘီၪ.",
			"4": "<sup>4</sup> တၭဒိၩ့နီၪမွဲအလဲဒဲဖၭဒိၪဆ့, အ့ၪမွဲၦၡၩၥံၪလၧအ ဖၧၩ့အီၪၡၩခိၬဂၩ, ဒဲအဂံၪ့ၥံၪဎၫ့ၥံၪကဲၪထၪ့ဒံၭအ့ၬ.",
			"5": "<sup>5</sup> တၭယွၩဒုၭအီၪထၪ့ ဆၧလၧယၥၭခံဖၧၩ့နီၪ, ဘဲၫ ၥိၭယမိကိၭကီၪ့ၦအီၪလၧဆၧလၩဖၩ့လဖၪ, ဒဲၦပၧၩ့ ဆၧလဖၪ, ဒဲၦခမျၧးၥံၪ, ဘဲၫၥိၭအဝ့ၫၥံၪမိဘၪဆၧဝံ ထၪ့နၬထၪ့, ဘဲၫအဆၨၩအဆရၫ့အီၪဝ့ၫအၥိၭနီၪလီၫ. တၭယဒၪန့ဆၧကွ့ၭနဲၪ့ထၬ ၦဂဲၫထီၩ့ လၧအဝံခိၪလ ဘျၩ့အဆၨၩအဆရၫ့, ဒဲဒၪဘၪဆၧကွ့ၭအၥၭလၧအ ဖၧၩ့နီၪ,",
			"6": "<sup>6</sup> လၧၦဘၪဆဲၫ့လၧၦဆိၬခွံၬဝ့ၫလဖၪ, ၦလၧဘၭဘ လၧၫ့အစဎွၩစန့ၭဘူၫခၭန့ဇၫ ဆိၬခွံၬဝ့ၫနီၪ, ၦထံၫဖိၪ ခးဖိၪလဖၪ လၧအစဲၪ့ထၪ့ခွံၬလၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအ ကျၩ,ဒဲဂဲၫထဲၩ့ထီၩ့ဒီၭ လၧယရုစလံၫ့, ဒဲလၧယုဒၫနီၪ, ၦလဂၩလၧအဒိၩ့ဒၪဝ့ၫ, လဂၩလၧအဒိၩ့ဒၪဝ့ၫကိၭဂၩ",
			"7": "<sup>7</sup> ဒ့ၭ,မွဲၦလဖၪယီၩး- ၦဂဲၫလၧစဇရၧၭဘၫဘ့လၭအ ၥိၭစယ့ၭရှုအၫ, စနံၫဟမဲအၫ,စအၭဇရဲအၫ, စရၫအ မဲအၫ, စနဟၫမနဲၫ, စမီၫဒကၫ,စဘံလၡၫ့, စမံၭစဖံရ့ၭ, စဘံၭဂဝ့အံၫစနံဟၧၫ့, စဘၫအနၫၥံၪလီၫ. ၦၡၩအံၫ စရ့လၭဖိၪလဖၪ အဆၧဝံထၪ့နၬထၪ့နီၪ မွဲဘဲၫယီၩး",
			"8": "<sup>8</sup> စပၫရီၭအဖိၪအလံၩၥံၪ, နံၫထီၫ့လယၩနွ့ၫဆံၫနံၫဂၩ",
			"9": "<sup>9</sup> လီၫ.- စၡၭဖတဲအၫအဖိၪအလံၩၥံၪ, ၥၧၫ့ယၩနွ့ၫဆံၫ",
			"10": "<sup>10</sup> နံၫဂၩလီၫ.- စအၫရၫအဖိၪအလံၩၥံၪ, ဎူၫယၩယဲဆံၫ",
			"11": "<sup>11</sup> နံၫဂၩလီၫ.- စပၫဟၭမိအၭအဖိၪအလံၩၥံၪ, ၦဘၪဆဲၫ့ လၧစယ့ၭရှုအၫဒဲစယိအၭအဖိၪအလံၩၥံၪ, နံၫထီၫ့ဎိၭ",
			"12": "<sup>12</sup> ယၩလဆံၫဎိၭဂၩလီၫ.- စအံလၫ့အဖိၪအလံၩၥံၪ,လ",
			"13": "<sup>13</sup> ထီၫ့နံၫယၩယဲဆံၫလံဂၩလီၫ.- စဇၭတုၫအဖိၪအလံၩ",
			"14": "<sup>14</sup> ၥံၪ,ဎိၭယၩလံဆံၫယဲဂၩလီၫ.- စဇၭကအဲၫအဖိၪအ",
			"15": "<sup>15</sup> လံၩၥံၪ, နွ့ၫယၩဎူၫဆံၫလီၫ.- စဘံၫ့ယုၫအဲၫအဖိၪအ",
			"16": "<sup>16</sup> လံၩၥံၪ,ဎူၫယၩလံဆံၫဎိၭဂၩလီၫ.- စဘ့ၭတအဲၫအဖိၪ",
			"17": "<sup>17</sup> အလံၩၥံၪ, ဎူၫယၩနံၫဆံၫဎိၭဂၩလီၫ.- စအၭဇဂၭအ",
			"18": "<sup>18</sup> ဖိၪအလံၩၥံၪ, နံၫထီၫ့ၥၧၫ့ယၩနံၫဆံၫနံၫဂၩလီၫ.- စ အၭဒနဲကၫ့အဖိၪအလံၩၥံၪ, ဎူၫယၩဎူၫဆံၫနွ့ၫဂၩ",
			"19": "<sup>19</sup> လီၫ.- စဘံဂဝ့အဲၫအဖိၪအလံၩၥံၪ, နံၫထီၫ့ဎူၫဆံၫနွ့ၫ",
			"20": "<sup>20</sup> ဂၩလီၫ.- စအၫဒံၫ့အဖိၪအလံၩၥံၪ, ဎူၫယၩယဲဆံၫယဲ",
			"21": "<sup>21</sup> ဂၩလီၫ.- ၦဘၪဆဲၫ့လၧစဟ့ၭဇကဲအၫစအၫတၧၭအ",
			"22": "<sup>22</sup> ဖိၪအလံၩၥံၪ, ခွံၫဆံၫဎိၭဂၩလီၫ.- စဟၭၡၧၫ့အဖိၪအ",
			"23": "<sup>23</sup> လံၩၥံၪ ၥၧၫ့ယၩနံၫဆံၫဎိၭဂၩလီၫ.- စဘံဇဲၫအဖိၪအ",
			"24": "<sup>24</sup> လံၩၥံၪ, ၥၧၫ့ယၩနံၫဆံၫလံဂၩလီၫ.- စဟၫရံၭအဖိၪအ",
			"25": "<sup>25</sup> လံၩၥံၪ, လယၩလဆံၫနံၫဂၩလီၫ.- စဂံဘအၧၫ့အဖိၪ",
			"26": "<sup>26</sup> အလံၩၥံၪ, ခွံၫဆံၫယဲဂၩလီၫ.- ၦဘၪဆဲၫ့လၧဘ့ၭၥလံၫ",
			"27": "<sup>27</sup> ဟံၫ့ဒဲနံၫတိဖၫလယၩဎိၭဆံၫဎိၭဂၩလီၫ.- ၦဘၪဆဲၫ့",
			"28": "<sup>28</sup> လၧအၪ့အၥီၭလဖၪနီၪ, လယၩနံၫဆံၫဎိၭဂၩလီၫ.- ၦ ဘၪဆဲၫ့လၧဘ့ၭၥအၭဇမဝ့ၭလဖၪနီၪ, လံဆံၫနံၫဂၩ",
			"29": "<sup>29</sup> လီၫ.- ၦဘၪဆဲၫ့လၧကၧၫယၭယ့အရံၫ့လဖၪနီၪ, စခ့ၭ",
			"30": "<sup>30</sup> ဖဲရၫ,ဒဲစဘအံရိၭနွ့ၫယၩလံဆံၫၥၧၫ့ဂၩလီၫ.- ၦဘၪ ဆဲၫ့လၧရၫမၫဒဲဂၫဘၫလဖၪနီၪ, ဎူၫယၩနံၫဆံၫလဂၩ",
			"31": "<sup>31</sup> လီၫ.- ၦဘၪဆဲၫ့လၧမံခမၭလဖၪနီၪ, လယၩနံၫဆံၫနံၫ",
			"32": "<sup>32</sup> ဂၩလီၫ.- ၦဘၪဆဲၫ့လၧဘ့ၫၥလၭဒဲ ဟဲၫလဖၪနီၪ,လ",
			"33": "<sup>33</sup> ယၩနံၫဆံၫၥၧၫ့ဂၩလီၫ.- ၦဘၪဆဲၫ့လၧနံဘိၫအဂူၫဂၩ လစီၪ့နီၪ, ယဲဆံၫနံၫဂၩလီၫ. စအံလၫ့အဂူၫဂၩလဂၩ",
			"34": "<sup>34</sup> အဖိၪအလံၩၥံၪ, လထီၫ့နံၫယၩယဲဆံၫလံဂၩလီၫ.- စ",
			"35": "<sup>35</sup> ဟၫရံၫ့အဖိၪအလံၩၥံၪ, ၥၧၫ့ယၩနံၫဆံၫလီၫ.- ၦယ့ၫရ ခိၫဖိၪလဖၪ, ၥၧၫ့ယၩလံဆံၫယဲဂၩလီၫ.",
			"36": "<sup>36</sup> စလိၫဒၫ အဖိၪအလံၩၥံၪ, စဟၫဒံၭ,ဒဲစအိနိၫ, နွ့ၫယၩနံၫဆံၫလ",
			"38": "<sup>38</sup> ဂၩလီၫ.- စစ့ၫနၫအၫအဖိၪအလံၩၥံၪ, ၥၧၫ့ထီၫ့ခွံၫယၩ ၥၧၫ့ဆံၫလီၫ.",
			"39": "<sup>39</sup> ၦလုဆၧလဖၪ, စယဒ့ယၫအဖိၪအလံၩၥံၪ, ၦ ဘၪဆဲၫ့လၧစယ့ၭရှူၫအၫအဂံၪ့နီၪ, ခွံၫယၩနွ့ၫဆံၫၥၧၫ့ဂၩ",
			"40": "<sup>40</sup> လီၫ.- စအံမၧၫအဖိၪအလံၩၥံၪ, လထီၫ့ယဲဆံၫနံၫဂၩ",
			"41": "<sup>41</sup> လီၫ.- စပၭၡၧၫအဖိၪအလံၩၥံၪ, လထီၫ့နံၫယၩလံဆံၫ",
			"42": "<sup>42</sup> နွ့ၫဂၩလီၫ.- စဟၫရံၫ့အဖိၪအလံၩၥံၪ, လထီၫ့လဆံၫ နွ့ၫဂၩလီၫ.",
			"43": "<sup>43</sup> ၦလံဝဲၫဖိၪၥံၪး စယ့ၭရှုၫအၫအဖိၪအလံၩလဖၪ,လၧ ကၭဒမံၫအ့လၭ, ဒဲစဟိၫဒံဝၫအဖိၪအလံၩၥံၪ, နွ့ၫဆံၫ လံဂၩလီၫ.",
			"44": "<sup>44</sup> ၦၥံၫကျံၩဆၧလဖၪး စအ့စဖၭအဖိၪအလံၩၥံၪ,လ ယၩလံဆံၫဎိၭဂၩလီၫ.",
			"45": "<sup>45</sup> ၦပၧၩ့တရၫ့လဖၪး စၡၫလၧၫ့အဖိၪအလံၩၥံၪ,စအၭ တၧၭအဖိၪအလံၩၥံၪ, စတၫလမၧၫ့အဖိၪအလံၩၥံၪ,စ အၭကၧၭအဖိၪအလံၩၥံၪ, စၡိၫဘဲၫအဖိၪအလံၩၥံၪ, လယၩၥၧၫ့ဆံၫဎိၭဂၩလီၫ.",
			"46": "<sup>46</sup> ၦန့ၭၥနံဖိၪလဖၪး စဇဲယၫအဖိၪအလံၩၥံၪ,စဟၫရှု",
			"47": "<sup>47</sup> ဖၫအဖိၪအလံၩၥံၪး- စတၭဘအီၭအဖိၪအလံၩၥံၪ,စ",
			"48": "<sup>48</sup> ကံရီၭအဖိၪအလံၩၥံၪး- စစဲအၫအဖိၪအလံၩၥံၪ,စပၫ",
			"49": "<sup>49</sup> ဒၧၫ့အဖိၪအလံၩၥံၪ, စလ့ၭဘနၫအဖိၪအလံၩၥံၪ,- စ",
			"50": "<sup>50</sup> ဟၭဂဘၫအဖိၪအလံၩၥံၪ,- စၡၫလမဲၫအဖိၪအလံၩ ၥံၪစဟၫနၫ့အဖိၪအလံၩၥံၪ, စဂံၭဒအ့လၭ အဖိၪအ",
			"51": "<sup>51</sup> လံၩၥံၪ,စဂၫအီၫအဖိၪအလံၩၥံၪ,- စရံၫအအဲအၫအ ဖိၪအလံၩၥံၪ, စရံၫဇံၫ့အဖိၪအလံၩၥံၪ, စနံကိဒၫအဖိၪ",
			"52": "<sup>52</sup> အလံၩၥံၪ,- စဂၭဇဇံၫ့အဖိၪအလံၩၥံၪ, စအၧၭဇၫအ",
			"53": "<sup>53</sup> ဖိၪအလံၩၥံၪ, စပစံအၫအဖိၪအလံၩၥံၪ,- စဘံစ့ၫအ ဖိၪအလံၩၥံၪ, စမယုနံၫ့အဖိၪအလံၩၥံၪ, စနံဖံၭဟံၡၫ့",
			"54": "<sup>54</sup> အဖိၪအလံၩၥံၪ,- စဘၭဘၧၭအဖိၪအလံၩၥံၪ, စဟကု",
			"55": "<sup>55</sup> ဖၫအဖိၪအလံၩၥံၪ, စဟၫဟၧၫအဖိၪအလံၩၥံၪ,- စဘၭ ဇလံၭအဖိၪအလံၩၥံၪ, စမဟဲဒၫ အဖိၪအလံၩၥံၪ, စ",
			"56": "<sup>56</sup> ဟၫၡၫအဖိၪအလံၩၥံၪ,- စဘၫကီၭအဖိၪအလံၩၥံၪ, စစံစရၫအဖိၪအလံၩၥံၪ, စတၫမၫအဖိၪအလံၩၥံၪ, စန ဇဲအၫအဖိၪအလံၩၥံၪ, စဟၭတဖၫ အဖိၪအလံၩၥံၪ",
			"57": "<sup>57</sup> နီၪလီၫ.- စစီလမၧၫ့အခ့ၫအၡၩ အဖိၪအလံၩၥံၪး",
			"58": "<sup>58</sup> စစိတအဲၫအဖိၪအလံၩၥံၪ, စစီၭဖရ့ၭအဖိၪအလံၩၥံၪ,",
			"59": "<sup>59</sup> စပရဲဒၫအဖိၪအလံၩၥံၪ,- စယၫအလၫအဖိၪအလံၩ ၥံၪ,စဒၫကၫ့အဖိၪအလံၩၥံၪ, စဂံၭဒအ့လၭ အဖိၪအ လံၩၥံၪ, စၡ့ၭဖတဲအၫ အဖိၪအလံၩၥံၪ, စဟၭတ့လၭ အဖိၪအလံၩၥံၪ, ၦဇဘၫအံၫ့ဖိၪ စပီၭခရ့ၭ အဖိၪအ",
			"60": "<sup>60</sup> လံၩၥံၪ,စအၫမၧၫ့အဖိၪအလံၩၥံၪနီၪလီၫ.- ၦန့ၭၥနံဖိၪ ထီးအလူၬ, ဒဲစစီလမၧၫ့အခ့ၫအၡၩ အဖိၪအလံၩၥံၪ, ၥၧၫ့ယၩခွံၫဆံၫနံၫဂၩလီၫ.",
			"61": "<sup>61</sup> တၭၦလၧအစဲၪ့ထၪ့ခွံၬ လၧတ့လမံၫလၫ,ဒဲတ့လ ဟၫရံၡၫနီၪ, မွဲၦလဖၪယီၩ, စခံရၧၭ, စအၭဒၧၫ့,စအံ မၧၫၥံၪး မွဲလါနၫ့တၭ, အဝ့ၫၥံၪအဖါအဂံၪ့နီၪမွဲဂ့ၩ, အ ချံၫအၥၪမွဲဂ့ၩ, မွဲအဘၪဆဲၫ့လၧအံၫစရ့လၭဖိၪၥံၪဧၪ နီၪ,အဝ့ၫၥံၪဒုၭနဲၪၥ့ၪနးစီၪ့အ့ၬ. စဒ့ၫလအဲအၫအဖိၪ",
			"62": "<sup>62</sup> အလံၩၥံၪ,- စတိၫဘဲအၫအဖိၪအလံၩၥံၪ, စနကိဒၫအ ဖိၪအလံၩၥံၪ, ဎူၫယၩလံဆံၫနံၫဂၩလီၫ.",
			"63": "<sup>63</sup> တၭၦဘၪဆဲၫ့လၧၦလုဆၧလဖၪနီၪး စဟဘၫယၫ အဖိၪအလံၩၥံၪ, စကိဇၫအဖိၪအလံၩၥံၪ, စဘၫဇံလ့ၫ အဖိၪအလံၩလဖၪ, လၧအန့အမၫ လၧၦဂံလအၭဖိၪ စဘၫဇံလ့ၫအဖိၪမုၪလဖၪနီၪ အကျၩတၭ, ဘၪဆၧ",
			"64": "<sup>64</sup> ကိၭလၧအဝ့ၫၥံၪအမံၩ့နီၪလီၫ.- ၦလဖၪယီၩအၪ့ဎၬ အလံၬဆရၫ့, လၧၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့လၧအ ဆၨၩအဆရၫ့အကျၩနီၪ, လါနၫ့ဘိၩ, ဒၪဘၪဝ့ၫအ့ၬ. အခိးမွဲအဝ့ၫၥံၪ ဘဲၫၦဘၪစံၪစၪလဖၪအၥိၭနီၪ, ဘၪ",
			"65": "<sup>65</sup> ဆၧအီၪက့ၪခွံၬဝ့ၫလၧၦလုဆၧအလးနီၪလီၫ.- တၧၡ ၥၫ (ၦဒိၪဖၭဒိၪ) စံၭအဝ့ၫၥံၪ, ဘိၩ့ၦလုဆၧအီၪလၧယု ရံၫ့ဒဲၥုမံၫ့နီၪ, လချႃၭအီၪထၪ့ဒံၭဘၪတၭ, မွဲအထီးအၪ့ ဆၧလၧဆၧဆံၫ့ဎံၪထုၬၥံၪလဂ့ၩ.",
			"66": "<sup>66</sup> ဆၧအီၪကီၪ့ထီးအလူၬနီၪ မွဲလံလၬနံၫထီၫ့ၥၧၫ့ယၩ",
			"67": "<sup>67</sup> ဎူၫဆံၫတၭ,- အခ့ၫအၡၩခွၫ, ဒဲအခ့ၫအၡၩမုၪၥံၪအီၪ",
			"68": "<sup>68</sup> ဒံၭနွ့ၫထီၫ့ၥၧၫ့ယၩၥၧၫ့ဆံၫနွ့ၫဂၩ,- ၦခွၫၥံၪ ဒဲၦမုၪၥံၪ လၧအၥံၫကျံၩဆၧနီၪ, အီၪဝ့ၫနံၫယၩလံဆံၫယဲဂၩလီၫ.",
			"69": "<sup>69</sup> အဝ့ၫၥံၪအကၥ့ၪလဖၪ မွဲနွ့ၫယၩၥၧၫ့ဆံၫဎူၫဒုၩ, အက ၥ့ၪလၫနံၫယၩလံဆံၫယဲဒုၩ, အကလအူၭၥံၪ, လံယၩ ၥၧၫ့ဆံၫယဲဒုၩ, ကၥ့ၪယီၩ့ဎူၫထီၫ့နွ့ၫယၩနံၫဆံၫလီၫ.",
			"70": "<sup>70</sup> တၭဖါၥံၪအခိၪလနၩ့နၩ့ ဖ့ၪလၫ့ဆၧလၧဆၧမၩနီၪ အဂးဆ့လီၫ. တၭတၧၡၥၫ (ၦဒိၪဖၭဒိၪ) လဂၩနီၪဒူၭ လၩ့လၧဆၧအီၪက့ၪကီၪ့အလး ကျိၪၥံၪစ့ၩၥံၪထီၫ့အဒၫ ရံၭလထီၫ့, လိၫ့အဖျိၪ့ယဲဆံၫ, ၦလုဆၧအကီၩ့အၥိၭ",
			"71": "<sup>71</sup> လဖၪအဘံၪ့ယဲယၩၥၧၫ့ဆံၫနီၪလီၫ.- တၭဖါၥံၪအခိၪ လနၩ့နၩ့နီၪ ဖ့ၪလၫ့လၧဆၧမၩနီၪအဂး, ထီၫ့အဒၫရံၭ",
			"72": "<sup>72</sup> နံၫလၬ,ဒဲစ့ၩအမဲနၫနံၫထီၫ့နံၫယၩလီၫ.- တၭဆၧလၧ ၦခမျၧးဂူၫဂၩၥံၪဖ့ၪလၫ့နီၪ, မွဲထီၫ့အဒၫရံၭနံၫလၬ, ဒဲ စ့ၩအမဲနၫနံၫထီၫ့, ဒဲၦလုဆၧအကီၩ့အၥိၭလဖၪအဘံၪ့ ဎူၫဆံၫနွ့ၫဘံၪ့လီၫ.",
			"73": "<sup>73</sup> ဘဲၫနီၪၥိၭၦလုဆၧၥံၪ, ၦလံဝဲၫဖိၪၥံၪ, ၦပၧၩ့တရၫ့ ၥံၪ,ၦၥံၫကျံၩဆၧၥံၪ, ဒဲၦဘၪဆဲၫ့လၧၦခမျၧးၥံၪ, ဒဲၦ န့ၭၥနံဖိၪၥံၪ, ဒဲအံၫစရ့လၭထီးအလူၬနီၪ, အီၪဝ့ၫလၧ အဒိၩ့ဒၪဝ့ၫလဖၪနီၪလီၫ. ထီးအဘၪလၩနွ့ၫဘံၪ့လ ဘံၪ့နီၪ,ၦအံၫစရ့လၭဖိၪလဖၪ အီၪလၧအဒိၩ့လဖၪအ ဖၧၩ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭၦၡၩခမျၧးထီးအလူၬ အီၪကီၪ့ဘဲၫၦလဂၩအၥိၭ လၧဖၧၩ့ၥၭဖၧၩ့ အီၪလၧတရၫ့ထံၫ အမ့ၬယၫနီၪလီၫ. တၭအဝ့ၫၥံၪချဲၩ့ထၪ့လီၩဘၪ ၦကွ့ၭလံၬစအ့ဇရၫလ ဂၩနီၪ,လၧအကြၨၭဂဲၫန့စမိစ့ၭအလံၬဆၧၥီၪ့ဆၧၥၫ့,",
			"2": "<sup>2</sup> လၧယဟိဝၩမၪလူၬအံၫစရ့လၭနီၪလီၫ.- တၭၦလုဆၧ စအ့ဇရၫဂဲၫဆိၬဆၧၥီၪ့ဆၧၥၫ့ လၧဆၧအီၪကီၪ့အမ့ၬ ယၫအီၪလၧမုၪၥံၪခွၫၥံၪနီၪ, ဒဲလၧကယဲၦလၧအနါဂၧၫ့ ဝ့ၫဘဲၫအနၪမိၥ့ၪအၥိၭတၭ, မွဲလၧလၩနွ့ၫဘံၪ့လဘံၪ့",
			"3": "<sup>3</sup> လၧလၩထၪ့ၥၫ့လနံၩနီၪလီၫ.- တၭမွဲအဖီထၪ့ဆၧလၧ အဖၧၩ့နီၪ, လၧဂီၩထီးမုထုၪ့, လၧၦမုၪၥံၪခွၫၥံၪအမ့ၬ ယၫ,ဒဲကယဲၦလၧအနၪဝ့ၫၥ့ၪလဖၪအမ့ၬယၫနီၪ, အီၪ လၧတရၫ့ထံၫအမ့ၬယၫတၭး ကယဲၦခမျၧးၥံၪ ထီးအ",
			"4": "<sup>4</sup> လူၬဒိၭအနါလၧလံၬဆၧၥီၪ့ဆၧၥၫ့နီၪလီၫ.- တၭၦကွ့ၭ လံၬစအ့ဇရၫနီၪ ဆၧၫ့ထုၪ့လၧဆၧထၪ့ထီၫလစီၪ့,လၧ ၦၡၩမၩဝ့ၫလၧၥံၪ့လၧဆၧနီၪလမံၩ့အဂး လၧအနဲၩ့ ထံၭနီၪ, စမၭတၥဲၫအၫ, ဒဲစၡ့မၫ, ဒဲစအၫ့နအဲအၫဒဲစ ယုၫရဲယၫ, ဒဲစဟံၫလကဲအၫ, ဒဲစမ့ၫအစဲအၫၥံၪ, ဆၧၫ့ ထုၪ့လၧအစူၪထွ့ၪလခီၫနီၪး ဒဲလၧအစူၪစ့ၪလခီၫ, စပ ဒၫယၫ,ဒဲစမံၭၡအ့လၭ, ဒဲစမၫလခဲအၫ,ဒဲစဟၭၡၧၫ့, ဒဲစဟၭၡဘၭဒနၫ, စဇ့ၭခရဲအၫ, ဒဲစမၡၧလၫ့ၥံၪလီၫ.",
			"5": "<sup>5</sup> တၭစအ့ဇရၫဝဲထၪ့လံၬနီၪ လၧၦခမျၧးၥံၪ ထီးအလူၬ အမ့ၬယၫ (မွဲလၧအအီၪလၧၦခမျၧးၥံၪထီးအလူၬအ ဖၫ့ခိၪအကၠီၩ့,) တၭထီးအဝဲထၪ့လံၬနီၪ, ၦခမျၧးၥံၪ ထီးအလူၬဆၧၫ့ထုၪ့ဝ့ၫတၭး စအ့ဇရၫစံၭထၪ့အၪ့အူၭ",
			"6": "<sup>6</sup> ယဟိဝၩ,ယွၩဖၭဒိၪနီၪလီၫ.- တၭၦခမျၧးထီးအလူၬ ၥံၪ,စံၭဆၧၫ့ဝ့ၫ, အၩမံၩ့,အၩမံၩ့, ဆိၬထၪ့အစူၪလဖၪ တၭးၡီၫ့လၩ့အခိၪ အမ့ၬၥံၪထီၩ့လၩ့ဂၪ့ခိၪတၭ, ဘိၪ့",
			"7": "<sup>7</sup> ထၪ့ဘၩထၪ့ယဟိဝၩနီၪလီၫ.- စယ့ၭရှုၫအၫဆ့, ဒဲစ ဘၫ့အဲၫ, ဒဲစၡ့ၫရဘဲအၫ, ဒဲစယၫမံၫ့, စအၭကၧၭ,စၡၭ ဘ့ၭၥအဲၫ စဟိၫဒဲယၫ, စမ့ၫအစဲအၫ, စက့လတၫ,စ အၭဇရဲအၫ,စယီၭဇဘၭ, စဟၫနၫ့,စပ့ၫလအဲအၫ,ဒဲၦ လံဝဲၫဖိၪၥံၪ, ဒုၭၥ့ၪယၫၦခမျၧးလဖၪ လၧဆၧၥီၪ့ဆၧ ၥၫ့အဂဲးအကၠီၪ့နီၪတၭ, ၦခမျၧးၥံၪအီၪလၧအလးနီၪ",
			"8": "<sup>8</sup> လီၫ.- ဘဲၫနီၪၥိၭအဝ့ၫၥံၪဖီဘၪလၧ ယွၩအလံၬဆၧၥီၪ့ ဆၧၥၫ့ဖၧၩ့နီၪလၩ့ထံးလၩ့ဆ့ၭတၭ, လီၩဖျီၪထၪ့အဂဲး အကၠီၪ့,ဒဲဒုၭနၪၥ့ၪဆၧလၧအဖီဘၪနီၪဆ့လီၫ.",
			"9": "<sup>9</sup> တၭစနံၫဟမဲအၫ, လၧအမွဲတၧၡၥၫ (ၦဒိၪဖၭဒိၪ) နီၪ,ဒဲၦကွ့ၭလံၬၦလုဆၧစအ့ဇရၫ, ဒဲၦလံဝဲၫဖိၪလဖၪ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦခမျၧးၥံၪ, စံၭၦခမျၧးထီးအလူၬၥံၪနီၪ, မုလနံၩယီၩမွဲဆံၫ့ဎံၪဝ့ၫ လၧယဟိဝၩနၥံၪအယွၩအ ဂးတၭး ထီးၥုၪ့အုၭၥၭအုၭလဂ့ၩ, ထီးမ့ၬထံၫလၩ့လ ဂ့ၩး အဂဲးဘဲၫယီၩ ၦခမျၧးထီးအလူၬၥံၪနါဂၧၫ့ဆၧၥီၪ့ ဆၧၥၫ့အဆၧချဲၩ့လဖၪအဘိၩ့ဘၭတၭ, အမ့ၬထံၫလၩ့",
			"10": "<sup>10</sup> ဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, လ့ၩကဒၪ ဘီၪး အၪ့ဆၧအၥိၪ, ဒဲအီၩဆၧအဆၧၫ့တၭ, ၦလၧအ တဲၩ့ဝဲၩဆၧလအီၪဘၪနးမံၩ့နီၪ, ဖ့ၪယူဆၧလၧအဝ့ၫၥံၪ ဘီၪ,အဂဲးဘဲၫယီၩ မုဆၫလနံၩယီၩဆံၫ့ဎံၪဝ့ၫလၧယ ဟိဝၩအဂးလီၫ. ထီးအီၪလၧဆၧၥုၪ့အုၭၥၭအုၭလ ဂ့ၩးအဂဲးဘဲၫယီၩ ယဟိဝၩအဆၧၥၭထိၬနီၪမွဲနၥံၪ",
			"11": "<sup>11</sup> အဂဲးအဘၭဆ့လီၫ.- အခိးမွဲၦလံဝဲၫဖိၪၥံၪဒုၭအီၪလၩ့ မါပံၭၦခမျၧးထီးအလူၬၥံၪတၭ, စံၭ,ၥူၭလဂ့ၩ, အဂဲး ဘဲၫယီၩမုဆၫလနံၩယီၩ ဆံၫ့ဎံၪဝ့ၫး ထီးၥုၪ့အုၭၥၭ",
			"12": "<sup>12</sup> အုၭလဂ့ၩ.- တၭၦခမျၧးထီးအလူၬၥံၪလ့ၩဝ့ၫဒၪ, လၧ အမိအၪ့ဆၧ,အီၩဆၧ, ဒဲဖ့ၪယူဆၧလဖၪ,ဒဲမၩမုၬလၩ အၥၭဖၭဒိၪနီၪ အဂဲးဘဲၫယီၩ ဆၧချဲၩ့လၧၦလီၩဘၪ ဝ့ၫလဖၪ, အဝ့ၫၥံၪနၪၥ့ၪယူၭလီၫ.",
			"13": "<sup>13</sup> တၭလၧမုနံၫနံၩလနံၩနီၪ, ၦခမျၧးထီးအလူၬအဖါ ၥံၪအခိၪလဖၪအီၪကိၩ့အီၪကီၪ့ဝ့ၫ, ၦလုဆၧလဖၪ,ဒဲၦ လံဝဲၫဖိၪလဖၪ, လၧၦကွ့ၭလံၬစအ့ဇရၫအအီၪ,ဘဲၫအ မိနၪၥ့ၪဆၧၥီၪ့ဆၧၥၫ့အဆၧချဲၩ့လဖၪ အၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> တၭဆၧၥီၪ့ဆၧၥၫ့လၧယဟိဝၩမၪလူၬ စမိစ့ၭနီၪ,အဝ့ၫ ၥံၪဒၪဘၪဆၧကွ့ၭအၥၭလၧအဖၧၩ့နီၪ, လၧလၩနွ့ၫဘံၪ့ လဘံၪ့အဆၧဘိၪ့ဖၧၩ့နီၪ, ၦအံၫစရ့လၭဖိၪလဖၪဘၪ",
			"15": "<sup>15</sup> အီၪလၧတဲၩၥံၪအဖၧၩ့တၭး- အဝ့ၫၥံၪဘၪဒုၭဂၧၫ့ထၪ့ ၥၩလၩ့လၧအဝ့ၫၥံၪအဒိၩ့ထီးအလူၬအဖၧၩ့, ဒဲလၧယ ရုစလံၫ့အဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ, လ့ၩထၪ့စိၩလၧခိၪလီၩ့ ဘီၪ, ဂဲၫထဲၩ့ဆိၬအလဲအိၫ့အထဲၩ့ၥံၪ, ဒဲၥံၪ့ၡိၫအထဲၩ့ ၥံၪ,မံၫဟၫဒၭအထဲၩ့ၥံၪ, ဒဲစီၩ့မလီၫ့အထဲၩ့ၥံၪ, ဒဲၥံၪ့ တၪ့အထဲၩ့ၥံၪ, ဘဲၫနၥံၪမိမၩကဲၪထၪ့တဲၩလဖၪဘဲၫဆၧ",
			"16": "<sup>16</sup> ကွ့ၭအၥၭအၥိၭနီၪဘီၪ.- အခိးမွဲၦခမျၧးၥံၪ လ့ၩထၪ့ ဝ့ၫတၭ,ဂဲၫထဲၩ့န့ဝ့ၫ, ဒဲမၩကဲၪထၪ့တဲၩလဖၪနီၪ,လၧ အဂံၪ့ခိၪဒၪဝ့ၫလဂၩဘၪလဂၩဆုၬဆုၬ, ဒဲလၧအဂံၪ့အ ဝၩ့ဖၧၩ့,ဒဲလၧယွၩအဂံၪ့အဝၩ့ၥံၪအဖၧၩ့, ဒဲလၧတရၫ့ ထံၫအဖၧၩ့ၥၭဖၧၩ့, ဒဲလၧတရၫ့အံဖြံၫ့အဖၧၩ့ၥၭနီၪ",
			"17": "<sup>17</sup> ဆ့လီၫ.- တၭကယဲဆၧအီၪကီၪ့လၧအဘၪဆဲၫ့ ၦၡၩ ဂဲၫထဲၩ့လၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအဖၧၩ့နီၪ, မၩထၪ့တဲၩ ၥံၪတၭ,ဆၧၫ့နၩ့ဝ့ၫ လၧတဲၩၥံၪအဖၧၩ့နီၪလီၫ. အဂဲး ဘဲၫယီၩလၧစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫအမုနံၩလဖၪ, ထီၩ့လၩ့မုနံၩနီၪတၭ, ၦအံၫစရ့လၭဖိၪလဖၪ မၩဝ့ၫဘဲၫ နီၪၥိၭနးဆိၭအ့ၬး တၭဆၧမုၬလၩအၥၭအီၪဝ့ၫဖၭဒိၪ ဆ့လီၫ.",
			"18": "<sup>18</sup> တၭလၧမုခၪ့ထံၭလနံၩနီၪ ထီးလၩ့အမုနံၩထုၬလ နံၩနီၪ,လနံၩဘၪလနံၩ, လနံၩဘၪလနံၩ, အဝ့ၫဒၪဖီဘၪ လၧယွၩအလံၬဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪဆ့လီၫ. တၭ အဝ့ၫၥံၪမၩဘိၪ့နီၪနွ့ၫနံၩအထးဖၧၩ့တၭး လၧမုဎိၭနံၩ လနံၩနီၪ,မွဲဆၧအီၪကီၪ့ဆံၫ့ဎံၪ, ဘဲၫအထူၫအရူၫအီၪ ဝ့ၫအၥိၭနီၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> တၭလၧလၩယီၩအနံၩနံၫဆံၫလံနံၩလနံၩနီၪ, ၦ အံၫစရ့လၭဖိၪၥံၪအီၪကိၩ့အီၪကီၪ့ လၧအဒုၪဆၧအၪ့ ဆၧအီၩ,ဒဲလၧရၧၬအဆၧကဲၩ့ယၬၥံၪ, ဒဲအီၪလၧဂၪ့ခိၪ",
			"2": "<sup>2</sup> မုၬလၧအလီၩ့နီၪလီၫ.- တၭအံၫစရ့လၭအချံၫအၥၪနီၪ မၩလၩ့ဖၭအၥၭလၧ ၦလခီၫဘၩ့မုးဖိၪထီးအလူၬတၭ, ဆၧၫ့ထုၪ့လီၩလၩ့အဆၧဒဲၩဘၭၥံၪ, ဒဲအဖါၥံၪအဆၧ",
			"3": "<sup>3</sup> မၩအၧၩ့လဖၪလီၫ.- တၭအဝ့ၫၥံၪဆၧၫ့ထုၪ့လၧအလး ဒၪဝ့ၫတၭ, ဖီထၪ့လံၬလၧယဟိဝၩ အဝ့ၫၥံၪအယွၩအ ဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ လနံၩလံဆၫ့လဆၫ့, ဒဲလနံၩလံ ဆၫ့လဆၫ့နီၪ, အဝ့ၫၥံၪလီၩလၩ့အၥၭဒၪဝ့ၫ, ဒဲဘိၪ့ထၪ့",
			"4": "<sup>4</sup> ဘၩထၪ့ယဟိဝၩအဝ့ၫၥံၪအယွၩလီၫ.- ထီးနီၪလဖၧၫ့ ၦဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪလဖၪ, စယ့ၭရှုၫအၫ, ဒဲစဘၫ့ အဲၫ,ဒဲစကၭလမ့လၭ, စၡ့ၫဘနဲအၫ, စဘုနဲၫ,စၡ့ၫရ ဘဲအၫ, စဘၫ့အဲၫ, စခ့ၫနနဲၫၥံၪ, ဆၧၫ့ထုၪ့လၧဆၧထၪ့ ထီၫအဖၫ့ခိၪတၭ, ကိၭထၪ့ယဟိဝၩ အဝ့ၫၥံၪအယွၩ လၧအလူဖၭဒိၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ ၦလံဝဲၫဖိၪလဖၪ, စယ့ၭရှုၫအၫ,ဒဲစ ကၭမအ့လၭ, စဘၫ့အဲၫ, စဟၭၡ့ၫဘနဲအၫ,စၡ့ၫရဘဲ အၫ,စဟိၫဒအဲအၫ, စၡ့ၫဘနဲအၫ, စပ့ၭၥဟဲအၫၥံၪ, စံၭဝ့ၫဒၪ, ဆၧၫ့ထုၪ့စံၭထၪ့အၪ့အူၭ ယဟိဝၩနၥံၪအယွၩအဆိၩ ဆိၩအကၠၪကၠၪဆံၭ. တၭနမံၩ့လၩဖၩ့ဝ့ၫ လၧအဘၪ ဆၧထၪ့ထီၫလၧကယဲဆၧဆိၪဂ့ၩ ဒဲဆၧအၪ့အူၭထီးအ လူၬအဖၫ့ခိၪနီၪ, မွဲနဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ.",
			"6": "<sup>6</sup> နဝ့ၫဒၪနနၫ့ဆါဒၪလ့ၬ, မွဲယဟိဝၩလဂၩတၭ, နမၩကဲၪ ထၪ့ယူၭမူၭခိၪယူၭ, မူၭခိၪအမူၭခိၪလဖၪ, ဒဲကယဲအ ဆၧခမျၧးလဖၪ, ဂၪ့ခိၪဒဲကယဲဆၧထီးအလူၬလၧအ လီၩ့,မၫဆမံၭ, ဒဲကယဲဆၧထီးအလူၬလၧအဖၧၩ့တၭ, နခိၭအဝ့ၫၥံၪထီးအလူၬ, ဒဲမူၭခိၪအၥုၭမုခမျၧးၥံၪဘိၪ့ ထၪ့ဘၩထၪ့နၧၩလီၫ.",
			"7": "<sup>7</sup> နဝ့ၫဒၪနမွဲယဟိဝၩနီၪ, လၧအရွံန့စအၫဘြၫ့,ဒဲ ဂဲၫဆိၬထၪ့ခွံၬအဝ့ၫ လၧအၧၫဘၪဆဲၫ့လၧခၫလဒံအၫနီၪ,",
			"8": "<sup>8</sup> ဒဲဖ့ၪလၫ့အဝ့ၫဒၪအမံၩ့စအၫဘြဟၫ့တၭ,- နဒၪဘၪအ ၥၭတီၩတီၩလီၩ့လီၩ့လၧနမ့ၬယၫနီၪ, ဒဲဒုၭအီၪထၪ့ဆၧ အုၩ့လၩ့လၧအဝ့ၫဒၪအၥိၭ, လၧနမိဖ့ၪလၫ့ထံၫၥံၪခးၥံၪ ဘၪဆဲၫ့လၧၦကၫနအၫ့ဖိၪၥံၪ, ၦဟံၥၭဖိၪၥံၪ, ၦအၫမိၫ ဖိၪၥံၪ,ဒဲၦပ့ရ့ၭဖိၪၥံၪ, ဒဲၦယ့ဘုၫဖိၪၥံၪ, ဒဲၦဂၧဂၡဲၭဖိၪ ၥံၪ,ဘဲၫၥိၭနမိဖ့ၪလၫ့အချံၫအၥၪလဖၪတၭး နမၩလၧၫ့ ထၪ့ဎွ့ၩထၪ့နဆၧချဲၩ့လဖၪနီၪး အဂဲးဘဲၫယီၩနတီၩဝ့ၫ",
			"9": "<sup>9</sup> လီၩ့ဝ့ၫလီၫ.- တၭနဒၪဘၪဆၧၡၪ့ဆၧနၭၥံၪလၧအဘၪ ပဖါၥံၪလၧအံဇံၭအဖၧၩ့နီၪ, ဒဲခိၭနၪအဝ့ၫၥံၪ, အဆၧ",
			"10": "<sup>10</sup> ကိၭၡၭထၪ့လၧထံၫဝီၩအနဲၩ့ထံၭနီၪး- ဒဲဒုၭနဲၪဖျီၪထၪ့ ဆၧမၩနဲၪ့လၩ့လၭလဖၪလၧဖၫရိၫအလီၩ့, ဒဲလၧအဝ့ၫ ဒၪအခ့ၫအၡၩထီးအလူၬၥံၪအလီၩ့, ဒဲလၧအထံၫၥံၪ ခးၥံၪအၡၩခမျၧးထီးအလူၬအလီၩ့နီၪး အဂဲးဘဲၫယီၩ နၥ့ၪယၫလၧအဝ့ၫၥံၪ အီၪက့ၪထၪ့ထီၫအၥၭ ထၫ့ဒၩၦ",
			"11": "<sup>11</sup> လဖၪနီၪလီၫ.- ဘဲၫနီၪၥိၭနန့ဘၪနမံၩ့ဖၭဒိၪဘဲၫမုဆၫ လနံၩယီၩအၥိၭလီၫ. တၭနမၩထ့ဖၭမၫဆမံၭလၧအ ဝ့ၫၥံၪအမ့ၬယၫ, ဘဲၫၥိၭအဝ့ၫၥံၪမိခၫ့ဂၬမၫဆမံၭအ ကျၩလၧခီၫ့ၥူၫခိၪနီၪး ဒဲအဝ့ၫၥံၪအဒုၪအဒၩလဖၪ, န ခွံၬလၩ့ခွံၬ လၧဆၧယိၬအဖၧၩ့နီၪ, ဘဲၫလိးလဖျိၪ့လၧ",
			"12": "<sup>12</sup> ထံၫအဒိၪအဆီၪ့လဖၪအၥိၭနီၪလီၫ.- လၧနီၪအမ့ၬယၫ နၥိၫ့အဝ့ၫၥံၪမုဆၫလခီၫလၧဆၧအုၪ့အထုၪ့တၭ, လၧ မုနၩလခီၫလၧမ့ၪအထုၪ့နီၪ, ဘဲၫၥိၭအမိဖၩ့ထၪ့လၧအ ဝ့ၫၥံၪအဂး, လၧဖၧၩ့ၥၭလၧအဝ့ၫၥံၪကြၨၭလ့ၩဝ့ၫလ ဘီၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> တၭနဂဲၫလၩ့ဆ့လၧခိၪလီၩ့စဲနၫအလီၩ့နီၪ, ဒဲချဲၩ့ဒုၪ့ အဝ့ၫၥံၪလၧမူၭခိၪလခီၫ, ဒဲဖ့ၪလၫ့အဝ့ၫၥံၪ အဆၧစ့ၩ ရၫ့လဖၪတီၩတီၩလီၩ့လီၩ့, ဒဲဆၧၥီၪ့ဆၧၥၫ့အမွဲအတီၩ ဆၧအထူၫအရူၫလဖၪ, ဒဲဆၧမၪလူၬလဖၪဆ့တၭး",
			"14": "<sup>14</sup> ဒဲဒုၭၥ့ၪယၫအဝ့ၫၥံၪ လၧမးၥံၫအနံၩဆံၫ့ဎံၪနီၪ, ဒဲမၪ လူၬအဝ့ၫၥံၪလၧဆၧၥနိၫလဖၪ, ဆၧအထူၫအရူၫလဖၪ, ဒဲဆၧမၪလူၬၥံၪလၧနခ့ၫအၡၩ စမိစ့ၭအစူၪဖၧၩ့နီၪလီၫ.",
			"15": "<sup>15</sup> တၭနဖ့ၪလၫ့အဝ့ၫၥံၪအကိၪ လၧမူၭခိၪနီၪ, လၧအဆၧ ၥၭဝံအၥၭအဂး, နမၩန့ထၪ့ထံၫလၧလိးၥံၪလဲၫ့ၥံၪအ ဖၧၩ့လၧအဝ့ၫၥံၪၥူၫအီၩအၥၭအဂးတၭ, နလီၩဘၪ ဝဲၩအဝ့ၫၥံၪလၧအမိနုၬလၧထံၫၥံၪခးၥံၪ, လၧနဆိၪလၩ့ ဝဲၩနၥၭလၧနမိဖ့ၪလၫ့အဝ့ၫၥံၪနီၪလီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲအဝ့ၫၥံၪဒဲပဖါၥံၪအီၪက့ၪထၪ့ထီၫအၥၭ, ဒဲမၩ ဆီၪ့အခိၬတၭ, ခိၭနၪနဆၧမၪလူၬလဖၪအ့ၬ, ဒဲအုၩ့",
			"17": "<sup>17</sup> လၩ့အၥၭလၧအမိခိၭနၪဆၧနီၪဆ့အ့ၬ,- မွဲအမၩနၪ့ ထၪ့အၥၭလၧနဆၧမၩလၩ့လၭလဖၪ, လၧနမၩလၧအ ဝ့ၫၥံၪအကျၩနီၪဆ့အ့ၬး အ့ၪမွဲမၩဆီၪ့ထၪ့အခိၬၥံၪ တၭ,လၧအပိၩ့ထၪ့ဆၧအဖၧၩ့နီၪ အဝ့ၫၥံၪအီၪက့ၪထၪ့ အခိၪဘဲၫၥိၭအမိထဲၩ့ထဲၩ့ လၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအ ဖၧၩ့နီၪလီၫ. မွဲလါနၫ့နဝ့ၫဒၪနမွဲယွၩ လၧအမိကွဲၪဖျါ ဆၧ,အီၪလၧဆၧအခိးအတၩ, ဒဲဆၧယၫ့ၥုၪ့ယၫ့ၥၭ, ၥၭထၪ့ၡီၫၡီၪ, ဒဲအီၪလၧဆၧအွံၪၥၭဆၧၩ့ဖၭဒိၪ, ဒဲစဲၪ့",
			"18": "<sup>18</sup> ဒၪအဝ့ၫၥံၪဆ့အ့ၬး- မွဲကဒၪယူၭ, ထီးအဝ့ၫၥံၪတဲၩ့န့ ချီဖိၪၥိၫ့န့ဝ့ၫလဒုၩနီၪ, ဒဲစံၭဝ့ၫ, အယီၩမွဲနယွၩလၧအ ဂဲၫဆိၬထၪ့ခွံၬနၧၩ လၧအံဇံၭအဖၧၩ့နီၪ, ဒဲမၩမၪဆၧ",
			"19": "<sup>19</sup> ဖၭဒိၪဆ့း- မွဲလါနၫ့ဘိၩ, နဝ့ၫဒၪလၧနဆၧယၫ့ၥၭအၪ အၪလ့ၬအဖၧၩ့နီၪ, လၧၡါမုနၧၫ့ဖၫအဖၧၩ့ နစဲၪ့ဒၪခွံၬ အဝ့ၫၥံၪဆ့အ့ၬ. ဆၧအုၪ့အထုၪ့နီၪဘဲၫၥိၭအမိၥိၫ့အ ဝ့ၫၥံၪလၧဖၧၩ့ၥၭတၭ, စဲၪ့ဒၪခွံၬဝ့ၫလၧမုဆၫလခီၫအ့ၬး ဒဲမ့ၪအထုၪ့နီၪမုနၩလခီၫ, ဘဲၫၥိၭအမိဒုၭဖၩ့ဆၧဒဲနဲၪ ဖျီၪဖၧၩ့ၥၭလၧအဝ့ၫၥံၪကြၨၭဖိၬဝ့ၫ လဘီၩ့နီၪစဲၪ့ဒၪဝ့ၫ ဆ့အ့ၬ.",
			"20": "<sup>20</sup> နဖ့ၪလၫ့ဆ့နၥၭဂ့ၩ လၧအမိၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪ တၭ,နမၪ့နၫနီၪနပဒၩ့ လၧအဝ့ၫၥံၪအနိၭဆ့အ့ၬး ဒဲန ဖ့ၪလၫ့အဝ့ၫၥံၪအထံၫလၧအၥူၫအီၩအၥၭအဂးနီၪဆ့",
			"21": "<sup>21</sup> လီၫ.- မွဲကဒၪယူၭ, လၧအနံၪ့လံဆံၫအထးဖၧၩ့နီၪ, နယိထဲၩ့ခွါထဲၩ့အဝ့ၫၥံၪ လၧၡါမုနၧၫ့ဖၫအဖၧၩ့နီၪတၭ, ထီးဒၪအဝ့ၫၥံၪကြၨၭန့ဘၪလမံၩ့လါလါ, လန့ဘၪနီၪ အီၪနးမံၩ့အ့ၬး အကီၩ့အၥိၭလးလံၩဘၪဝ့ၫအ့ၬ, ဒဲအခၪ့",
			"22": "<sup>22</sup> ၥံၪနီၪယိၭထၪ့ဆ့အ့ၬ. လၧနီၪအမ့ၬယၫနဖ့ၪလၫ့အဝ့ၫ ၥံၪလၧဘၩ့ၥံၪမုးၥံၪ, ဒဲၦဆၨၩၥံၪ, ဒဲအၪ့နၩ့ဖၭလစီၪ့ လစီၪ့နီၪဆ့လီၫ. ဘဲၫနီၪၥိၭအဝ့ၫၥံၪန့ဘၪထံၫၥံၪခးၥံၪ ဘၪဆဲၫ့လၧစဲဟၫ့, ဒဲဟ့ၭၡဘၫ့အစဎွၩ အထံၫအခး",
			"23": "<sup>23</sup> ဒဲဘၫၡၫ့အစဎွၩအီၭ အထံၫအခးဆ့လီၫ.- တၭနမၩ အၪထၪ့အဝ့ၫၥံၪအဖိၪအလံၩ ဘဲၫၡၪလၧမူၭခိၪအၥိၭ, ဒဲဒုၭနုၬအဝ့ၫၥံၪလၧထံၫၥံၪခးၥံၪအဖၧၩ့, လၧနလီၩဘၪ ဝဲၩအဝ့ၫၥံၪအဖါလဖၪအဂဲးအကၠီၪ့ လၧအမိန့ၥၫဝ့ၫနီၪ",
			"24": "<sup>24</sup> လီၫ.- အခိးမွဲဘဲၫနီၪတၭ, အဖိၪအလံၩၥံၪလ့ၩနုၬန့ဘၪ ဝ့ၫလၧထံၫၥံၪခးၥံၪတၭ, ထံၫဖိၪခးဖိၪလဖၪ နဒုၭဆၪ့ လၩ့အၥၭလၧၦလဖၪနီၪအမ့ၬယၫ, ၦကၫနအၫ့ဖိၪလ ဖၪ,လၧနဖ့ၪလၫ့လၧအဝ့ၫၥံၪအစူၪဖၧၩ့, ဒဲအဝ့ၫၥံၪအစ ဎွၩလဖၪ,ဒဲအထံၫခးၥံၪအၡၩခမျၧးလဖၪ, ဘဲၫၥိၭအ",
			"25": "<sup>25</sup> မိမၩဝ့ၫထီး အၥၭနီၪလီၫ.- တၭအဝ့ၫၥံၪမၩန့ဒိၩ့အ ခၧၫ့လဖၪ,ဒဲခးၥိၪဝ့ၫး ဒဲန့ဘၪဂံၪ့ၥံၪဎွ့ၩဝ့ၫလၧဆၧဖိၪ ဆၧလံၩ,ထံၫဖၧၩ့ခုၪ့ဝဲၩဝ့ၫလဖၪ, စဘံၭမုအလးၥံၪ, အလဲအိၫ့အလးၥံၪ, ဒဲၥံၪ့လၧအၥၪဝ့ၫနီၪအၪအၪလ့ၬ ဆ့လီၫ. အခိးမွဲအဝ့ၫၥံၪအၪ့ဘျဲၩအၪ့တၭ, ဘီၪ့ဝ့ၫၥိၪ ဝ့ၫ,ဒဲမုၬလၩအၥၭ လၧနဆၧဂ့ၩဖၭဒိၪအဖၧၩ့နီၪလီၫ.",
			"26": "<sup>26</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, အဝ့ၫၥံၪလခိၭနၪဘၪဆၧနီၪ, ကၭအ့ၬ. ပိၩ့ထၪ့နၧၩဒဲခွံၬၡိၭခွံၬ နဆၧမၪလူၬလဖၪ လၧအဝ့ၫၥံၪအချိၫ့လခီၫတၭ, မၩၥံၫနမီၪၥံၪ လၧအ ထိးအၥၭထၫ့ဒၩအဝ့ၫၥံၪ, ဘဲၫၥိၭအမိကၠၪထဲၩ့ဝ့ၫလၧ",
			"27": "<sup>27</sup> နအီၪလခီၫတၭ, မၩမၪဆၧအၪအၪလ့ၬနီၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ နဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧအဒုၪအဒၩ အစူၪဖၧၩ့နီၪ, လၧအမၩခိထၪ့အဝ့ၫၥံၪ အၥုၪ့အၥၭ လီၫ. တၭလၧအဝ့ၫၥံၪဘၪဆၧခိဆၧဝီၩအဘိၩ့ဘၭ, ထီးအကိၭထၪ့နၧၩနီၪ, နခိၭနၪလၧမူၭခိၪတၭ, ဘဲၫန ဆၧယၫ့ၥၭအၪအၪလ့ၬအၥိၭနီၪ, နဖ့ၪလၫ့အဝ့ၫၥံၪၦ လဖၪလၧအမၩဖီၩ့မၩဖျ့ၭဝ့ၫ, ဒဲထုၭထၪ့ခွံၬဝ့ၫလၧအ",
			"28": "<sup>28</sup> ဒုၪအဒၩအစူၪဖၧၩ့နီၪလီၫ.- အ့ၪမွဲလၧအဝ့ၫၥံၪန့ဘၪ ဆၧအီၪပွံၭအလးခဲၫ့တၭ, မွဲအမၩဒီၭဆၧအၧၩ့လၧန မ့ၬယၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, နဒုၭအီၪလၩ့ထးအ ဝ့ၫၥံၪလၧအဒုၪအဒၩအစူၪဖၧၩ့, ဘဲၫၥိၭအမိပၧၩ့ဘၪ ဆၧလၧအဝ့ၫၥံၪအဖၫ့ခိၪလီၫ. မွဲလါနၫ့တၭ ထီးအဝ့ၫ ၥံၪဂဲၫထဲၩ့ထဲၩ့နီၪ, ဒဲကိၭထၪ့နၧၩတၭ, နခိၭနၪအဝ့ၫ ၥံၪလၧမူၭခိၪလခီၫနီၪလီၫ. တၭနမၩဖီၩ့ဖျ့ၭအဝ့ၫၥံၪ",
			"29": "<sup>29</sup> အၪဘျၩ့ဘဲၫနဆၧယၫ့ၥၭလဖၪအီၪဝ့ၫအၥိၭ,- ဒဲထိးန ၥၭထၫ့ဒၩအဝ့ၫၥံၪ ဘဲၫၥိၭနမိဒုၭဂဲၫထဲၩ့အဝ့ၫၥံၪလၧန ဆၧၥနိၫလဖၪနီၪလီၫ. မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪအီၪက့ၪ ထၪ့ထီၫအၥၭတၭ, ခိၭနၪနဆၧမၪလူၬလဖၪအ့ၬ, မွဲအ မၩမၪဆၧထၫ့ဒၩ နဆၧစ့ၩရၫ့လဖၪ, (လၧၦအ့ၪမၩ တၭ,မိမၧၪ့ဝ့ၫလၧအဖၧၩ့နီၪ,) ဒဲထုၭခွံၬခိၬထံၭခိၪ, ဒဲ",
			"30": "<sup>30</sup> မၩဆီၪ့ထၪ့အခိၬတၭ, ခိၭနၪဝ့ၫအ့ၬ.- မွဲလါနၫ့တၭန အွံၪၥၭဆၧၩ့အၪနံၪ့နီၪ, ဒဲထိးနၥၭထၫ့ဒၩအဝ့ၫၥံၪလၧ နၥၭနီၪအီၪလၧနမီၪလဖၪအဖၧၩ့လီၫ. မွဲလါနၫ့တၭ အဝ့ၫၥံၪဒိၭအနါအ့ၬ. အခိးမွဲဘဲၫနီၪတၭ, နဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪလၧထံၫၥံၪခးၥံၪ အၡၩခမျၧးလဖၪ အစူၪဖၧၩ့",
			"31": "<sup>31</sup> လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, လၧနဆၧယၫ့ၥၭဖၭဒိၪအ ကၠီၩ့,နလမၩလူၬခွံၬဘၪအဝ့ၫၥံၪတၭ, နစဲၪ့ဒၪခွံၬဝ့ၫဆ့ အ့ၬး အဂဲးဘဲၫယီၩ နမွဲယွၩအီၪလၧဆၧအခိးအတၩ ဒဲဆၧယၫ့ၥုၪ့ယၫ့ၥၭလီၫ.",
			"32": "<sup>32</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ, ယွၩလၧအမွဲဆၧအဒိၪ,ဆၧ အဆီၪ့,ဒဲဆၧၥၭမဲၪဖၭဒိၪအလး, လၧအထီးန့ဆၧအုၩ့ လၩ့ဒဲဆၧယၫ့ၥၭ ပယွၩဧ့း ဆၧခိဆၧဝီၩဆၧၡၪ့ဆၧ နၭထီးအလူၬ လၧအလၩ့ဘၪပၧၩ, ဒဲပစဎွၩၥံၪ,ဒဲပၦ ဒိၪဖၭဒိၪၥံၪ,ဒဲၦၡၩလုဆၧၥံၪ, ဒဲပမီၪၥံၪ,ဒဲပဖါၥံၪ, ဒဲန ၡၩခမျၧးထီးအလူၬၥံၪ, လၧအစံရအၫအစဎွၩလဖၪအ ဆၧၫ့အထီခီးမုဆၫလနံၩယီၩ, မွဲအထီးကဲၪဆၧအ",
			"33": "<sup>33</sup> ဆံၭခိၬလၧနမ့ၬယၫလဂ့ၩ.- မွဲလါနၫ့တၭလၧဆၧဘၪ ပၧၩထီးအလူၬအဖၧၩ့နီၪ, နမွဲအတီၩအလီၩ့, အဂဲး ဘဲၫယီၩနဝ့ၫဒၪနမၩဆၧတီၩ, အ့ၪမွဲပဝ့ၫဒၪပမၩဆၧ",
			"34": "<sup>34</sup> အၧၩ့လခီၫတၭး ပစဎွၩၥံၪမွဲဂ့ၩ ၦဒိၪဖၭဒိၪၥံၪမွဲဂ့ၩ, ၦၡၩလုဆၧၥံၪမွဲဂ့ၩ, ပဖါၥံၪမွဲဂ့ၩ, ထီးန့နဆၧၥီၪ့ဆၧ ၥၫ့အ့ၬး ဒဲနဆၧထိးအၥၭလဖၪ, လၧနထိးနၥၭထၫ့ဒၩ",
			"35": "<sup>35</sup> အဝ့ၫၥံၪဒဲနဆၧမၪလူၬလဖၪနီၪ ခိၭနၪဝ့ၫဆ့အ့ၬ.- အ ဂဲးဘဲၫယီၩ လၧအဝ့ၫၥံၪအဘၩ့အမုးအဖၧၩ့ ဒဲလၧန ဆၧဂ့ၩဖၭဒိၪအဖၧၩ့လၧနဖ့ၪလၫ့အဝ့ၫၥံၪ, ဒဲလၧခးၥိၪ ဝ့ၫဒဲဒိၪဝ့ၫအဖၧၩ့ လၧနဖ့ၪလၫ့လၧအဝ့ၫၥံၪအမ့ၬယၫ နီၪ,အဝ့ၫၥံၪမၩနဆၧအ့ၬ. မွဲအကၠၪခွံၬအၥၭလၧအ",
			"36": "<sup>36</sup> ဆၧမၩအၧၩ့လဖၪနီၪဆ့အ့ၬ.- ယိခွါ, မုဆၫလနံၩယီၩ ပမွဲဆၧအဎီးအၡၩတၭ, ဆၧအထံၫအခးလၧနဖ့ၪလၫ့ ပဖါၥံၪဘဲၫၥိၭအမိအၪ့အဆၧၥၪ, ဒဲအဆၧဂ့ၩနီၪး ယိ",
			"37": "<sup>37</sup> ခွါ,ပမွဲဆၧအဎီးအၡၩ လၧအဖၧၩ့ယီၩလီၫ.- တၭစ ဎွၩၥံၪလၧနအီၪက့ၪလၧပဖၫ့ခိၪ လၧပဆၧဒဲၩဘၭၥံၪ အကၠီၩ့နီၪ, မွဲအဒုၭအၪထၪ့အဝ့ၫၥံၪ အစူၪလးခၪ့ခိၪ အၪအၪလ့ၬလီၫ. တၭထီးဒၪအၥၭနီၪ အဝ့ၫၥံၪပၧၩ့ပ မိၡါ,ဒဲပဆၧဖိၪဆၧဎါလဖၪဆ့တၭ, ပဘၪၡၪ့ဘၪနၭ ဒိၪမၬလီၫ.",
			"38": "<sup>38</sup> လၧဆၧယီၩထီးအလူၬအကၠီၩ့ ပအုၩ့လၩ့ဆၧတ ၡါ,ဒဲကွ့ၭလၩ့ဝ့ၫဆ့တၭ, ပၦဒိၪဖၭဒိၪၥံၪ, ၦလံဝဲၫဖိၪ ၥံၪ,ၦလုဆၧၥံၪ, စဲၩနဲၪ့ထၬဝ့ၫလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ၦလၧအစဲၩနဲၪ့ထၬဝ့ၫလဖၪမွဲဘဲၫယီၩ, တၧၡၥၫ (ၦဒိၪဖၭဒိၪ,) စနံၫဟမဲအၫ, လၧအမွဲစဟၭခလဲအၫ",
			"2": "<sup>2</sup> အဖိၪခွၫ, ဒဲစဇ့ၫဒကဲယၫ,- စစံရအဲအၫ, စအၭဇရဲ",
			"3": "<sup>3</sup> အၫ, စယ့ၫရမဲအၫ,- စပၭၡၧၫ,စအၫမရဲအၫ စမၫလခဲ",
			"4": "<sup>4</sup> ယၫ,- စဟၭတၧၭ, စၡ့ၫဘနဲအၫ, စမၫလၧၭ, စဟၭ",
			"5": "<sup>5</sup> ရံၫ့,စမ့ၫရမီၭ, စအိၫဘဒဲအၫ,- စဒၫ့နအ့လၭ, စဂံန",
			"6": "<sup>6</sup> ၥိၫ့,စဘၫရၧၭ,- စမၡၧလၫ့, စအဘဲၫယၫ, စမဲၫယ",
			"7": "<sup>7</sup> မံၫ့,- စမ့ၫအဇဲအၫ,စဘံလဂ့အံၫ, စၡ့ၫမအဲအၫၥံၪး",
			"8": "<sup>8</sup> အဝ့ၫၥံၪမွဲၦလုဆၧလဖၪလီၫ.",
			"9": "<sup>9</sup> တၭၦလံဝဲၫဖိၪၥံၪး စအၭဇနဲအၫအဖိၪခွၫ စယ့ၭ ရှုၫအၫ,စဘံၫ့ယုၫအဲၫ ဘၪဆဲၫ့လၧစဟ့နဒၭ အဖိၪခွၫ",
			"10": "<sup>10</sup> လဖၪ,စကၭမအ့လၭ,- ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ,",
			"11": "<sup>11</sup> စၡ့ၫဘနဲအၫ,စဟိၫဒဲယၫ,စက့လတၫ,စပံလအဲအၫ,",
			"12": "<sup>12</sup> စဟၫနၫ့,- စမဲခၫ,စရံဟီၭ, စဟၭၡဘဲအၫ,စဇၭခၧၫ,",
			"13": "<sup>13</sup> စၡ့ၫရဘဲအၫ,စၡ့ၫဘနဲအၫ,- စဟိၫဒဲယၫ,စဘၫ့အဲၫ, စဘံၫ့နဲၫနုၫၥံၪလီၫ. ၦခမျၧးၥံၪအခိၪလဖၪး",
			"14": "<sup>14</sup> စပၫရီၭ,စပၫဟၭမိအၭ,",
			"16": "<sup>16</sup> စအံလၫ့,စဇၭၥုၫ, စဘၫ့အဲၫ,- စဘုနၫ,စအၭဇဂၭ,",
			"17": "<sup>17</sup> စဘံဘဲၫ,- စအၭဒနဲယၫ, စဘံၭဂဝ့အဲၫ, စအၫဒံၫ့, စအၫတၧၫ,စဟံၭစကဲယၫ,စအၭဇၧၭ.",
			"18": "<sup>18</sup> စဟိၫဒဲ",
			"20": "<sup>20</sup> ယၫ,စဟၭၡၧၫ့ စဘံဇဲၫ,- စဟၫရံၭ,စအၫ့နၥီၭ, စနံ ဘဲၫ,စမၭဂပံအၭ,စမၡၧလၫ့, စဟံဇၧၫ,",
			"21": "<sup>21</sup> စမ့ၭၡ",
			"23": "<sup>23</sup> ဇ့ၫဘ့လၭ,စဇၫဒီၭ, စယၭဒုၫအၫ,- စပ့ၫလတဲအၫ,",
			"24": "<sup>24</sup> စဟၫနၫ့,စအၫ့နအဲၫအၫ,- စဟိၫစံအၫ, စဟၫ့နနဲအၫ",
			"25": "<sup>25</sup> စဟၭၡၧၭ,- စတၫလိအ့ၭ, စပံလဟၫ, စၡိၫဘ့ၭ, စရံဟၧၫ့,စဟၭၡၭဘနၫ,စမၫအစဲအၫ,",
			"26": "<sup>26</sup> ဒဲစအဟဲ ယၫ,စဟၫနၫ့,စအၫနၫ့စမၫလၧၭ, စဟၫရံၫ့,စဘၫအ နၫၥံၪလီၫ.",
			"28": "<sup>28</sup> တၭၦခမျၧးဂူၫဂၩၥံၪ, ၦလုဆၧလဖၪ,ၦလံဝဲၫဖိၪ လဖၪ,ၦပၧၩ့တရၫ့လဖၪ, ၦၥံၫကျံၩဆၧလဖၪ,ၦန့ၭၥနံ ဖိၪလဖၪ,ဒဲကယဲၦလၧအမၩလၩ့ဖၭအၥၭ လၧထံၫၥံၪ ခးၥံၪအၡၩခမျၧးလဖၪ ကိၭဂၩဒ့ၭ, ထီၩ့လၧယွၩအဆၧ မၪလူၬလဖၪအဖၧၩ့နီၪ, အမၫၥံၪ, အဖိၪခွၫၥံၪ,ဒဲအဖိၪ မုၪၥံၪ,ၦလၧအၥ့ၪယၫဆၧ, ဒဲနၪဆၧၥ့ၪကိၭဂၩဒ့ၭဆုၬ,",
			"29": "<sup>29</sup> ဆုၬး- အဝ့ၫၥံၪအီၪက့ၪဎုၬအၥၭလၧ အထၧၫ့ဖုဝဲၥံၪအ ၥိၭ,ဒဲအၡၩအီၪလၧအလၩဖၩ့လဖၪတၭ, နုၬလၧဆၧ ဆိၪအၧၩ့အဖၧၩ့, ဒဲဆိၪလၩ့အၥၭ လၧအမိလ့ၩလၧ ယွၩအဆၧမၪလူၬအဖၧၩ့, လၧဆၧဖ့ၪလၫ့ဝ့ၫလၧယွၩ အခ့ၫအၡၩစမိစ့ၭအစူၪဖၧၩ့, ဒဲလၧအမိထီးန့ဒဲမၩဆ့ ကယဲယဟိဝၩပကဆါ အဆၧမၪလူၬလဖၪ ထီးအ",
			"30": "<sup>30</sup> လူၬ,ဒဲအဆၧစ့ၩရၫ့ၥံၪ, ဒဲအၥနိၫလဖၪဆ့လီၫ.- တၭ လၧထံၫၥံၪခးၥံၪအၡၩခမျၧးလဖၪနီၪ, ပမိဖ့ၪလၫ့ပဖိၪ မုၪလဖၪဆ့အ့ၬ, တၭအဝ့ၫၥံၪအဖိၪမုၪလဖၪနီၪ, ပမိ",
			"31": "<sup>31</sup> မၩန့လၧပဖိၪခွၫလဖၪအဂးဆ့အ့ၬ,- တၭထံၫဖိၪခး ဖိၪလဖၪနီၪ, အ့ၪဂဲၫဆိၬအဆၧဖိၪဆၧလံၩမွဲဂ့ၩ, ဆၧ အၪ့ဆၧအီၩမွဲဂ့ၩ, ဘဲၫၥိၭအမိအၪ့ဆၫခွံၬဝ့ၫလၧမးၥံၫ အနံၩတၭ, လၧမးၥံၫအနံၩမွဲဂ့ၩ, လၧမုနံၩဆံၫ့ဎံၪမွဲ ဂ့ၩပမိဎွ့ၩန့ဝ့ၫအ့ၬ. ဒဲပမိအီၪက့ၪလၩ့ထးနွ့ၫနံၪ့လနံၪ့ နီၪ,ဒဲဆၧအၪ့ကံၩ့ဆီၪ့ဆၧအဒ့ၪအမါ လမံၩ့လါလါနီၪ ဆ့လီၫ.",
			"32": "<sup>32</sup> တၭပဒုၭကဲၪထၪ့ဆၧအထူၫအရူၫလဖၪ, လၧပမိ အၪ့မၧၫ့ပနၫ့ဆါဒၪပဝ့ၫ ဖ့ၪလၫ့လနံၪ့ဘၪလနံၪ့ၡက့ လၭၥၧၫ့ကဲၩ့လကဲၩ့လၧပယွၩအဂံၪ့ အဆၧမၩအဂး",
			"33": "<sup>33</sup> လၧဆၧမ့ၬယၫအကိၪအဂး, ဒဲလၧဆၧမၩဘိၪ့ကိၪမုၬ ထံၪဎးအဂး, ဒဲလၧဆၧလုမ့ၪထံၪဎးအဂး, လၧမးၥံၫ အနံၩလဖၪ, လၧလၩၥံၫအနံၩလဖၪ, လၧဆၧအီၪက့ၪ ဂုးဆၧဘိၪ့အဂး, ဒဲလၧဆၧဆံၫ့ဎံၪလဖၪအဂး, ဒဲလၧ ဆၧဒဲၩဘၭအဆၧမၩဘိၪ့အဂး, ဘဲၫၥိၭအမၩဆၧဖီၩ့ ဖျ့ၭလၧအံၫစရ့လၭအဂး ဒဲလၧပယွၩအဂံၪ့အဆၧ မၩထီးအလူၬအဂးလီၫ.",
			"34": "<sup>34</sup> တၭပဖၭဆၧလၧၦလုဆၧၥံၪအကျၩ, ၦလံဝဲၫဖိၪလ ဖၪ,ဒဲၦခမျၧးလဖၪ, လၧဆၧမၩဘိၪ့ၥံၪ့မုအဂး,လၧဆၧ မိဂဲၫဆိၬထၪ့လၧပယွၩအဂံၪ့ဖၧၩ့, ဘဲၫပဖါၥံၪအဂံၪ့ အၥိၭ,လၧလနံၪ့ဘၪလနံၪ့, ဘဲၫဆၧဖၭဝဲၩအဆၧၫ့အ ထီအၥိၭ, လၧဆၧမိမၩခဲၩထၪ့မ့ၪ လၧယဟိဝၩပယွၩ အဆၧလုလးအဖၫ့ခိၪနီၪ, ဘဲၫဆၧကွ့ၭအၥၭလၧဆၧ",
			"35": "<sup>35</sup> မၪလူၬအဖၧၩ့အၥိၭ,- ဒဲဂဲၫဆိၬပဂၪ့ခိၪအဆၧၥၪဆိၫ ၥံၪ,ဒဲၥံၪ့လဖၪထီးအလူၬ အဆၧၥၪဆိၫဆ့, လနံၪ့ဘၪ",
			"36": "<sup>36</sup> လနံၪ့, ထီၩ့လၧယဟိဝၩအဂံၪ့နီၪလီၫ.- ဒဲလၧပဖိၪခွၫ ဝဲၡါၥံၪဆ့, ဒဲလၧပဆၧဖိၪဆၧဎါၥံၪ, ဘဲၫဆၧကွ့ၭအ ၥၭလၧလံၬဆၧမၪလူၬအဖၧၩ့အၥိၭနီၪး ဒဲလၧပၥိၪၥံၪ, ဘ့ၪၥံၪအဒီၪ့လဖၪ အဖိၪဝဲၡါလၧပဂဲၫဆိၬ ထီၩ့လၧပ ယွၩအဂံၪ့နီၪး လၧၦလုဆၧလဖၪၦလၧအမၩပယွၩအ",
			"37": "<sup>37</sup> ဂံၪ့အဆၧမၩနီၪအအီၪလီၫ.- ဒဲလၧပမိဂဲၫဆိၬကိၪအ ၥံၫ့အဆိၫ,ဒဲပဆၧလုၥံၪ, ဒဲကယဲၥံၪ့ၥံၪလမံၩ့လါလါ ထီးအလူၬအဆၧၥၪဆိၫလဖၪ, လၧစဘံၭထံၫ,ဒဲၥိၪနီၪ ထီၩ့လၧၦလုဆၧလဖၪအအီၪ, လၧပယွၩအဂံၪ့အဒူၭ လဖၪအဖၧၩ့နီၪး ဒဲပဂၪ့ခိၪဆံၫပိၩ့လပိၩ့လၧၦလံဝဲၫဖိၪ လဖၪအအီၪ, ဘဲၫၥိၭၦလံဝဲၫဖိၪလဖၪနီၪ မိန့ဘၪဆံၫ ပိၩ့လပိၩ့ၥံၪလၧဒိၩ့ၥံၪ လၧပမၩဆၧလၧအဖၧၩ့ ထီး",
			"38": "<sup>38</sup> အလူၬလီၫ.- တၭစအၫရၧၫ့အဖိၪခွၫ ၦလုဆၧနီၪဘၪ အီၪလၧၦလံဝဲၫဖိၪၥံၪအၥိၭ, ထီးၦလံဝဲၫဖိၪလဖၪမၩန့ ဆံၫပိၩ့လပိၩ့နီၪး တၭၦလံဝဲၫဖိၪၥံၪဘၪဂဲၫဆိၬဆံၫပိၩ့ လပိၩ့အဆၧဆံၫပိၩ့လပိၩ့လမံၩ့နီၪး ထီၩ့လၧပယွၩအ ဂံၪ့,ဖိးလၧဒူၭလဖၪ လၧဆၧအီၪက့ၪကီၪ့ ဆၧဖိၪဆၧ",
			"39": "<sup>39</sup> လံၩအဂံၪ့နီၪလီၫ.- အဂဲးဘဲၫယီၩၦအံၫစရ့လၭဖိၪလ ဖၪ,ဒဲၦလံဝဲၫဖိၪလဖၪ, ဘၪဂဲၫဆိၬဆၧမၩဘိၪ့လၧဘုၪ ၥံၪဂူၫၥံၪ,လၧစဘံၭထံၫအၥၫ့, ဒဲၥိၪနီၪ, လၧဒူၭလဖၪ လၧလးဆံၫ့ဎံၪအဎၧၩ့အဎီအအီၪ, ဒဲၦလုဆၧၥံၪလၧ အမၩဆၧအခ့ၫအၡၩအဆၧနီၪ ၦပၧၩ့တရၫ့ၥံၪ,ဒဲၦၥံၫ ကျံၩဆၧအလးနီၪလီၫ. တၭပမိစဲၪ့ဒၪခွံၬ ပယွၩအဂံၪ့ နီၪဆ့အ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> တၭၦလၧအပၧၩ့ၦၡၩခမျၧးၥံၪ အီၪဝ့ၫလၧယရုစ လံၫ့း ၦခမျၧးဂူၫဂၩၥံၪဖၭဆၧဆ့, ဘဲၫၥိၭဆံၫဂၩလ ဂၩမိအီၪဝ့ၫလၧယရုစလံၫ့ဒိၩ့ဆံၫ့ဎံၪအဖၧၩ့, ဒဲခွံၫဂၩ",
			"2": "<sup>2</sup> ၥံၪအီၪလၧဒိၩ့ဂူၫဂၩလဖၪအဖၧၩ့လီၫ.- တၭၦလၧအ နၫ့ဆါၥံၪအၥၭအီၪထၪ့ဒၪဝ့ၫ လၧအမိအီၪလၧယရုစ လံၫ့နီၪ, ၦခမျၧးၥံၪဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ.",
			"3": "<sup>3</sup> တၭခးအခိၪလၧအအီၪဝ့ၫ လၧယရုစလံၫ့နီၪမွဲ ၦလဖၪယီၩး အ့ၪမွဲလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့နီၪ, ၦကိၭဂၩဒ့ၭအီၪလၧအဒိၩ့ဒၪဝ့ၫ လၧအန့ၥၫဝ့ၫ အလးနီၪ ဆုၬဆုၬး ၦအံၫစရ့လၭဖိၪၥံၪ, ၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫ ဖိၪၥံၪ,ဒဲၦန့ၭၥနံဖိၪၥံၪ, ဒဲစစီလမၧၫ့အခ့ၫအၡၩအဖိၪ",
			"4": "<sup>4</sup> အလံၩၥံၪနီၪလီၫ.- တၭၦယုဒၫဖိၪလနၩ့နၩ့အီၪလၧယ ရုစလံၫ့, ဒဲၦဘံၪ့ယမံၫ့ဖိၪၥံၪလနၩ့နၩ့ဆ့လီၫ. ၦဘၪ ဆဲၫ့လၧၦယုဒၫဖိၪလဖၪး စအၧၭဇဲအၫအဖိၪခွၫစအၭ ၥအဲအၫ, စဇ့ၭခရဲအၫအဖိၪခွၫ, စအၫမရဲအၫအဖိၪ ခွၫ,စၡ့ၫဖတဲအၫအဖိၪခွၫ, စမဟၫလလံလၭအဖိၪခွၫး",
			"5": "<sup>5</sup> ၦဘၪဆဲၫ့လၧစဂ့ရ့ၭအဖိၪအလံၩၥံၪ,- စဘၫရၧၭအ ဖိၪခွၫစမၫအစဲအၫ, စကီၫလဟိဇ့ၫအဖိၪခွၫ, စဟၭဇ အဲအၫအဖိၪခွၫ, စအၭဒအဲအၫအဖိၪခွၫ, စယီအရံၭ အဖိၪခွၫ, စဇ့ၭခရဲအၫအဖိၪခွၫ စၡလိနဲၫအဖိၪခွၫၥံၪ",
			"6": "<sup>6</sup> လီၫ.- စပ့ရ့ၭအဖိၪခွၫလၧအအီၪလၧယရုစလံၫ့ထီးအ လူၬလဖၪနီၪ, မွဲလံယၩဎူၫဆံၫဎိၭဂၩ, ၦၡၩအဂဲးဆီၪ့ ၥၭဒူၩလီၫ.",
			"7": "<sup>7</sup> တၭစဘံၪ့ယမံၫ့အဖိၪခွၫလဖၪမွဲအယီၩး စမၡၧ လၫ့အဖိၪခွၫစစၫလုၫ, စယိၫအ့ၭအဖိၪခွၫ,စပဒၫယၫအ ဖိၪခွၫ,စကီၫလအဲအၫအဖိၪခွၫ, စမ့ၫအစဲအၫအဖိၪခွၫ, စအံၭၥအ့လၭအဖိၪခွၫ, စယစဲအၫအဖိၪခွၫၥံၪလီၫ.",
			"8": "<sup>8</sup> လၧအဝ့ၫဒၪအလးခဲၫ့နီၪ, စဂၭဘဲၫ, စစၫလအဲၫ,ခွံၫ",
			"9": "<sup>9</sup> ယၩနံၫဆံၫဎိၭဂၩလီၫ.- စဇ့ၭခရဲအၫအဖိၪခွၫ, စယိၫ အ့လၭနီၪယိအဝ့ၫၥံၪလီၫ. တၭစစံၫ့ယုၫအၫအဖိၪခွၫ စယုဒၫနီၪအီၪလၧဒိၩ့အဖၫ့ခိၪ နံၫဂၩလဂၩလီၫ.",
			"10": "<sup>10</sup> ၦဘၪဆဲၫ့လၧၦလုဆၧၥံၪး စယီအရံၭအဖိၪခွၫ,စ",
			"11": "<sup>11</sup> ယဒ့ယၫ,စယၫခံၫ့ၥံၪလီၫ.- စဟံၫလကဲအၫအဖိၪခွၫ စစံၫရအဲအၫ, စမၡၧလၫ့အဖိၪခွၫ, စဇၫဒီၭအဖိၪခွၫ, စမရ့ယီၭအဖိၪခွၫ, စအဟဲတၧၭအဖိၪခွၫ, လၧအမွဲ",
			"12": "<sup>12</sup> ၦပၧၩ့ယွၩအဂံၪ့နီၪလီၫ.- တၭအဝ့ၫၥံၪအထၧၫ့ဖုဝဲ လၧအမၩဂံၪ့နီၪအဆၧမၩ, မွဲဎိၭယၩနံၫဆံၫနံၫဂၩလီၫ. တၭစယဟိရၧၫ့အဖိၪခွၫစအၭဒအဲအၫ, စပံၫလအဲ အၫအဖိၪခွၫ,စအၫမဇဲၫအဖိၪခွၫ, စဇ့ၭခရဲအၫအဖိၪခွၫ,",
			"13": "<sup>13</sup> စပၭၡၧၫအဖိၪခွၫ,စမၫလခဲအၫအဖိၪခွၫ,- ဒဲအထၧၫ့ ဖုဝဲလဖၪ, ဖါၥံၪအခိၪလဖၪနီၪ, နံၫယၩလံဆံၫနံၫဂၩ လီၫ. ဒဲစအၭဇရံလၭအဖိၪခွၫး စအၫမၡဲၫ, စအဟၭဇ အဲၫအဖိၪခွၫ, စမၡံလမံၭအဖိၪခွၫ,စအံမၧၫအဖိၪခွၫ,",
			"14": "<sup>14</sup> ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ, ၦဆီၪ့ၥၭဒူၩနီၪ,လယၩ နံၫဆံၫဎိၭဂၩလီၫ. တၭၦယိအဝ့ၫၥံၪမွဲၦၡၩဖၭဒိၪၥံၪ အဖိၪခွၫလဂၩ, စဇၭဘဒံၫအ့လၭနီၪလီၫ.",
			"15": "<sup>15</sup> ၦဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪလဖၪဆ့း စဟၭၡၧၭအဖိၪ ခွၫစၡ့ၫမအဲအၫ, စအၭဇကၫ့အဖိၪခွၫ,စဟၭၡဘဲအၫ",
			"16": "<sup>16</sup> အဖိၪခွၫစဘူၫနဲၫအဖိၪခွၫး- ဒဲၦလံဝဲၫဖိၪအခိၪၥံၪစၡၭ ဘ့ၭၥအဲၫဒဲစယီၭဇဘၭၥံၪ အီၪလၧယွၩအဂံၪ့အဆၧ",
			"17": "<sup>17</sup> ဖံၭဆၧမၩဘၪဆဲၫ့လၧခီၫ့လခီၫအဖၫ့ခိၪလီၫ.- တၭစ မဲခၫအဖိၪခွၫစမၭတနဲအၫ, စဇၭဘဒဲအဖိၪခွၫ,စအၫ စဖံၭအဖိၪခွၫ,မွဲၦအခိၪၥိၫ့ ဆၧစံၭထၪ့အၪ့အူၭလၧဆၧ ဘၩဆိၪဖၪအဖၧၩ့နီၪး ဒဲစဘၭဘုၫကဲအၫ ၦနံၫဂၩလ ဂၩလၧအထၧၫ့ဖုဝဲၥံၪအကျၩ, ဒဲစၡၫ့မုအၫအဖိၪခွၫ,စ အၭဘဒၫ,စဂၫလလၭအဖိၪခွၫ, စယ့ၭဒုၫၥၫ့အဖိၪခွၫ",
			"18": "<sup>18</sup> လီၫ.- တၭကယဲၦလံဝဲၫဖိၪလဖၪ လၧအအီၪဝ့ၫလၧဒိၩ့ ဆံၫ့ဎံၪအဖၧၩ့နီၪ, မွဲနံၫယၩဎိၭဆံၫလံဂၩလီၫ.",
			"19": "<sup>19</sup> လၧအနီၪအမ့ၬယၫၦပၧၩ့တရၫ့လဖၪ, စအၭကၧၭ, စတၫလမၧၫ့, ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ, လၧအခိၭ တရၫ့ၥံၪ, မွဲလယၩနွ့ၫဆံၫနံၫဂၩလီၫ.",
			"20": "<sup>20</sup> တၭၦအီၪလၩ့ထး လၧၦအံၫစရ့လၭအကျၩနီၪ,ၦ လုဆၧလဖၪ, ၦလံဝဲၫဖိၪလဖၪ, လၧယုဒၫအဒိၩ့ၥံၪ ထီးအလူၬအဖၧၩ့, လဂၩဒဲလဂၩလၧအဆၧန့ၥၫအဖၧၩ့ လီၫ.",
			"21": "<sup>21</sup> အ့ၪမွဲၦန့ၭၥနံဖိၪလဖၪအီၪလၧ အိဖ့ၫလၭအဖၧၩ့ တၭ,စဇဲဟၫဒဲစဂံၭစပၫအီၪလၧၦန့ၭၥနံဖိၪၥံၪအဖၫ့ခိၪ လီၫ.",
			"22": "<sup>22</sup> ၦလဂၩလၧအယိၦလံဝဲၫဖိၪလဖၪ လၧယရုစလံၫ့ နီၪ,မွဲစဘၫ့အဲၫအဖိၪခွၫစအၧၭဇဲၫ, စဟၭၡဘဲအၫအဖိၪ ခွၫ,စမၭတနဲအၫအဖိၪခွၫ, စမဲခၫအဖိၪခွၫနီၪလီၫ. ၦဘၪဆဲၫ့လၧစအၫစဖၭအဖိၪခွၫၥံၪ, ၦၥံၫကျံၩဆၧလ",
			"23": "<sup>23</sup> ဖၪနီၪလၧယွၩအဂံၪ့အကဲၩ့အကၩအဖၫ့ခိၪလီၫ.- အဂဲး ဘဲၫယီၩစဎွၩမၪလူၬ ဆၧလၧအဝ့ၫၥံၪ အဂဲးအကၠီၪ့, ဘဲၫၥိၭဆၧအဂး မိအီၪလၧၦၥံၫကျံၩဆၧလဖၪ အဂး လနံၩအဂးလနံၩအဂးနီၪလီၫ.",
			"24": "<sup>24</sup> တၭစမၡ့ၭဇဘံၫအ့လၭအဖိၪခွၫ စပ့ၭၥဟဲအၫ,ဘၪ ဆဲၫ့လၧစယုဒၫအဖိၪခွၫစဇံၭရၫအဖိၪအလံၩ, အီၪလၧ စဎွၩအစူၪထံၭ, လၧကယဲဆၧလမံၩ့လါလါ ဘၪဆဲၫ့ လၧၦခမျၧးၥံၪနီၪလီၫ.",
			"25": "<sup>25</sup> တၭလၧတဝၫ့ၥံၪ, ဒဲအဂၪ့ခိၪအဝၩ့လဖၪနီၪ,ၦဘၪ ဆဲၫ့လၧယုဒၫအဖိၪအလံၩၥံၪ, အီၪလၧကၧယၭအါဘၫ ဒဲလၧအတဝၫ့ၥံၪအဖၧၩ့, ဒဲလၧဒဲၫဘၫ့ဒဲအတဝၫ့ၥံၪအ ဖၧၩ့,ဒဲလၧယ့ၭအၭဘဇံလၭ ဒဲအတဝၫ့ၥံၪအဖၧၩ့,",
			"26": "<sup>26</sup> ဒဲလၧယ့ၭရှုၫအၫ, ဒဲလၧမီလဒၫ, ဒဲလၧဘ့ၭၥဖံလ့ၭ,",
			"27": "<sup>27</sup> ဒဲလၧဟၫဇၫရှုၫအလၭ, ဒဲလၧဘံၫအၧၫၡံဘၫဒဲအတ",
			"28": "<sup>28</sup> ဝၫ့ၥံၪအဖၧၩ့,- ဒဲလၧဇံၭလၭ,ဒဲလၧမံၫကိနၫဒဲအတဝၫ့",
			"29": "<sup>29</sup> ၥံၪအဖၧၩ့,- ဒဲလၧအံၫရံမၧၫ့,ဒဲလၧဇၫရံအၫ,ဒဲလၧယၫ",
			"30": "<sup>30</sup> မုၫၥၫ,-ဇၫ့အိအၫ,အဒၧလၫ့, ဒဲအဝ့ၫၥံၪအတဝၫ့လဖၪ, လၧလၫခံၭဒဲအဂၪ့ခိၪအဝၩ့ၥံၪ, လၧအဇံကၫဒဲအတဝၫ့ ၥံၪနီၪလီၫ. တၭအီၪဝ့ၫလၧ ဘံၫအၧၫၡံဘၫ ထီၩ့လၧ ဟံၫနၧၫ့အခိၪလီၩ့ဆူၭနီၪလီၫ.",
			"31": "<sup>31</sup> စဘံၪ့ယမံၫ့အဖိၪအလံၩၥံၪဆ့ လၧဂံဘၫနီၪအီၪ လၧမံၭမၭဒဲအအဲယၫ, ဒဲလၧဘ့ၥလၭ,ဒဲအဝ့ၫၥံၪအတ ဝၫ့လဖၪ,",
			"32": "<sup>32</sup> လၧအၫ့အၥီၭ,နီၭ,အၫ့အနဲအၫ,- ဟၫ",
			"34": "<sup>34</sup> ဇီၫ,ရၫမၫ,ဂံၭဘအံၫ,- ဟၫဒ့ၭ, ဇံၫဘိအံၫ့, နံၫဘၫ",
			"35": "<sup>35</sup> လၭ,- လိဒၫ,ဒဲအိနိၫ, ၦမၩဆၧၥ့ၪအခိၪလီၩ့ဆူၭဖၧၩ့ နီၪလီၫ.",
			"36": "<sup>36</sup> ၦဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪလဖၪအဒီၪ့ၥံၪ အီၪလၧ ယုဒၫအဖၧၩ့, ဒဲလၧဘံၪ့ယမံၫ့အဖၧၩ့နီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭၦလဖၪယီၩမွဲၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫဖိၪၥံၪ, လၧအလ့ၩထၪ့ဖိၪ စၡံၫအၫတအ့လၭ အဖိၪခွၫစဇရၧၭ ဘၫဘ့လၭအခဲၫ့,ဒဲစယ့ၭရှုအ့ၫ, စစံၫရအဲအၫ,စယ့ၫ",
			"2": "<sup>2</sup> ရမဲအၫ,စအ့ဇရၫ,- စအၫမရဲအၫ, စမၫလၧၭ,စဟၭ တၧၭ,",
			"3": "<sup>3</sup> စၡ့ၭခနဲအၫ, စရံဟၧၫ့, စမ့ၫရမီၭ,- စအံၭ",
			"5": "<sup>5</sup> ဒိၫ,စဂံနၥိၫ, စအဘဲယၫ,- စမအၫမံၫ့,စမၫအဒဲအၫ,",
			"6": "<sup>6</sup> စဘံလဂၫ,- စၡံၫမအဲအၫ, ဒဲစယီအရံၭ,စယ့ၫဒအဲ",
			"7": "<sup>7</sup> အၫ,- စစၫလုၫ,စအၫမီၭ, စဟံၫလကဲအၫ,စယ့ၫဒ အဲအၫၥံၪလီၫ. အယီၩလဖၪမွဲၦလုဆၧၥံၪ ဒဲအထၧၫ့ ဖုဝဲလဖၪအခိၪၥံၪ လၧစယ့ၭရှုၫအၫအမုနံၩလဖၪနီၪ လီၫ.",
			"8": "<sup>8</sup> လၧနီၪအမ့ၬယၫ ၦလံဝဲၫဖိၪလဖၪး စယ့ၭရှုၫအၫ, စဘံၫ့ယုၫအဲၫ,စကၭမအ့လၭ, စၡ့ၫရဘဲအၫ,စယုဒၫ, စမၭတနဲအၫ, အီၪလၧဆၧစံၭထၪ့အၪ့အူၭအဖၫ့ခိၪ,",
			"9": "<sup>9</sup> အဝ့ၫဒၪဒဲအထၧၫ့ဖုဝဲလဖၪလီၫ.- စတၭဘုၫကဲအၫဆ့, ဒဲစအၧနဲၫ,အဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ, အီၪဆဲၫဎၩ့အ ဝ့ၫၥံၪလၧခိၭဆၧလဖၪအဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> တၭစယ့ၭရှုၫအၫထၪ့ဖိၪစယီအကံၫ့, စယီအကံၫ့ နီၪထၪ့ဖိၪဆ့ စအံၫလဲအၡံၭ, စအံၫလဲအၡံၭနီၪထၪ့ဖိၪ",
			"11": "<sup>11</sup> စယီအဒၫ,- ဒဲစယီအဒၫနီၪထၪ့ဖိၪစစၪ့နၥၧၫ့,ဒဲစစၪ့ နၥၧၫ့နီၪထၪ့ဖိၪစယၭဒုအၫနီၪလီၫ.",
			"12": "<sup>12</sup> တၭလၧစယီအကံၫ့အမုနံၩလဖၪအဖၧၩ့နီၪ, ၦလု",
			"13": "<sup>13</sup> ဆၧလဖၪ,ဖါၥံၪအခိၪလဖၪအီၪ,- လၧစစံၫရအဲအၫ,",
			"14": "<sup>14</sup> စမ့ၫရအဲအၫလၧစယ့ၫရမဲအၫ, စဟၫ့အနဲအၫ,- လၧ စအ့ဇရၫ,စမၡၧလၫ့, လၧစအၫမရဲအၫစယဟိၫ့ဟၫ",
			"15": "<sup>15</sup> နၫး- လၧစမ့လကုၫ,စစၪ့နၥၧၫ့,လၧစၡ့ၫဘနဲအၫ,စယိ",
			"16": "<sup>16</sup> ၥၭး- လၧစဟၫရံၫ့,စအၭနၫ,လၧစမ့ရ့ယီၭ, စဟ့ၫလ",
			"17": "<sup>17</sup> ကဲၫ,- လၧစအံၭဒိၫ,စဇ့ၭခရဲအၫ,လၧစဂံလၥိၫ့,စမ ၡၧလၫ့,လၧစအဘဲယၫ,စဇံၭရဲၫး လၧစမနဲအမၠၩ,ဘၪ",
			"18": "<sup>18</sup> ဆဲၫ့လၧမိၫအဒဲအၫနီၪ,စပံလတဲၫး- လၧစဘံလဂၫ,",
			"19": "<sup>19</sup> စၡၫ့မုၫအၫ,လၧစၡ့ၫမနဲအၫ, စယဟိနၥၫ့,- ဒဲလၧ စယီအရံၭ,စမၭတန့အဲၫ, လၧစယ့ၭဒအဲအၫ,စအၧၭ",
			"20": "<sup>20</sup> ဇဲၫ,- လၧစစၫလဲၫ,စကၫလအဲၫး လၧစအၫမီၭ,စအံၫ",
			"21": "<sup>21</sup> ဘၧၫး- လၧစဟံၫလကဲအၫ, စဟၭၡဘဲအၫ,လၧစယ့ၭ ဒအဲအၫ,စနၥၫ့နအ့လၭနီၪလီၫ.",
			"22": "<sup>22</sup> လၧစအံၫလဲအၡံၭအမုနံၩလဖၪနီၪ ၦလံဝဲၫဖိၪၥံၪ, စယီအဒၫ,ဒဲယိၫဟၫနၫ့, ဒဲယၭဒုၫအၫ,ဆၧကွ့ၭလၩ့ အမံၩ့ဘဲၫဖါၥံၪအခိၪအၥိၭး ၦလုဆၧၥံၪဆ့,ထီၩ့လၩ့",
			"23": "<sup>23</sup> လၧၦပၧၡၫဖိၪစဒရဲအၧၭကဲၪစဎွၩနီၪလီၫ.- စလံဝဲၫအ ဖိၪခွၫၥံၪ,ဖါၥံၪအခိၪလဖၪ, ဘၪဆၧကွ့ၭဝ့ၫလၧလံၬ ကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, ထီၩ့လၩ့လၧစအံၫလဲအၡံၭအ ဖိၪခွၫစယိၫဟၫနၫ့ အမုနံၩလဖၪနီၪလီၫ.",
			"24": "<sup>24</sup> ၦလံဝဲၫဖိၪအခိၪလဖၪနီၪး စဟၭၡဘဲအၫ, စၡ့ၫရ ဘဲအၫ,ဒဲစယ့ၭ ရှုၫအၫ,စကၭမအ့လၭအဖိၪခွၫ, ဒဲအ ဝ့ၫၥံၪအထၧၫ့ဖု ဝဲလဖၪဆဲၫဎၩ့လၧအဝ့ၫၥံၪ, ဘဲၫၥိၭ အမိၥံၫကျံၩဆၧ, ဒဲစံၭထၪ့အၪ့အူၭဝ့ၫ, ဘဲၫယွၩအၡၩ စဒၫဝံၭမၪလူၬဝ့ၫအၥိၭနီၪ,လဒီၪ့ဆဲၫဎၩ့လၧလဒီၪ့နီၪ",
			"25": "<sup>25</sup> လီၫ.- စမၭတနဲအၫ,ဒဲစဘၭဘုၫကဲအၫ, စအိၫဘဒဲအၫ, စမၡၧလၫ့, စတၫလမၧၫ့,စအၭကၧၭ, ၦပၧၩ့တရၫ့ၥံၪ",
			"26": "<sup>26</sup> ခိၭအလးလၧတရၫ့လဖၪ အဂၩ့ထံၭနီၪလီၫ.- ၦလဖၪ ယီၩအီၪ လၧစယ့ၭရှုၫအၫအဖိၪခွၫ စယီအကံၫ့အမု နံၩလဖၪနီၪး စယီၭဇဒ့ၭအဖိၪခွၫ, ဒဲလၧၦဒိၪဖၭဒိၪစနံၫ ဟမဲအၫအမုနံၩလဖၪ, ဒဲလၧၦကွ့ၭလံၬ, ၦလုဆၧစ အ့ဇရၫနီၪလီၫ.",
			"27": "<sup>27</sup> လၧဆၧမၩဘိၪ့ဖလါယရုစလံၫ့အခိၪဒၧၩ့နီၪ, အဝ့ၫ ၥံၪအၪ့ဎၬၦလံဝဲၫဖိၪၥံၪ လၧကယဲအလးလစီၪ့လါလါ, လၧအမိဂဲၫၥိၫ့ဝ့ၫထီၩ့ယရုစလံၫ့နီၪ, ဘဲၫၥိၭအမိမၩ ဆၧဘၪဆဲၫ့လၧဘိၪ့ဖလါဆၧနီၪ လၧဆၧၥုၪ့ထိၬၥၭ ထိၬး လၧအစံၭထၪ့အၪ့အူၭဆၧနီၪ, ဒဲၥံၫကျံၩဆၧဆ့း",
			"28": "<sup>28</sup> အီၪလၧစံၩ့စံၩ့ၥံၪ, ၥၫ့ထီးၥံၪ,နါဒံၩ့ၥံၪလီၫ.- ၦၥံၫကျံၩ ဆၧအဖိၪခွၫၥံၪအီၪကိၩ့အီၪကီၪ့တၭ, ဂဲၫထၪ့လၧဆၧ ဒၩဖၧၩ့လၧအအီၪဝၬဖီၩ့ယရုစလံၫ့, ဒဲလၧနတီၭဖၥဲၫ",
			"29": "<sup>29</sup> အတဝၫ့လဖၪနီၪဆ့,- ဒဲလၧဂံလဂၫလၭအဂံၪ့ဆ့,ဒဲလၧ ဂံဘၫဒဲအၭဇမဝ့ၭ အဆံၬၥံၪနၩၥံၪး အဂဲးဘဲၫယီၩၦ ၥံၫကျံၩဆၧလဖၪနီၪ မၩကဲၪထၪ့အတဝၫ့ၥံၪအီၪဝၬဖီၩ့",
			"30": "<sup>30</sup> ယရုစလံၫ့နီၪလီၫ.- တၭၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫဖိၪၥံၪ မၩဆံၫ့ထၪ့အနၫ့ဆါၥံၪ, ဒဲမၩဆံၫ့ထၪ့ၦခမျၧးၥံၪ,ဒဲ တရၫ့ၥံၪ,ဒဲခိၪဒၧၩ့နီၪဆ့လီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့ ယဂဲၫဆိၬထၪ့ယုဒၫအၦဒိၪၥံၪလၧခိၪ ဒၧၩ့အလီၩ့တၭ, ၦလၧအစံၭထၪ့အၪ့အူၭဆၧနီၪယ အီၪက့ၪအဒီၪ့ဖၭဒိၪနံၫဒီၪ့း အလဒီၪ့နီၪလ့ၩလၧစူၪထွ့ၪ လခီၫလၧခိၪဒၧၩ့အလီၩ့နီၪ တီၩလၧတရၫ့ဆၧအ့ၪး",
			"32": "<sup>32</sup> လၧအဝ့ၫၥံၪအလးခဲၫ့နီၪ, စဟီၭၡအဲအၫလ့ၩဝ့ၫ,ဒဲယု",
			"33": "<sup>33</sup> ဒၫအၦဒိၪၥံၪဖိၭဖၫ့လဖၪနီၪ,- ဒဲစအၭဇရဲအၫ,စအ့ဇ",
			"34": "<sup>34</sup> ရၫ,ဒဲစမၡၧလၫ့,- စယုဒၫ,ဒဲစဘံၪ့ယမံၫ့, ဒဲစၡ့ၫမအဲ",
			"35": "<sup>35</sup> အၫ,ဒဲစယ့ၫရမဲအၫ,- ဒဲၦလုဆၧအဖိၪခွၫၥံၪလနၩ့အီၪ လၧခွ့ၩၥံၪ,စဇ့ၭခရဲအၫ, စစၪ့နၥၧၫ့အဖိၪခွၫ,စၡ့ၫမ အဲအၫအဖိၪခွၫ, စမၭတနဲအၫအဖိၪခွၫ, စမံၫခအဲအၫ အဖိၪခွၫ, စဇၭကၧၫအဖိၪခွၫ, စအၫစဖၭအဖိၪခွၫ,",
			"36": "<sup>36</sup> ဒဲအထၧၫ့ဖုဝဲၥံၪ, စၡ့ၫမအဲအၫ, ဒဲစအၭဇရ့ၫအ့လၭ, စမံၫလ့လဲၫ,စဂံၫလ့လဲၫ,စမ့အအဲၫ, စနၥၫ့နအ့လၭ, ဒဲစယုဒၫ,စဟၫ့နနဲၫ, အီၪလၧယွၩအၡၩစဒၫဝံၭအဆၧ ၥံၫကျံၩၥၫ့ထီးၥံၪ, ဒဲၦကွ့ၭလံၬစအ့ဇရၫလၧအဝ့ၫၥံၪအ",
			"37": "<sup>37</sup> မ့ၬယၫလီၫ.- လၧတရၫ့ထံၫထၪ့ဖျိၭ, လၧအအီၪဆဲၫ ဎၩ့လၧအဝ့ၫၥံၪနီၪ, အဝ့ၫၥံၪလ့ၩထၪ့လၧစဒၫဝံၭအဒိၩ့ အဎၫ့လၧခိၪဒၧၩ့ထၪ့ဝ့ၫ လၧစဒၫဝံၭအဂံၪ့လၧထၭလ ခီၫ,ထီၩ့လၧတရၫ့ထံၫမုထၪ့လခီၫနီၪလီၫ.",
			"38": "<sup>38</sup> တၭၦစံၭထၪ့အၪ့အူၭဆၧအလဒီၪ့ဒၪ လ့ၩထၪ့ဆဲၫ ဎၩ့လၧအဝ့ၫၥံၪ, ဒဲယဝ့ၫဒၪယဖိၬအခဲၫ့,ဒဲၦခမျၧးလၧ ခိၪဒၧၩ့အလီၩ့နီၪဖိၭဖၫ့, လၧအအီၪဝ့ၫလၧဖံၫ့ချၪလး ၥံၪအထိၬထီၫအမ့ၬယၫ, ထီၩ့လၧခိၪဒၧၩ့ ဖၭလဲနီၪ,",
			"39": "<sup>39</sup> ဒဲလၧတရၫ့အံဖြံၫ့အဖၫ့ခိၪလခီၫ. ဒဲလၧတရၫ့လးလံၩ အဖၫ့ခိၪလခီၫ, ဒဲလၧတရၫ့ယၪအဖၫ့ခိၪလခီၫ,ဒဲစဟၫ့ နနံၭလၭအထိၬထီၫ, ဒဲစမံအၫအထိၬထီၫ,ထီၩ့လၧတ ရၫ့ၥိၪတၭး အဝ့ၫၥံၪဆၧၫ့ထုၪ့အီၪပထုၬလၧထီၫ့တရၫ့ အဖၧၩ့နီၪလီၫ.",
			"40": "<sup>40</sup> ဘဲၫနီၪၥိၭၦနံၫဒီၪ့နီၪ ဆၧၫ့ထုၪ့စံၭထၪ့အၪ့အူၭဆၧ လၧယွၩအဂံၪ့ဖၧၩ့ ဒဲယၧၩ, ဒဲၦပၧၩ့ဆၧၥံၪဖိၭဖၫ့အီၪ",
			"41": "<sup>41</sup> လၧယၥိၭ,- ဒဲၦလုဆၧလဖၪး စအံၫလဲအကံၫ့,စမၫအ စဲအၫ,စမနဲအမံၫ့, စမံၫခ့ယၫ,စအံၫလအံနအဲၫ,စဇ့ၭ",
			"42": "<sup>42</sup> ခရဲအၫ,စဟၫ့အနဲအၫ, အီၪလၧခွ့ၩၥံၪ,- ဒဲစမၫအစဲ အၫ,ဒဲစၡ့ၫမအဲအၫ, ဒဲစအံၫလအ့ဇၧၫ, ဒဲစအၧၭဇဲၫ, ဒဲစယဟိဟၫနၫ့, ဒဲစမၫလခဲယၫ, ဒဲစအံလၫ့,ဒဲစအံ ဇၧၫၥံၪလီၫ. တၭၦၥံၫကျံၩဆၧလဖၪနီၪ ဆၬထၪ့အလူ ဖၭဒိၪတၭ, ၦယိအဝ့ၫၥံၪ စယ့ၭဇဟဲအၫနီၪ မၩဆ့",
			"43": "<sup>43</sup> လီၫ.- တၭလၧမုလနံၩဎးနီၪဆ့အဝ့ၫၥံၪလုထၪ့ဆၧလု ဖၭဒိၪလဖၪ, ဒဲၥုၪ့ထိၬၥၭထိၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩယွၩ ဒုၭၥၭထိၬဝ့ၫလၧဆၧၥၭထိၬဖၭဒိၪနီၪး အမၫၥံၪဒဲအ ဖိၪဒံၩဖိၪၥၪၥံၪၥုၪ့ထိၬၥၭထိၬဝ့ၫဒၪဆ့လီၫ. အခိးမွဲဘဲၫ နီၪတၭယရုစလံၫ့အဆၧၥၭထိၬနီၪ ဆၧနါဂၧၫ့ဝ့ၫယဲၩ့ ယဲၩ့လ့ၬလီၫ.",
			"44": "<sup>44</sup> တၭလၧအဆၧၫ့အထီနီၪ ဒူၭၥံၪလၧဆၧဖိၪဆၧလံၩ လဖၪအဂး,လၧဆၧမၩဘိၪ့ၥံၪအဂး, လၧဆၧၥၪဆိၫ ၥံၪအဂး,ဒဲလၧဆံၫပိၩ့လပိၩ့အဂး, ဆၧအီၪက့ၪထၪ့ၦ ၡၩလနၩ့နၩ့ လၧအဖၫ့ခိၪဘဲၫၥိၭအမိအီၪက့ၪကီၪ့က ယဲဆၧဘၪဆဲၫ့လၧဆံၬၥံၪနၩၥံၪ, ဒိၩ့ၥံၪတဝၫ့ၥံၪအဆၧ လမံၩ့လါလါလၧအဝ့ၫၥံၪအဖၧၩ့ လၧၦလုဆၧၥံၪဒဲၦ လံဝဲၫဖိၪၥံၪအဂး ဘဲၫဆၧမၪလူၬအီၪဝ့ၫအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩယုဒၫၥုၪ့ထိၬၥၭထိၬ လၧၦလုဆၧၥံၪဒဲၦ",
			"45": "<sup>45</sup> လံဝဲၫဖိၪၥံၪလၧအမၩဆၧနီၪအကၠီၩ့လီၫ.- တၭၦၥံၫ ကျံၩဆၧလဖၪဒဲၦပၧၩ့တရၫ့လဖၪဆ့ ခိၭဆၧလၧအဝ့ၫ ၥံၪအယွၩအလး ဒဲဆၧမၩဆံၫ့ထၪ့ဆၧ အလးလစီၪ့ နီၪဆ့,ဘဲၫစဒၫဝံၭ ဒဲအဖိၪခွၫစစီလမၧၫ့အဆၧမၪလူၬ",
			"46": "<sup>46</sup> အီၪဝ့ၫအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩလၧစဒၫဝံၭဒဲစအၫ စဖၭအမုနံၩလဖၪလၧဖျိၩ့နီၪ, အီၪလၧဆၧၥံၫကျံၩအ ခိၪလဖၪ, ဒဲထၭခိၪစံၭထၪ့အၪ့အူၭလဖၪ, လၧအ",
			"47": "<sup>47</sup> အၪ့အူၭယွၩနီၪလီၫ.- တၭလၧစဇရၧၭဘၫဘ့လၭအ မုနံၩလဖၪနီၪ, ဒဲလၧစနံၫဟမဲအၫအမုနံၩလဖၪနီၪဆ့, အံၫစရ့လၭထီးအလူၬနီၪဖ့ၪလၫ့ဆၧလၧၦၥံၫကျံၩဆၧ လဖၪဒဲၦပၧၩ့တရၫ့ၥံၪနီၪအဂး, လနံၩအဂးလနံၩအ ဂးနီၪလီၫ. တၭအဝ့ၫၥံၪမၩဆံၫ့ဎံၪဆၧလၧၦလံဝဲၫဖိၪ ၥံၪအဂး ဒဲၦလံဝဲၫဖိၪလဖၪနီၪမၩဆံၫ့ဎံၪဆၧလၧစအၫ ရၧၫ့အဖိၪအလံၩလဖၪအဂးလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> တၭလၧမုလနံၩနီၪ အဝ့ၫၥံၪဖီစမိစ့ၭအလံၬလၧၦ ခမျၧးၥံၪအနါဖၧၩ့နီၪလီၫ. တၭလၧအဖၧၩ့နီၪဆၧဒၪ ဘၪဆၧအီၪကွ့ၭအၥၭ, လၧၦအၫမၧၫ့ဖိၪ,ဒဲၦမိအၭဖိၪ ၥံၪမိနုၬဘၪလၧယွၩအဆၧအီၪကီၪ့အဖၧၩ့ အဆိၩအ",
			"2": "<sup>2</sup> ကၠၪနီၪအ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဒၪဘၪအံၫစရ့ လၭနီၪ,လဖ့ၪလၫ့ဘၪကိၪဒဲထံၫ, ကၭအ့ၬး မွဲအအၪ့ လံၩ့န့စဘၫလၫ့ထၫ့ဒုၪဒၩဝ့ၫ, ဘဲၫၥိၭအမိဆိၪအၧၩ့ဝ့ၫ ဒၪနီၪလီၫ. မွဲလါနၫ့ဘိၩပယွၩကၠၪထဲၩ့ ဆၧဆိၪအၧၩ့",
			"3": "<sup>3</sup> နီၪလၧအကဲၪထၪ့ဆၧဆိၪဂ့ၩလခီၫလီၫ.- တၭဆၧမၩ အၥၭထီးအဝ့ၫၥံၪ နါဂၧၫ့ဆၧၥီၪ့ဆၧၥၫ့နီၪ, အဝ့ၫၥံၪ မၩလၩ့ဖၭခွံၬ အံၫစရ့လၭလၧကယဲၦခမျၧး ကျီၪမွံၩ ၥံၪထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> လၧအယီၩလချႃၭဘၪဒံၭဘၪနီၪ, ၦလုဆၧစအံၫလဲ အၡံၭ, အီၪလၧပယွၩအဂံၪ့အဒူၭအဖၫ့ခိၪတၭ, အီၪ လၧဆၧအုၩ့လၩ့လၧစတိၫဘဲအၫအၥိၭနီၪး ဒဲအတဲၩ့",
			"5": "<sup>5</sup> ဝဲၩယူၭဒူၭဖၭဒိၪလၧအဂးနီၪ,- အလးလၧအဝ့ၫၥံၪ လၧဖျိၩ့နီၪအီၪက့ၪဆၧလုလဖၪ, လီဘၫ့ၥံၪ,ဒဲဖၧၩ့ၥံၪ ထွ့ၫၥံၪ,ဒဲဘုၪၥံၪဂူၫၥံၪ အဆံၫပိၩ့လပိၩ့လဖၪ, စဘံၭ ထံၫအၥၫ့, ဒဲၥိၪ, လၧဆၧမၪလူၬဖ့ၪလၫ့ၦလံဝဲၫဖိၪၥံၪ, ဒဲၦၥံၫကျံၩဆၧၥံၪ, ဒဲၦပၧၩ့တရၫ့ၥံၪး ဒဲၦလုဆၧအဆၧ",
			"6": "<sup>6</sup> မၩဘိၪ့လဖၪဆ့လီၫ.- မွဲလါနၫ့ဘိၩဆၧမၩအၥၭထီး အလူၬယီၩ, ယဝ့ၫဒၪယအီၪလၧယရုစလံၫ့ဆ့အ့ၬ,အ ဂဲးဘဲၫယီၩ လၧဘၭဘလၧၫ့အစဎွၩစအၭတဇၧၭစံၫ အနံၪ့ၥၧၫ့ဆံၫနံၫနံၪ့လနံၪ့နီၪ, ယဂဲၫထီၩ့လၧစဎွၩအ အီၪတၭ, လၧမုနံၩလနၩ့အလးခဲၫ့နီၪ, ယန့ဘၪအခွံး",
			"7": "<sup>7</sup> လၧစဎွၩတၭ,- ယဂဲၫထဲၩ့ထီၩ့လၧယရုစလံၫ့, ယနၪ ၥ့ၪယူၭဆၧအၧၩ့ လၧစအံၫလဲအၡံၭမၩလၧစတိၫဘဲ အၫအဂး, လၧအတဲၩ့ဝဲၩဒူၭလၧအဂး လၧယွၩအဂံၪ့",
			"8": "<sup>8</sup> အဝၩ့ဖၧၩ့နီၪလီၫ.- တၭမွဲအမၩအုၭယၥၭဖၭဒိၪ, အ ခိးမွဲယခွံၬၡိၭခွံၬစတိၫဘဲအၫအဂံၪ့ အဆၧဖိၪဆၧလံၩ",
			"9": "<sup>9</sup> လၧဒူၭဖၧၩ့နီၪထီးအလူၬလီၫ.- ထီးနီၪလဖၧၫ့ ယမၪ လူၬဆၧတၭ, အဝ့ၫၥံၪမၩဆံၫ့ခွံၬဒူၭလဖၪနီၪး တၭယ ဂဲၫန့ထဲၩ့ဒီၭယွၩအဂံၪ့အဖၧၩ့ၥံၪ ထွ့ၪၥံၪအီၪက့ၪလၧ အလး, ဒဲဆၧမၩဘိၪ့ကိၪမုၬဒဲလီဘၫ့နီၪဆ့လီၫ.",
			"10": "<sup>10</sup> တၭယဒၪဘၪလၧဆၧဘၪဆဲၫ့ လၧၦလံဝဲၫဖိၪၥံၪနီၪ ဆၧဖ့ၪလၫ့ဘၪဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩ ၦလံဝဲၫဖိၪၥံၪ, ဒဲၦၥံၫကျံၩဆၧၥံၪ, လၧအမၩဆၧနီၪ,စဲၪ့ဝ့ၫကိၭဂၩဒ့ၭ",
			"11": "<sup>11</sup> နုၬလၧအဆံၬအနၩဒၪဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ယအဲၪ့ လိၬၦပၧၩ့ဆၧလဖၪတၭ, စံၭ,မွဲဘၪနီၫလၫလၧယွၩအ ဂံၪ့နီၪအီၪယူဝ့ၫလဲၪ. တၭယဒုၭအီၪကီၪ့အဝ့ၫၥံၪ,ဒဲ",
			"12": "<sup>12</sup> အီၪက့ၪဝ့ၫလၧအလးဒၪဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ၦယုဒၫ ဖိၪထီးအလူၬၥံၪဂဲၫဆိၬဆံၫပိၩ့လပိၩ့ ဘၪဆဲၫ့လၧဘုၪ ၥံၪဂူၫၥံၪ,ဒဲစဘံၭထံၫအၥၫ့, ဒဲၥိၪ,အီၪက့ၪလၧဆၧအီၪ",
			"13": "<sup>13</sup> က့ၪကီၪ့အလးနီၪလီၫ.- တၭယအီၪက့ၪထၪ့ၦလၧအ ပၧၩ့ဆၧအီၪက့ၪကီၪ့ဆၧအလးလဖၪ, ၦလုဆၧစၡ့ၫ လမဲအၫ,ဒဲၦကွ့ၭလံၬစဇၫဒီၭ, ဒဲၦဘၪဆဲၫ့လၧၦလံဝဲၫ ဖိၪ,စပၫဒယၫး လၧအဘူၭအထံးလၧအဝ့ၫၥံၪနီၪ,စ ဟၫနၫ့လၧအမွဲစဇၭခၧၫအဖိၪခွၫ, စမၭတနဲအၫအဖိၪ ခွၫး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမွဲၦအတီၩတၭ, အဆၧမၩ နီၪမွဲလၧအဘၪအၪ့နၩ့ဖၭန့ဆၧလၧ အထၧၫ့ဖုဝဲၥံၪအ ဂးနီၪလီၫ.",
			"14": "<sup>14</sup> ယယွၩဧ့,နၪ့ထၪ့ထဲၩ့ယၧၩ, လၧဆၧလမံၩ့ယီၩအ ဂဲးအကၠီၪ့တၭ, ယဆၧမၩဂ့ၩလဖၪလၧယမၩလၧယ ယွၩအဂံၪ့နီၪ, ဒဲအဆၧယိထဲၩ့ခွါထဲၩ့လဖၪနီၪ, ထီး ထူၭခွံၬလဂ့ၩ.",
			"15": "<sup>15</sup> တၭလၧမုနံၩလဖၪနီၪ, လၧယုဒၫအဖၧၩ့ယဒၪဘၪ ၦယဲးစဘံၭၥၪလၧမးၥံၫအနံၩ, ဒဲဂဲၫဆိၬဘုၪလၧၫ့ၥံၪ,ဒဲ ဖဒၨၭဆၧလၧကၥ့ၪယီၩ့ခိၪး စဘံၭထံၫဆ့, စဘံၭၥၪ ၥံၪ,ဒဲချိၪ့ဒိၩ့ၥၪၥံၪ, ဒဲကယဲဆၧဎၧၫ့လမံၩ့လါလါ,လၧ အဂဲၫဆိၬဝ့ၫထီၩ့လၧ ယရုစလံၫ့အဖၧၩ့ လၧမးၥံၫအ နံၩနီၪး တၭယထိးယၥၭထၫ့ဒၩအဝ့ၫၥံၪ လၧမုနံၩလၧ",
			"16": "<sup>16</sup> အဝ့ၫၥံၪအၪ့ဆၫခွံၬဆၧအၪ့ဆၧအီၩနီၪလီၫ.- တၭၦတဲ ရၫဖိၪၥံၪအီၪဝ့ၫလၧအဖၧၩ့ဆ့, လၧအဂဲၫဆိၬယၪၥံၪ, ဒဲကယဲဆၧဖိၪဆၧလံၩလမံၩ့လါလါတၭ, လၧမးၥံၫအ နံၩနီၪ, အဝ့ၫၥံၪအၪ့ဆၫခွံၬလၧၦယုဒၫဖိၪ, ဒဲလၧယရု",
			"17": "<sup>17</sup> စလံၫ့အဖၧၩ့နီၪဆ့လီၫ.- ထီးနီၪလဖၧၫ့ယအဲၪ့လိၬၦယု ဒၫအၡၩလၩဖၩ့ၥံၪတၭ, ယစံၭအဝ့ၫၥံၪ, ဆၧအၧၩ့ လၧနၥံၪမၩယီၩ, ဒဲမၪဘၪမးၥံၫအနံၩ, မွဲဆၧနီၪလမံၩ့",
			"18": "<sup>18</sup> လဲၪ.- နၥံၪအဖါၥံၪမၩဝ့ၫဘဲၫနီၪၥိၭမွဲအ့ၬဧၪး ဒဲပယွၩ ဒုၭအီၪထၪ့ဆၧအၧၩ့ထီးအလူၬယီၩလၧပလီၩ့, ဒဲလၧ ဒိၩ့အလီၩ့ယီၩဆ့မွဲအ့ၬဧၪ. မွဲလါနၫ့ဘိၩလၧနၥံၪမၪ ဘၪမးၥံၫအနံၩအကၠီၩ့နီၪ, နၥံၪဒုၭအၪထၪ့ဆၧၥၭထၪ့ လၧအံၫစရ့လၭအလီၩ့လီၫ.",
			"19": "<sup>19</sup> ဆၧမၩအၥၭထီးဆၧခံၭလၩ့ၥၫ့ လၧယရုစလံၫ့အ တရၫ့ၥံၪ, လၧအလချႃၭဘၪဒံၭဘၪမးၥံၫအနံၩနီၪ,ယ မၪလူၬဆၧလၧအဘၪ ကၭဘံၭထၬတရၫ့လဖၪ, ဒဲမၪ လူၬဆီၪ့ဝ့ၫ လၧမးၥံၫအနံၩလချႃၭဖီၩ့ခွံၬဒံၭဘၪနီၪ, ထီးဝဲထၪ့လဂ့ၩး ဒဲယခ့ၫယၡၩလနၩ့နၩ့နီၪ ယအီၪ က့ၪလၧတရၫ့ထံၭ, ဘဲၫၥိၭၦၡၩ ထီးဂဲၫဆိၬနုၬဆၧ",
			"20": "<sup>20</sup> ဎၧၫ့လၧမးၥံၫအနံၩနီၪလၩလါလဂ့ၩ.- အခိးမွဲၦဖနံၬ ဖိၪၥံၪ,ဒဲၦအၪ့ဆၫဆၧလမံၩ့လါလါနီၪ, မံၫဝ့ၫလၧယရု",
			"21": "<sup>21</sup> စလံၫ့လၧခီၫ့လခီၫလဖၧၫ့နံၫဖၧၫ့လီၫ.- ထီးနီၪလ ဖၧၫ့ယထိးယၥၭထၫ့ဒၩအဝ့ၫၥံၪတၭး စံၭအဝ့ၫၥံၪ,မွဲ ဘၪနီၫလၫလၧနၥံၪမံၫ လၧခိၪဒၧၩ့အနဲၩ့ထံၭ နီၪလဲၪ. နၥံၪအ့ၪမၩဘဲၫနီၪၥိၭ နးဖၧၫ့ဒီၭတၭ, ယမိအီၪက့ၪယ စူၪလၧနၥံၪအလီၩ့လီၫ. အခီၫဒၪလၧအဆၧၫ့အထီနီၪ, အဝ့ၫၥံၪဂဲၫလၧၩ့လၧမးၥံၫအနံၩအ့ၬ.",
			"22": "<sup>22</sup> တၭယမၪလူၬၦလံဝဲၫဖိၪၥံၪ, လၧအဘၪမၩဆံၫ့အ နၫ့ဆါဒၪဝ့ၫလဖၪ, ဒဲလၧအဘၪဂဲၫခိၭတရၫ့ၥံၪ,လၧအ မိမၩဆံၫ့ဎံၪထၪ့မးၥံၫအနံၩနီၪလီၫ. ယယွၩဧ့,နၪ့ထၪ့ ထဲၩ့ယၧၩလၧဆၧလမံၩ့ယီၩ အဂဲးအကၠီၪ့ဆ့,ဒဲအွံၪ ၥၭဆၧၩ့ဒၪခလူၬယၧၩ, ဘဲၫနဆၧယၫ့ၥၭအၪအီၪဝ့ၫအ ၥိၭနီၪဆံၭ.",
			"23": "<sup>23</sup> တၭလၧမုနံၩလဖၪနီၪ ယဒၪဘၪၦယုဒၫဖိၪၥံၪလၧ အန့မၫလဖၪလၧအၭၡဒီၭ, လၧအၫမၧၫ့, ဒဲလၧမိအၭ",
			"24": "<sup>24</sup> ၥံၪတၭး- အဝ့ၫၥံၪအဖိၪအလံၩလဖၪချဲၩ့ဆၧဖိၭဖၫ့လၧ အၭၡဒီၭအလၨတၭ, ချဲၩ့ဝ့ၫလၧၦယုဒၫဖိၪၥံၪအလၨ",
			"25": "<sup>25</sup> ၥ့ၪအ့ၬး အ့ၪမွဲလၧၦခမျၧးၥံၪအလၨဆုၬဆုၬလီၫ.- တၭ ယအဲၪ့လိၬအဝ့ၫၥံၪ, ဒဲဆိၪအၧၩ့အဝ့ၫၥံၪ,ဒဲဒိၪအဝ့ၫၥံၪ လနၩ့နၩ့တၭ, ယထ့ၭခွံၬအဝ့ၫၥံၪအခိၪၥူၫ,ဒဲအၪ့မၧၫ့ အဆိၪလၩ့အၥၭလၧယွၩအမ့ၬယၫ, ဘဲၫယီၩ,နၥံၪထီး ဖ့ၪလၫ့နဖိၪအမုၪၥံၪလဖၪ လၧအဝ့ၫၥံၪအဖိၪခွၫလဖၪ အဂးလဂ့ၩး ဒဲနၥံၪထီးမၩန့အဝ့ၫၥံၪ အဖိၪမုၪလဖၪ လၧနၥံၪအဖိၪခွၫၥံၪအဂးလဂ့ၩး ထီးမၩလၧနၥံၪအနၫ့",
			"26": "<sup>26</sup> ဆါဒၪဝ့ၫအဂးလဂ့ၩ.- အံၫစရ့လၭအစဎွၩစီလမၧၫ့နီၪ, မၪဘၪဆၧလၧဆၧယီၩလဖၪအကၠီၩ့နီၪ, မွဲအ့ၬဧၪ.မွဲ လါနၫ့တၭလၧၦအၪဆၨၩၥံၪအကျၩနီၪ, စဎွၩဘဲၫအ ဝ့ၫဒၪအၥိၭအီၪနးဂၩအ့ၬ, လၧအမွဲအယွၩဒၪဝ့ၫအ ၥၭဘီၩ့နီၪ,ဒဲယွၩဒုၭကဲၪထၪ့အံၫစရ့လၭ ထီးအလူၬ အစဎွၩနီၪလီၫ. မွဲလါနၫ့ဘဲၫနီၪတၭ, အဝ့ၫဒၪနီၪဒၪလ့ၬ,",
			"27": "<sup>27</sup> ၦမုၪအအၧၩ့ၥံၪဒုၭမၩမၪအဆၧဆ့လီၫ.- အခိးမွဲပ ကြၨၭ ခိၭနၪနၥံၪအလူမၩဆၧအၧၩ့ဖၭဒိၪ ထီးအလူၬ ယီၩလၧၦန့မၫၥံၪ လၧၦလခီၫဘၩ့မုးဖိၪ အကျၩနီၪ တၭ,မၪဘၪပယွၩနီၪဆ့ဧၪ.",
			"28": "<sup>28</sup> တၭစယီအဒၫအဖိၪခွၫလဂၩ, ၦလုဆၧအခိၪစအံၫ လဲအၡံၭအဖိၪခွၫနီၪ, မွဲၦဟီၫဖိၪစစၫ့ဘၪလၭအမၬနီၪ",
			"29": "<sup>29</sup> လီၫ.- အခိးမွဲယနၫ့ထၪ့ခွံၬအဝ့ၫဒၪ လၧယမ့ၬယၫလီၫ. ယယွၩဧ့, နၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪဆံၭး အဂဲးဘဲၫယီၩမွဲ အမၩစံၪစၪၦလုဆၧအလး ဒဲၦလုဆၧအလးအဆၧ အုၩ့လၩ့နီၪ, ဒဲလၧၦလံဝဲၫဖိၪလဖၪဆ့လီၫ.",
			"30": "<sup>30</sup> ဘဲၫနီၪၥိၭယမၩဆံၫ့ခွံၬအဝ့ၫၥံၪ လၧၦလခီၫဘၩ့မုး ဖိၪၥံၪ,ဒဲအီၪက့ၪၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫဖိၪၥံၪလဆၫ့လ ဆၫ့လဖၪ,ကိၭဂၩဒ့ၭ, လဂၩလၧအဆၧမၩဒၪဝ့ၫ,လ",
			"31": "<sup>31</sup> ဂၩလၧအဆၧမၩဒၪဝ့ၫ,- ဒဲလၧၥံၪ့မုဘၪဆဲၫ့လၧလုထၪ့ ဆၧအဂး,ဘဲၫဆၧဖၭဝဲၩအနံၩအၥၫ့အၥိၭ, ဒဲလၧဆၧ ၥၪဆိၫလဖၪနီၪအဂးဆ့လီၫ. ယယွၩဧ့, နၪ့ထၪ့ထဲၩ့ ယၧၩ, လၧဆၧဂ့ၩအဂးဆံၭ."
		}
	}
};
